INSERT INTO `post` VALUES (1,'Reverse number','reverse-number','<p>Problem:</p><p class=\"ql-indent-2\">Given the number N, print reverse of number N. Note: do not print leading zeros in output. </p><p class=\"ql-indent-2\">For example N = 100, Reverse will be 1, not 001</p><p class=\"ql-indent-2\">input: input contains a single integer N.</p><p class=\"ql-indent-2\">Output: print reverse of integer N.</p><p class=\"ql-indent-2\">Constraints:</p><p class=\"ql-indent-2\">1&lt;=N&lt;=10_000</p><p>Solution: </p><p>First reverse the integer, you can do this in various ways, but the easiest would be to transform it into a string, then reverse the string.</p><p>Lex x be the integer you want to reverse.</p><pre><code>String reversed = new StringBuilder().append(x).reverse().toString();\nSystem.out.println(reversed);\n</code></pre><p><br></p><p>Since the question asks for no leading zeros you can get that desired output by putting the reversed value back into an integer like so:</p><pre><code>Integer.parseInt(reversed);\n</code></pre><p><br></p><p>Make sure to comment below if this was helpful to you. See you next time.</p>','2018-08-17 00:00:00',1,6,19,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2,'Gift distance','gift-distance','<p>Problem:</p><p class=\"ql-indent-2\">You are on your way to find the gifts. All the gifts lie in your path in a straight line at prime numbers and your house is at 0. </p><p class=\"ql-indent-2\">Given your current position find the closest gift to your position, and calculate the distance between your current position and gift and tell the distance. </p><p>Solution:</p><p>The problem is asking what the nearest prime to the current location is. Every prime is surrounded by other numbers (869, 870, ...) which can be prime; for example, 870 has the prime 877 close to it, but also 863, they are both 7 numbers away, resulting in the output of 7, but if that wasn\'t the case, then the closest prime distance would be the answer.</p><p><br></p><p>We first need a way to know when a number is prime, which requires simple math:</p><pre><code>private static boolean check_prime(long n) {\n    for(long i = 2; i&lt;Math.sqrt(n);i++) {\n        if((n%i)==0)\n            return false;\n    }\n    return true;\n}\n</code></pre><p><br></p><p>or you can use the built in function of big integer to check for primes:</p><p><br></p><pre><code>private static boolean check_prime(long n)\n{\n    // Converting long to BigInteger\n    BigInteger b = new BigInteger(String.valueOf(n));\n\n    return b.isProbablePrime(1);\n}\n</code></pre><p><br></p><p>Once you have that, you have to loop to both sides of the number and continuously check if the number that you looped to is prime, like so:</p><p><br></p><pre><code>while (true) {\n    long number, i;\n\n    // get input from keyboard\n    Scanner scanner = new Scanner(System.in);\n    number = scanner.nextLong();\n\n    if (check_prime(number))\n        // if already prime, just print 0\n        System.out.println(0);\n    else {\n        // loop to both sides of the number\n        for (i = 1; i &lt; number - 2; i++) {\n            // this print is for debugging purposes\n            System.out.println((number - i) + \", \" + (number + i));\n            if (check_prime(number - i)) {\n                // found answer as prime before input\n                System.out.printf(\"%d\\n\", (number - (number - i)));\n                break;\n            } else if (check_prime(number + i)) {\n                // found answer as prime after input\n                System.out.printf(\"%d\\n\", ((number + i) - number));\n                break;\n            }\n        }\n    }\n}\n</code></pre><p><br></p><p>Hope this helped!</p>','2018-08-17 00:00:00',1,6,20,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(3,'Maximum number','maximum-number','<p><strong>Problem:</strong></p><p class=\"ql-indent-2\">Given an array of numbers, arrange them in a way that yields the largest value. For example, if the given numbers are {154, 546, 548, 60}, the arrangement 6054854654 gives the largest value. </p><p class=\"ql-indent-2\">Input: First line contains an integer N , Next line contains N integers separated by space. </p><p class=\"ql-indent-2\">Output: Print the maximum number that can be obtained by using given numbers. </p><p class=\"ql-indent-2\">Constraints: 1&lt;=N&lt;=1000000</p><p><strong>Solution:</strong></p><p>First you need to have the numbers stored in an array of integers, then you do the following:</p><p><br></p><pre><code>private static String largestNumber(int[] nums) {\n    String[] strings = new String[nums.length];\n    \n    // convert the integer array into a string array\n    for (int i = 0; i &lt; nums.length; i++) {\n        strings[i] = String.valueOf(nums[i]);\n    }\n    \n    // sort the string array by comparing values a and b\n    // for example: \"9\" + \"8\" vs \"8\"+ \"9\", \"98\" &gt; \"89\" so \"98\" goes first\n    Arrays.sort(strings, (a, b) -&gt; (b + a).compareTo(a + b));\n    \n    // combine the array into a big string\n    StringBuilder sb = new StringBuilder();\n    for (String s : strings) {\n        sb.append(s);\n    }\n    \n    // remove any leading zeros\n    while (sb.charAt(0) == \'0\' &amp;&amp; sb.length() &gt; 1)\n        sb.deleteCharAt(0);\n    \n    // return the final value as a string, since it can be large and cause overflow\n    return sb.toString();\n}\n</code></pre><p><br></p><p>-- EDIT --</p><p>It seems that the java solution was a bit confusing with the lambda expression, so I will do the same logic, but in C++</p><p><br></p><pre><code>int compareStrings(string a, string b)\n{\n    // first append b to the end of a\n    string ab = a.append(b);\n\n    // then append a to the end of b\n    string ba = b.append(a);\n\n    // Now check which merge is bigger\n    if(ab.compare(ba) &gt; 0){\n        return 1;\n    }\n    return 0;\n}\n\nvoid printLargest(vector&lt;string&gt; arr)\n{\n    // sort from beginning to end using the compareString method.\n    // if any doubt, look at the online documentation for\n    // method specifications\n    sort(arr.begin(), arr.end(), compareStrings);\n\n    // now that the array is sorted, just print out\n    for (int i=0; i &lt; arr.size() ; i++ )\n        cout &lt;&lt; arr[i];\n}\n</code></pre><p><br></p><p>Just call printLargest with a list of strings, such as</p><p><br></p><pre><code>vector&lt;string&gt; arr;\n\n//output should be 6054854654\narr.push_back(\"54\");\narr.push_back(\"546\");\narr.push_back(\"548\");\narr.push_back(\"60\");\nprintLargest(arr);\n</code></pre><p><br></p><p>Comment if you need anything else!</p>','2018-10-27 13:22:24',1,6,21,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(4,'Honest goblins are easy to find','honest-goblins-are-easy-to-find','<h1>Problem</h1><p class=\"ql-indent-1\">At Hogwarts a new shipment of n goblins has arrived, To be of any use, a goblin must be completely truthful (never lies). Unfortunately, not all of the n goblins in the shipment are truth tellers. Only some are truth-tellers, and some are deceivers. It is your task to design an algorithm to separate the truth-teller goblins from the deceiver goblins. To do this, you have one tool available: You may combine any two goblins and have them state whether the other goblin is a truth-teller or a deceiver. A truth-teller will always say correctly what the other goblin is, but a deceiver may lie (but also may sometimes tell the truth to REALLY confuse you). For any two goblins that you test, the following can be concluded from the goblin responses:</p><p class=\"ql-indent-1\"><br></p><p class=\"ql-indent-1\">Goblin A says	B is a truth-teller,  Goblin B says	A is a truth-teller =&gt; both are truth tellers, or both are deceivers                                      </p><p class=\"ql-indent-1\">Goblin A says 	B is a truth-teller, Goblin B says A is a deceiver =&gt;  at least one is a deceiver</p><p class=\"ql-indent-1\">Goblin A says B is a deceiver, Goblin B says A is a truth-teller =&gt;  at least one is a deceiver</p><p class=\"ql-indent-1\">Goblin A says B is a deceiver, Goblin B says A is a deceiver =&gt;  at least one is a deceiver</p><p class=\"ql-indent-2\"><br></p><ol><li><span>Show that if more than n/2 goblins are deceivers, it is impossible to determine which goblins are the truth-tellers using only the pairwise testing strategy.</span></li><li><span>Consider the problem of identifying 1 truth-teller goblin. Show that if we assume that at least n/2 of the goblins are truth-tellers, then the problem of finding a single truth-teller from n goblins can be reduced to a problem of about half the size using n/2 goblin comparisons.</span></li><li><span>Use a recurrence equation to show that if at least half of the goblins are truth-tellers then truth-tellers can all be identified within O(n) goblin comparisons.</span></li></ol><p><br></p><h1>Solution</h1><ol><li><span>The problem states that n is the number of total goblins. Let t be the number of truth tellers, and the number of deceivers be d = n - t.  From this assumption we can create 2 sets, each of size of t; let the set of truth-tellers be T and the set of deceivers be D. Now assume that the goblins in set D will always answer \"T is a deceiver\" and \"D is a truth-teller\" (lie in both cases), and the goblins in set T will always tell the truth. As you can tell by this assumption, T will always answer \"truth-teller\" when paired with another T, and answer \"deceiver\" when paired with a D. Therefore, the goblins will mirror answers and make it difficult to figure out what goblin is a deceiver or truth teller.</span></li><li><span>The algorithm is as follows: Pair the goblins, and ask them the question. If both answers </span><strong>aren\'t</strong><span> \"Goblin X is a truth-teller\" then eliminate the pair; the remaining (n-2) goblins still have a majority of true goblins. Now you are left with pairs in which you know for a fact that they are both truth tellers, or both deceivers. Remove 1 goblin from each pair, as they have have the same nature. Repeat the algorithm (recursively) until only 1 or 2 goblins remain, which are all truth tellers.</span></li><li><span>Let T(n) be the comparisons needed in n goblins. The algorithm results in the recurrence of T(n/2)+n/2 as you split the problem in half every time, and then have to compare all the goblins in groups of 2. Solving the recurrence gives T(n) = O(n). Now to know which goblins are truth tellers just grab the goblin(s) that you for sure know are truth tellers, and walk through all the goblins asking that truth goblin what the other goblin is. Walking through all the goblins give a runtime of O(n). total runtime =&gt; O(n) + O(n) = O(2n) = O(n)</span></li></ol>','2019-04-07 16:10:12',1,6,22,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(6,'Discord bot','discord-bot','<p><strong>Hello, in this article I will be teaching you how to create a discord bot in java using Discord4j API.</strong></p><p>To start off you need to download the API at: <a href=\"https://discord4j.com/downloads.html\" target=\"_blank\">https://discord4j.com/downloads.html</a><span style=\"color: rgb(102, 163, 224);\"> </span>and import it into your project.If you don\'t know how to import a library into your project check out the java tutorials <a href=\"https://kodecentral.com/post/environment-setup\" target=\"_blank\">Environment Setup</a>!</p><p><br></p><p><strong><u>If you prefer adding the API in an alternative way you can do the following:</u></strong></p><h3><strong>With Maven</strong></h3><pre><code>pom.xml \n&lt;repositories&gt;\n  &lt;repository&gt;\n    &lt;id&gt;jcenter&lt;/id&gt;\n    &lt;url&gt;http://jcenter.bintray.com&lt;/url&gt;\n  &lt;/repository&gt;\n&lt;/repositories&gt;\n\n&lt;dependencies&gt;\n  &lt;dependency&gt;\n    &lt;groupId&gt;com.discord4j&lt;/groupId&gt; &lt;!-- However our packages are all under sx.blah in version 2.x! --&gt;\n    &lt;artifactId&gt;Discord4J&lt;/artifactId&gt;\n    &lt;version&gt;@VERSION@&lt;/version&gt;\n  &lt;/dependency&gt;\n&lt;/dependencies&gt;\n</code></pre><h3><strong>With Gradle</strong></h3><pre><code>build.gradle\nrepositories {\n  jcenter()\n}\n\ndependencies {\n  compile \"com.discord4j:Discord4J:@VERSION@\"\n}\n</code></pre><h3><strong>With SBT</strong></h3><pre><code>build.sbt\nlibraryDependencies ++= Seq(\n  \"com.discord4j\" % \"Discord4J\" % \"@VERSION@\"\n)\n\nresolvers += \"jcenter\" at \"http://jcenter.bintray.com\"\n</code></pre><p><strong>After importing the library you will want to head over to </strong><a href=\"https://discordapp.com/developers/applications/\" target=\"_blank\" style=\"color: rgb(102, 163, 224);\"><strong>https://discordapp.com/developers/applications/</strong></a><strong style=\"color: rgb(102, 163, 224);\"> </strong><strong>to create a bot application for discord.</strong></p><p><strong>After creating a bot application you will want to click reveal (clients secret) and that will inform you about your bots token copy and paste it and we can jump into coding the bot.</strong></p><p><strong>Logging into the bots client:</strong></p><pre><code>public class DiscordBot {\n    public static final IDiscordClient bot = createClient(\"Token\",true);\n    public static void main (String args []) throws Exception {\n               //register listener so it can recieve messages \n                EventDispatcher ds = bot.getDispatcher();\n                ds.registerListener(new BotListener()); \n            }\n                public static IDiscordClient createClient(String token, boolean login) { // Returns a new instance of the Discord client\n                ClientBuilder clientBuilder = new ClientBuilder(); // Creates the ClientBuilder instance\n                clientBuilder.withToken(token); // Adds the login info to the builder\n                try {\n                    if (login) {\n                        return clientBuilder.login(); // Creates the client instance and logs the client in\n                    } else {\n                        return clientBuilder.build(); // Creates the client instance but it doesn\'t log the client in yet\n                    }\n\n\n                    } catch (DiscordException e) { // This is thrown if there was a problem building the client\n                    e.printStackTrace();\n                    return null;\n                }\n            }\n        }\n</code></pre><p>Finally, make another class named the same class that you passed within the parameters of the ds.registerListener() like shown in the example above.</p><pre><code>public class BotListener {\n//NOTE: Different types of Listeners\n/*MessageUpdateEvent\n&nbsp;MessageSendEvent\n&nbsp;MessageDeleteEvent\n&nbsp;MessageEditEvent\n*/\n@EventSubscriber\npublic void onMessageEvent(MessageReceivedEvent e){\nString message = e.getMessage().getContent();\nChannel channel = e.getChannel();\nif(message.equalsIgnoreCase(\"hello\")){\n&nbsp;channel.sendMessage(\"World\");\n&nbsp;&nbsp;}\n&nbsp;}\n}\n</code></pre><p><br></p><p>if you have any questions comment below!</p>','2018-08-18 00:00:00',2,4,1,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(7,'Directories','directories','<p><strong><u>Overview</u></strong></p><p>The directory structure that all projects must follow for readability and consistency.</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/cookbook/master/img/directories.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/cookbook/master/img/directories.png\" style=\"\" width=\"176\"></a></p><p><strong><u>Structure explanation</u></strong></p><p>app directory: contains the slim controllers and the views</p><ul><li>controllers directory: Slim route organization (not necessary for small projects)</li><li>views directory: all php views</li></ul><p>data directory: contains files concerning the database</p><ul><li>generated-conf directory: contains propel\'s config.php with connection configurations</li><li>generated-sql directory: contains default sql dump (no insertions)</li></ul><p>html directory: contains files accessible directly to the user (anything that doesn\'t require protection)</p><ul><li>css/fonts/img/js directories: files that correspond to css, font, images, and javascript files in that order</li><li>.htaccess file: used to remove index.php from the url</li><li>index.php file: main entrance point</li></ul><p>notes directory: contains any updates of work or explanation</p><p>vendor directory: contains dependencies downloaded with composer (not shown in the pic)</p><p>composer.(json/lock) file: created by composer</p><p>propel.yml[.dist] file: created by propel to define a connection</p><p>README.md file: short project description</p><p>config.php file: contains the array needed for slim settings, and other functions that should be available globally</p><p><br></p><p><strong><u>Directory notes</u></strong></p><p>Window uses \\ as a path delimiter, while Unix-based machines use /, for the following commands concerning paths (such as vendor/bin/propel init) make sure to use the path separator corresponding to your machine. Keep in mind that the directory structure is used to keep projects organized, and is subject to tweaks, but the main structure will stay relatively similar from project to project.</p>','2018-11-13 17:44:04',1,2,5,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(10,'XAMPP','xampp','<p><strong><u>Overview</u></strong></p><p>XAMPP is a completely free, easy to install Apache distribution containing MariaDB, PHP, and Perl. The XAMPP open source package has been set up to be incredibly easy to install and to use.</p><p><br></p><p><strong><u>Installation</u></strong></p><p><a href=\"https://sourceforge.net/projects/xampp/files/XAMPP%20Mac%20OS%20X/7.1.9/\" target=\"_blank\">Download and install XAMPP</a>. Once XAMPP installs open manager.app, which is located at <strong>/Applications/XAMPP/xamppfiles/manager-osx.app</strong> on mac. You should see the following welcome screen:</p><p><br></p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/xampp.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/xampp.png\" style=\"display: block; margin: auto;\" width=\"425\"></a></p><p>Turn on the following options:</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/cookbook/master/img/xampp_on.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/cookbook/master/img/xampp_on.png\" style=\"display: block; margin: auto;\" width=\"425\"></a></p><p>Open your browser and go to <a href=\"http://localhost\" target=\"_blank\">http://localhost</a> to see the XAMPP welcome page. Dig around your files to find where XAMPP was installed (<strong>/Applications/XAMPP/xamppfiles/htdocs/</strong> in mac) and delete <u>index.php</u>. reload localhost and you should now see the directory structure. Make a new directory in <strong>htdocs</strong>/ named <strong>first/ </strong>and make an index.php file inside it, with a simple PHP script:</p><pre><code>&lt;!DOCTYPE html&gt;\n&lt;html&gt;\n &lt;head&gt;\n  &lt;title&gt;Title&lt;/title&gt;\n &lt;/head&gt;\n &lt;body&gt;\n  &lt;?=\"Hello World!\"?&gt;\n &lt;/body&gt;\n&lt;/html&gt;\n</code></pre><p>Output: Hello world!</p>','2018-11-06 10:14:37',1,2,2,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(11,'Github','github','<p><strong><u>Overview</u></strong></p><p>GitHub is a web-based hosting service for version control using git. It is mostly used for computer code. It offers all of the distributed version control and source code management functionality of Git as well as adding its own features.</p><p><br></p><p><strong><u>Installation</u></strong></p><p>To install git on your machine follow the instructions at <a href=\"https://git-scm.com/downloads\" target=\"_blank\">https://git-scm.com/downloads</a>. Once it\'s installed, run the command git in the terminal, and you should receive instructions on how to use git.</p><p><br></p><p><strong><u>Set global username and email</u></strong></p><p>Run the following commands on the terminal to save your information for future commits (replace with your real info, not John Doe\'s)</p><pre><code>git config --global user.name \"John Doe\"\ngit config --global user.email johndoe@example.com\n</code></pre><p><br></p><p><strong><u>Getting started with a new project</u></strong></p><p>First move into htdocs with the terminal:</p><pre><code>cd /Applications/XAMPP/xamppfiles/htdocs\n</code></pre><p>Then create a new folder which will hold your project files and cd into it. to initialize a git repo in that folder do</p><pre><code>git init .\n</code></pre><p>In order to link it with the cloud repo, you have to make at least one change. Create a README.MD file in the directory, and then commit it:</p><pre><code>git add .\ngit commit -m \"init commit\"\n</code></pre><p>Log into your <a href=\"github.com\" target=\"_blank\">github account</a> on your browser, and create a new repo, then run the following commands:</p><pre><code>git remote add origin repo_url.git\ngit push -u origin master\n</code></pre><p>To add a collaborator to the github repo, go to your repo, then settings, click on collaborators on the left hand side, and input their username. The user must then go into their account and accept.</p><p><br></p><p><strong><u>Important git commands</u></strong></p><p>git init .</p><ul><li>Initialize a Git repository in the current directory</li></ul><p>git clone repo_url.git</p><ul><li>Create a local copy of a remote repository</li></ul><p>git status</p><ul><li>Check status since last pull</li></ul><p>git add [file]</p><ul><li>Add a file to the staging area</li></ul><p>git add -A</p><ul><li>Add all new and changed files to the staging area</li></ul><p>git commit -m \"commit message\"</p><ul><li>Commit your messages</li></ul><p>git push -u origin [branch name]</p><ul><li>Push a branch to your remote repository (almost always master) and remember the branch</li></ul><p>git push</p><ul><li>Push changes to remote repository of remembered branch</li></ul><p>git pull</p><ul><li>Update local repository to the newest commit</li></ul><p>git remote add origin repo_url.git</p><ul><li>Add a remote repository</li></ul><p>git rm -r [file]</p><ul><li>Remove a file or directory</li></ul><p><br></p><p><strong><u>Gitignore file</u></strong></p><p>Create a .gitignore file in the root of the local repository. Git will look at the contents of this file and decide what items to ignore, such as large files not suitable for pushing. For example, a .gitignore file that excludes the large vendor folder from being pushed:</p><pre><code>vendor/*\n</code></pre><p>Make sure to never push vendor/, as it will cause headaches and reduce efficiency.</p><p><br></p><p><strong><u>Github notes</u></strong></p><p>These commands will be mostly used while working in a group project, if you encounter a problem or would like to learn more, go to <a href=\"https://try.github.io/\" target=\"_blank\">https://try.github.io/</a>. Unlimited private remote repositories are available through a fee, or by registering as a student, which is recommended. Merge conflicts can be a pain to deal with, and therefore should be resolved with atom/sublime or be avoided completely. Make sure to always pull before you push, and therefore obligating you to commit any changes.</p>','2018-08-24 16:38:04',1,2,3,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(12,'Composer','composer','<p><strong><u>Overview</u></strong></p><p>Composer is an application-level package manager for the PHP programming language that provides a standard format for managing dependencies of PHP software and required libraries.</p><p><br></p><p><strong><u>Installation</u></strong></p><p>Download the latest composer.phar file from the <a href=\"https://getcomposer.org/download/\" target=\"_blank\">download page</a> (scroll to the bottom). Check where the file downloaded to (most likely the downloads folder) and then move to user/local/bin</p><pre><code>sudo mv composer.phar /usr/local/bin/composer\n</code></pre><p>If you still have problems, such as \"No file or directory\", then create the bin directory if it doesn\'t exist and try again.</p><pre><code>mkdir -p /usr/local/bin\n</code></pre><p>If composer still can\'t be installed, then open the bin folder manually with</p><pre><code>open /usr/local/bin\n</code></pre><p>and drag composer.phar in there, and remove the .phar extension.</p><p><br></p><p>Once it\'s installed, run composer in the terminal, and you should receive the composer screen. In case of an error, make sure you follow the steps correctly with admin privileges (e.g. using sudo on a Unix machine).</p><p><br></p><p><strong><u>Important composer commands</u></strong></p><p>composer require package/library</p><ul><li>Will update composer.json with the new dependency or create a new composer.json and composer.lock if they don\'t exist</li></ul><p>composer install</p><ul><li>Installs the vendor packages according to composer.lock (or creates composer.lock file if not present)</li></ul><p>composer update</p><ul><li>Will regenerate composer.lock with the new composer.json dependencies and versions, no matter if composer.lock exists or not</li></ul><p>composer dump-autoload -o</p><ul><li>Regenerates the list of all classes that need to be included in the project (vendor/composer/autoload_classmap.php).</li></ul>','2019-01-15 15:07:02',1,2,4,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(13,'Propel','propel','<p><strong><u>Overview</u></strong></p><p>Propel is a free, open-source object-relational mapping toolkit written in PHP. It is also an integral part of the PHP framework Symfony and was the default ORM up to, and including version 1.2.</p><p><br></p><p><strong><u>Important Propel commands</u></strong></p><p>vendor/bin/propel init</p><ul><li>Initialize propel installation</li></ul><p>vendor/bin/propel reverse</p><ul><li>Create a new schema.xml with the updated database information (inside generated-reversed-database/ directory)</li></ul><p>vendor/bin/propel model:build</p><ul><li>Rebuild the models according to schema.xml</li></ul><p><br></p><p><strong><u>Many-to-many</u></strong></p><p>To create the many to many relationship make sure the conjuction table has</p><pre><code>isCrossRef=\"true\"\n</code></pre><p>in their table schema</p><p><br></p><p><strong><u>Validate functionality</u></strong></p><p>The schema.xml file lives in data/models/ directory, and has the structure of the database. One of the most important additions to schema.xml is the validate behavior:&nbsp;</p><pre><code>&nbsp; &lt;table name=\"library\" idMethod=\"native\" phpName=\"Library\"&gt;\n&nbsp; &nbsp; &lt;column name=\"id\" phpName=\"Id\" type=\"INTEGER\" primaryKey=\"true\" autoIncrement=\"true\" required=\"true\"/&gt;\n&nbsp; &nbsp; &lt;column name=\"name\" phpName=\"Name\" type=\"VARCHAR\" size=\"128\" required=\"true\"/&gt;\n&nbsp; &nbsp; &lt;unique name=\"name\"&gt;\n&nbsp; &nbsp; &nbsp; &lt;unique-column name=\"name\"/&gt;\n&nbsp; &nbsp; &lt;/unique&gt;\n&nbsp; &nbsp; &lt;vendor type=\"mysql\"&gt;\n&nbsp; &nbsp; &nbsp; &lt;parameter name=\"Engine\" value=\"InnoDB\"/&gt;\n&nbsp; &nbsp; &lt;/vendor&gt;\n&nbsp; &nbsp; &lt;behavior name=\"validate\"&gt;\n&nbsp; &nbsp; &nbsp; &lt;parameter name=\"rule1\" value=\"{column: name, validator: NotNull}\"/&gt;\n&nbsp; &nbsp; &nbsp; &lt;parameter name=\"rule4\" value=\"{column: name, validator: Unique}\"/&gt;\n&nbsp; &nbsp; &lt;/behavior&gt;\n&nbsp; &lt;/table&gt;\n</code></pre><p>The validate behavior must go after the vendor section and before the end of the table which you\'re adding the validation rules. Once the validation rules are set in the schema.xml, save the file and run vendor/bin/propel model:build to rebuild the models according to the modified schema, and then run composer dump-autoload -o to load up the new models. The user model will now have new functions, such as validate and getValidationFailures (validate returns true if all rules were followed, and getValidationFailures returns an array of errors if validate failed). If you want to know more about validate you can look at <a href=\"http://propelorm.org/documentation/behaviors/validate.html\" target=\"_blank\">http://propelorm.org/documentation/behaviors/validate.html</a>.</p><p><br></p><p><strong><u>Propel notes</u></strong></p><p>When running vendor/bin/propel init make sure you have your apache server on, or propel won\'t be able to establish a connection to the database; an example run of vendor/bin/propel init can be found <a href=\"https://goo.gl/ej4nt5\" target=\"_blank\">here</a>. Once you initialize Propel, two new folders will be created in the current directory (generated-conf/ and generated-sql/), move them into the data/ directory to keep the directory structure consistent. To learn more about propel and it\'s important functions look at <a href=\"http://propelorm.org/documentation/\" target=\"_blank\">http://propelorm.org/documentation/</a>.</p>','2018-08-25 14:22:48',1,2,8,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(14,'Slim','slim','<p><strong><u>Overview</u></strong></p><p>Slim is a PHP micro framework that helps you quickly write simple yet powerful web applications and APIs. At its core, Slim is a dispatcher that receives an HTTP request, invokes an appropriate callback routine, and returns an HTTP response. That\'s it.</p><p><br></p><p><strong><u>Getting started</u></strong></p><p>Create an index.php file and type the following</p><pre><code>&lt;?php\nrequire \'../vendor/autoload.php\';\n\n// Create and configure Slim app\n$config = [\'settings\' =&gt; [\n&nbsp;&nbsp;\'addContentLengthHeader\' =&gt; false,\n]];\n$app = new \\Slim\\App($config);\n\n// Define app routes\n$app-&gt;get(\'/hello/{name}\', function ($request, $response, $args) {\n&nbsp;&nbsp;return $response-&gt;write(\"Hello \" . $args[\'name\']);\n});\n\n// Run app\n$app-&gt;run();\n</code></pre><p>To remove index.php from the url make sure you have .htaccess file in your html folder with the following contents</p><pre><code>RewriteEngine On\nRewriteCond %{REQUEST_FILENAME} !-f\nRewriteCond %{REQUEST_FILENAME} !-d\nRewriteRule ^ index.php [QSA,L]\n</code></pre>','2018-08-25 14:12:54',1,2,9,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(16,'Dynamic Programming Algorithm for the Traveling Salesperson','dynamic-programming-algorithm-for-the-traveling-salesperson','<p><strong><u>Problem</u></strong></p><p>Using the java programming language, write a program to implement the Dynamic Programming Algorithm for the Traveling Salesperson.</p><p><br></p><p><strong><u>Solution</u></strong></p><pre><code>import java.util.InputMismatchException;\nimport java.util.Scanner;\nimport java.util.Stack;\n\npublic class TravelingSalesmanNearestNeighbour\n{\n&nbsp;&nbsp;private Stack&lt;Integer&gt; stack;\n\n&nbsp;&nbsp;private TravelingSalesmanNearestNeighbour()\n&nbsp;&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;stack = new Stack&lt;&gt;();\n&nbsp;&nbsp;}\n\n&nbsp;&nbsp;private void TS_meth1(int adjacencyMatrix[][])\n&nbsp;&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;int num_nodes = adjacencyMatrix[1].length - 1;\n&nbsp;&nbsp;&nbsp;&nbsp;int[] visited = new int[num_nodes + 1];\n&nbsp;&nbsp;&nbsp;&nbsp;visited[1] = 1;\n&nbsp;&nbsp;&nbsp;&nbsp;stack.push(1);\n&nbsp;&nbsp;&nbsp;&nbsp;int element, dst = 0, i;\n&nbsp;&nbsp;&nbsp;&nbsp;int min = Integer.MAX_VALUE;\n&nbsp;&nbsp;&nbsp;&nbsp;boolean minFlag = false;\n&nbsp;&nbsp;&nbsp;&nbsp;System.out.print(1 + \"\\t\");\n\n&nbsp;&nbsp;&nbsp;&nbsp;while (!stack.isEmpty())\n&nbsp;&nbsp;&nbsp;&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;element = stack.peek();\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;i = 1;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;min = Integer.MAX_VALUE;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;while (i &lt;= num_nodes)\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;if (adjacencyMatrix[element][i] &gt; 1 &amp;&amp; visited[i] == 0)\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;if (min &gt; adjacencyMatrix[element][i])\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;min = adjacencyMatrix[element][i];\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;dst = i;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;minFlag = true;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;}\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;}\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;i++;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;}\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;if (minFlag)\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;visited[dst] = 1;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;stack.push(dst);\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;System.out.print(dst + \"\\t\");\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;minFlag = false;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;continue;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;}\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;stack.pop();\n&nbsp;&nbsp;&nbsp;&nbsp;}\n&nbsp;&nbsp;}\n\n&nbsp;&nbsp;public static void main(String... arg)\n&nbsp;&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;int node_num1;\n&nbsp;&nbsp;&nbsp;&nbsp;Scanner scanner = null;\n&nbsp;&nbsp;&nbsp;&nbsp;try\n&nbsp;&nbsp;&nbsp;&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;System.out.println(\"Enter the number of nodes in the graph\");\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;scanner = new Scanner(System.in);\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;node_num1 = scanner.nextInt();\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;int adjacency_matrix[][] = new int[node_num1 + 1][node_num1 + 1];\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;System.out.println(\"Enter the adjacency matrix\");\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;for (int i = 1; i &lt;= node_num1; i++)\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;for (int j = 1; j &lt;= node_num1; j++)\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;adjacency_matrix[i][j] = scanner.nextInt();\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;}\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;}\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;for (int i = 1; i &lt;= node_num1; i++)\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;for (int j = 1; j &lt;= node_num1; j++)\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;if (adjacency_matrix[i][j] == 1 &amp;&amp; adjacency_matrix[j][i] == 0)\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;adjacency_matrix[j][i] = 1;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;}\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;}\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;}\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;System.out.println(\"the cities are visited in the following order: \");\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;TravelingSalesmanNearestNeighbour TravelingSalesmanNearestNeighbour = new TravelingSalesmanNearestNeighbour();\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;TravelingSalesmanNearestNeighbour.TS_meth1(adjacency_matrix);\n&nbsp;&nbsp;&nbsp;&nbsp;} catch (InputMismatchException inputMismatch)\n&nbsp;&nbsp;&nbsp;&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;System.out.println(\"Wrong Input format\");\n&nbsp;&nbsp;&nbsp;&nbsp;}\n&nbsp;&nbsp;&nbsp;&nbsp;assert scanner != null;\n&nbsp;&nbsp;&nbsp;&nbsp;scanner.close();\n&nbsp;&nbsp;}\n}\n</code></pre>','2018-08-18 00:00:00',1,5,4,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(18,'Simple Android Web View','simple-android-web-view','<p><strong><u>Question asked through contact form:</u></strong></p><p>I want to develop a WebView android app with android studio but facing problems.</p><p>The question isn\'t very specific, so I will just make a simple WebView that starts up here (kodecentral.com).</p><p><br></p><p>First make sure that you have android studio up and running, and create a new empty activity.</p><p><br></p><p>Open to your main activity which is under <strong>app-&gt;java-&gt;package.name-&gt;MainActivity.java</strong>, and also open your main activity layout which is under <strong>app-&gt;res-&gt;layout-&gt;activity_main.xml</strong>.</p><p><br></p><p>In your activity layout change your layout to RelativeLayout and replace the TextField with a WebView, resulting in the following xml:</p><pre><code>&lt;?xml version=\"1.0\" encoding=\"utf-8\"?&gt;\n&lt;RelativeLayout xmlns:android=\"http://schemas.android.com/apk/res/android\"\n&nbsp;&nbsp;xmlns:app=\"http://schemas.android.com/apk/res-auto\"\n&nbsp;&nbsp;xmlns:tools=\"http://schemas.android.com/tools\"\n&nbsp;&nbsp;android:layout_width=\"match_parent\"\n&nbsp;&nbsp;android:layout_height=\"match_parent\"\n&nbsp;&nbsp;tools:context=\".MainActivity\"&gt;\n\n&nbsp;&nbsp;&lt;WebView\n&nbsp;&nbsp;&nbsp;&nbsp;android:id=\"@+id/webview\"\n&nbsp;&nbsp;&nbsp;&nbsp;android:layout_width=\"match_parent\"\n&nbsp;&nbsp;&nbsp;&nbsp;android:layout_height=\"match_parent\"/&gt;\n&lt;/RelativeLayout&gt;\n</code></pre><p>The WebView needs an id since we will need it to display content later. The WebView\'s width and height match the parent, which takes up the whole screen.&nbsp;</p><p><br></p><p>Now we need to work on the main activity.</p><pre><code>public class MainActivity extends AppCompatActivity {\n&nbsp;&nbsp;private WebView webView;\n\n&nbsp;&nbsp;@Override\n&nbsp;&nbsp;protected void onCreate(Bundle savedInstanceState) {\n&nbsp;&nbsp;&nbsp;&nbsp;super.onCreate(savedInstanceState);\n&nbsp;&nbsp;&nbsp;&nbsp;setContentView(R.layout.activity_main);\n\n&nbsp;&nbsp;&nbsp;&nbsp;// set the webView from the id that we\n&nbsp;&nbsp;&nbsp;&nbsp;// set in activity_main.xml\n&nbsp;&nbsp;&nbsp;&nbsp;webView = findViewById(R.id.webview);\n\n&nbsp;&nbsp;&nbsp;&nbsp;// don\'t open in default browser (such as chrome), open in this app\n&nbsp;&nbsp;&nbsp;&nbsp;webView.setWebViewClient(new WebViewClient());\n\n&nbsp;&nbsp;&nbsp;&nbsp;// load kodecentral.com on start up\n&nbsp;&nbsp;&nbsp;&nbsp;webView.loadUrl(\"https://kodecentral.com\");\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\n&nbsp;&nbsp;&nbsp;&nbsp;// enable js which makes most website function properly\n&nbsp;&nbsp;&nbsp;&nbsp;webView.getSettings().setJavaScriptEnabled(true);\n&nbsp;&nbsp;}\n}\n</code></pre><p>And after the view and main activity are complete, next you must grant internet permission to this app. Go to app-&gt;manifests-&gt;AndroidManifest.xml and grant the app permission to access the internet:</p><p><br></p><pre><code>&lt;?xml version=\"1.0\" encoding=\"utf-8\"?&gt;\n&lt;manifest xmlns:android=\"http://schemas.android.com/apk/res/android\"\n&nbsp;&nbsp;package=\"com.bittle.webviewrequest\"&gt;\n\n&nbsp;&nbsp;&lt;uses-permission android:name=\"android.permission.INTERNET\"/&gt;\n&nbsp;&nbsp;...\n</code></pre><p>And there you go, The app is all set up and ready to view all the internet content you\'d like.</p><p><br></p><p><strong><u>Bonus</u></strong></p><p>The app works fine, but what about making the back button take you to the previous request, instead of closing the app? Good idea, for this we have to override the onBackPressed function the following way:</p><pre><code>@Override\npublic void onBackPressed() {\n&nbsp;&nbsp;if (webView.canGoBack()) {\n&nbsp;&nbsp;&nbsp;&nbsp;// go back to previous page if it exists\n&nbsp;&nbsp;&nbsp;&nbsp;webView.goBack();\n&nbsp;&nbsp;} else {\n&nbsp;&nbsp;&nbsp;&nbsp;// if no prev page, just execute the default action\n&nbsp;&nbsp;&nbsp;&nbsp;super.onBackPressed();\n&nbsp;&nbsp;}\n}\n</code></pre>','2018-08-18 00:00:00',1,6,23,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(23,'Dependencies','dependencies','<p><strong><u>Overview</u></strong></p><p>All dependencies will be downloaded with composer, since its easy, fast, and clean.</p><p><br></p><p><strong><u>Getting started</u></strong></p><p>To download the dependencies make sure you have your directory structure setup already, as shown <a href=\"https://raw.githubusercontent.com/oscar0812/cookbook/master/img/directories.png\" target=\"_blank\">here</a>. Go inside your composer.json file and modify it to download all dependencies, like so:</p><pre><code>{\n&nbsp;\"require\": {\n&nbsp;&nbsp;\"propel/propel\": \"~2.0@dev\",\n&nbsp;&nbsp;\"phpmailer/phpmailer\": \"^6.0\",\n&nbsp;&nbsp;\"league/oauth2-client\": \"^2.2\",\n&nbsp;&nbsp;\"slim/slim\": \"^3.9\",\n&nbsp;&nbsp;\"slim/php-view\": \"^2.2\",\n&nbsp;&nbsp;\"paypal/rest-api-sdk-php\": \"^1.13\"\n&nbsp;},\n&nbsp;\"autoload\": {\n&nbsp;&nbsp;\"classmap\": [\n&nbsp;&nbsp;&nbsp;\"data/models/\"\n&nbsp;&nbsp;],\n&nbsp;&nbsp;\"psr-4\":{\n&nbsp;&nbsp;&nbsp;\"app\\\\\": \"app/\"\n&nbsp;&nbsp;}\n&nbsp;}\n}\n</code></pre><p>and then run</p><pre><code>composer install\n</code></pre><p>to get all the dependencies downloaded into the vendor folder.</p><p><span style=\"color: rgb(230, 0, 0);\">NOTE</span>: The autoload will not work until you have a folder data/ and models/ inside data/, these folders will be created by propel later, or you can manually create them now.</p><p><br></p><p><strong><u>Explanation of above composer.json</u></strong></p><p>require: {?} lists the dependencies required for the project (propel, slim, etc...)</p><p>autoload: {?} lists extras to be included when composer dump-autoload -o is ran. classmap[?] allows directories to be included in the autoload process. The psr-4 autoload is used to define the mapping from namespaces to directories. The example filename would be app/hello.php containing an app\\hello class.</p><p><br></p><p><strong><u>Notes</u></strong></p><p>Make sure that any of the composer commands are ran in the same directory as the composer.json, or the commands will fail. Composer will download the dependencies into a vendor/ directory, which it will create if it doesn\'t exist. Every dependency will have a directory, for example, propel will be inside vendor/propel.composer dump-autoload -o will not work in the previously shown composer.json example if data/models and app/ directories don\'t exist. If you want to test it, simply remove everything except require: {?}. Always run </p><pre><code>composer dump-autoload -o\n</code></pre><p>after installing a new dependency in order to load up the new files, or the new dependencies will go unused.</p>','2018-08-21 00:00:00',1,2,6,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(24,'Set up Atom','set-up-atom','<p><strong><u>Overview</u></strong></p><p>Atom is a rich open-source text editor which is developer friendly and customizable.</p><p><br></p><p><strong><u>Download and plugins</u></strong></p><p>Atom can be downloaded from the <a href=\"https://atom.io\" target=\"_blank\">official website</a>. Once you download atom open your atom preferences</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/cookbook/master/img/atom_pref.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/cookbook/master/img/atom_pref.png\" style=\"\" width=\"155\"></a></p><p>and choose install to install packages. The basic packages are the following:</p><ul><li><a href=\"https://atom.io/packages/atom-beautify\" target=\"_blank\">atom-beautify</a></li><li><a href=\"https://atom.io/packages/atom-autocomplete-php\" target=\"_blank\">atom-autocomplete-php</a></li><li><a href=\"https://atom.io/packages/file-icons\" target=\"_blank\">file icons</a></li><li><a href=\"https://atom.io/packages/git-plus\" target=\"_blank\">git-plus</a></li><li><a href=\"https://atom.io/packages/markdown-preview-plus\" target=\"_blank\">markdown-preview-plus</a></li><li><a href=\"https://atom.io/packages/minimap\" target=\"_blank\">minimap</a></li><li><a href=\"https://atom.io/packages/minimap-highlight-selected\" target=\"_blank\">minimap-highlight-selected</a></li><li><a href=\"https://atom.io/packages/pigments\" target=\"_blank\">pigments</a></li><li><a href=\"https://atom.io/packages/minimap-pigments\" target=\"_blank\">minimap-pigments</a></li></ul>','2018-08-24 16:32:03',1,2,1,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(26,'phpMyAdmin','phpmyadmin','<p><strong><u>Overview</u></strong></p><p>phpMyAdmin is a free and open source administration tool for MySQL and MariaDB</p><p><br></p><p><strong><u>Creating a database using phpMyAdmin</u></strong></p><p>Turn on your server and open <a href=\"http://localhost\" target=\"_blank\">http://localhost</a> (select your project folder) and<a href=\" http://localhost/phpmyadmin\" target=\"_blank\"> http://localhost/phpmyadmin</a>. Create your new database and populate with the desired tables.</p><p>First create a new database by clicking on the \"New\" button.</p><p><br></p><p><img src=\"https://raw.githubusercontent.com/oscar0812/cookbook/master/img/phpmyadmin/new_btn.png\" width=\"194\"></p><p><br></p><p><img src=\"https://raw.githubusercontent.com/oscar0812/cookbook/master/img/phpmyadmin/new_db.png\" width=\"346\"></p><p><br></p><p>Then create a new table in the database</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/cookbook/master/img/phpmyadmin/new_table.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/cookbook/master/img/phpmyadmin/new_table.png\"></a></p><p>and fill out the new columns</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/cookbook/master/img/phpmyadmin/table_schema.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/cookbook/master/img/phpmyadmin/table_schema.png\" width=\"408\"></a></p><p>If you want the id to be a primary key scroll to the right and select \"A_I\"</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/cookbook/master/img/phpmyadmin/primary.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/cookbook/master/img/phpmyadmin/primary.png\" width=\"290\"></a></p><p><br></p><p>The final table should look like this</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/cookbook/master/img/phpmyadmin/table_final.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/cookbook/master/img/phpmyadmin/table_final.png\"></a></p>','2018-08-25 13:44:43',1,2,7,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(27,'Summing the sum','summing-the-sum','<p><strong><u>Problem</u></strong></p><p>Ishaan was playing with numbers. He knew how to calculate the sum of numbers. He defined a function for his use which calculates the <strong>twice</strong> sum of first N natural numbers as sum(N).</p><p>But being curious, he modified his function to calculate something more complex. He defined his function to be sumX(N,M,K).</p><p>Now this function calculates :</p><p>sum( K + sum( K + sum( K + ...sum(K + N)...))) , continuing for M terms (Refer example for explanation).</p><p>Given N, M and K, calculate the value of sumX(N,M,K).</p><p><br></p><p><strong>Input</strong></p><p>First line of input contains a single integer T denoting the number of test cases.</p><p>The only line of each test case contains 3 space-separated integers N, M and K.</p><p><br></p><p><strong>Output</strong></p><p>For each test case, print the required answer in a new line.</p><p><br></p><p><strong>Constraints</strong></p><p>1 &lt;= T &lt;= 200</p><p>1 &lt;= N &lt;= 1000</p><p>1 &lt;= M &lt;= 1000</p><p>1 &lt;= K &lt;= 1000</p><p><br></p><p><strong>Input</strong></p><p>3</p><p>1 2 3</p><p>2 2 2</p><p>3 3 2</p><p><br></p><p><strong>Output</strong></p><p>552</p><p>506</p><p>1120422</p><p><br></p><p><strong>Explanation</strong></p><p>Case 1 :&nbsp;</p><p>sum(3 + sum(3 + 1) ) = sum(3 + 20) = 552</p><p><br></p><p>Case 2 :&nbsp;</p><p>sum(2 + sum(2 + 2) ) = sum(2 + 20) = 506</p><p><br></p><p>Case 3 :&nbsp;</p><p>sum(2 + sum(2 + sum(2 + 3) ) ) = sum(2 + sum( 2 + 30 ) ) = sum(2 + 1056) = 1120422</p><p><br></p><p><strong><u>Solution</u></strong></p><p>The programming solution can get tricky, specially when using dynamic programming to solve. First we need the basic sum function that Ishaan had created</p><pre><code>// to store all the summations calculated\nprivate static int[] dp = new int[10000];\n\nprivate static int sum(int x) {\n    if (dp[x] != 0) {\n        // already calculated\n        return dp[x];\n    } else if (x == 0 || x == 1) {\n        return x;\n    } else {\n        // summation from x down to 0\n        dp[x] = x + sum(x - 1);\n        return dp[x];\n    }\n}\n</code></pre><p>The array dp is used to store calculations that have already been made (to save time). The new sumX function calculates sum( K + sum( K + sum( K + ...sum(K + N)...))), for M terms. A bottom up procedure seems easiest, as the formula shows that the last calculation needed is sum(K+N) and it doesn\'t depend on another result. Therefore, doing this recursively becomes easier, as the base case is simple, and the sumX calculations can be reflected into programming easily</p><pre><code>private static int sumX(int N, int M, int K) {\n    if (M == 1) {\n        // last calculation is just the summation of N + K\n        return 2 * sum(N + K);\n    } else {\n        // recursively calculate the summation of K + sumX(K + ...) M times\n        return 2 * sum(K + sumX(N, M - 1, K));\n    }\n}\n</code></pre><p>And lastly, just call the sumX function with the data read in from the file that has similar data to</p><p>3</p><p>1 2 3</p><p>2 2 2</p><p>3 3 2</p><pre><code>public static void main(String[] args) {\n    try {\n        // read in the data from file\n        Scanner scanner = new Scanner(new File(\"input.txt\"));\n        int T = scanner.nextInt();\n        for (int x = 0; x &lt; T; x++) {\n            int N = scanner.nextInt();\n            int M = scanner.nextInt();\n            int K = scanner.nextInt();\n            // calculate and print answer\n            System.out.println(sumX(N, M, K));\n        }\n    } catch (FileNotFoundException e) {\n        e.printStackTrace();\n    }\n}\n</code></pre><p>Credit to <a href=\"https://practice.geeksforgeeks.org/problems/summing-the-sum/0\" target=\"_blank\">geeksforgeeks</a> for the question.</p>','2018-08-24 00:00:00',1,5,3,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(28,'Partitioning into two contiguous element subarrays with equal sums','partitioning-into-two-contiguous-element-subarrays-with-equal-sums','<p><strong><u>Problem</u></strong></p><p>Given an array of n positive integers. Find a minimum positive element to be added to one of the indexes in the array such that it can be partitioned into two contiguous sub arrays of equal sums. Output the minimum element to be added and the position where it is to be added. If multiple positions are possible then return the least one. Solve using java and dynamic programming concepts.</p><p><strong>Examples</strong></p><p>input: {1, 2, 3, 6}</p><p>output: 0 0</p><p>Explanation: 1 + 2 + 3 = 6, so no need to add any elements, can just add 0 in 0 index (doesn\'t change sums)</p><p><br></p><p>input: {5, 4, 9, 7, 3, 4, 7, 8, 1}</p><p>output: 4 2</p><p>Explanation: 5 + 4 + 9 + 7 = (2) + 3 + 4 + 7 + 8 + 1, need to add 2 to the right hand side to make both sides equal (to 25 in this case)</p><p><br></p><p><strong><u>Solution</u></strong></p><p><em>Naive</em>: Compute the summation from 0 to input[i], and input[i+1] to input[n-1] and keep track of the minimum value and current index. The naive solution is slow, as you must compute the same summations many times, and step through the whole array just to compute 1 value. The final runtime is O(n^2).</p><p><br></p><p><em>Dynamic Programming</em>: Compute the sum from 0 to input[n-1], and store the values in an array to avoid computing them again. Do the same thing again, but compute the sum from input[n-1] to zero (backwards) and store them in a different array.</p><p><br></p><pre><code>input:   5&nbsp;&nbsp;   4&nbsp;&nbsp;  9&nbsp;&nbsp;  7&nbsp;&nbsp;   3&nbsp;&nbsp;   4&nbsp;&nbsp;   7&nbsp;    8&nbsp;&nbsp;   1\npreSum:  5&nbsp;&nbsp;   9&nbsp;&nbsp; 18&nbsp;&nbsp; 25&nbsp;&nbsp;  28&nbsp; &nbsp; 32&nbsp;&nbsp;  39&nbsp;&nbsp;  47&nbsp;&nbsp;  48\npostSum: 48&nbsp;&nbsp; 43&nbsp;&nbsp; 39&nbsp;&nbsp; 30&nbsp; &nbsp; 23&nbsp; &nbsp; 20&nbsp;&nbsp;  16&nbsp;&nbsp;   9&nbsp;&nbsp;   1\n</code></pre><p><br></p><p>Now find the minim difference between the two calculated arrays</p><p>Abs difference between postSum[i + 1] and preSum[i]</p><pre><code>5  - 43 = 38\n9  - 39 = 30\n18 - 30 = 12\n25 - 23 =  2 // minimum\n28 - 20 =  8\n32 - 16 = 16\n39 -  9 = 30\n47 -  1 = 46\n</code></pre><p>Thus, minimum element is 2.</p><p>if preSum[i] is greater than postSum[i + 1], then position is \"i + 1\".</p><p>else it\'s is \"i\".</p><p><br></p><p><strong>Java code</strong></p><p>We will need 2 answers, the index and the value, so we will create a class to encapsulate both values and make it easier to handle, instead of returning an array of 2 integers and remembering which index is what.</p><pre><code>private class Tuple {\n    int index;\n    int value;\n\n    Tuple(int value) {\n        this.value = value;\n    }\n}\n</code></pre><p>Now, we need to work on the algorithm to calculate the pre and post sum arrays.</p><pre><code>// preSum finds the summation from 0 to i all the way to N\nint[] preSum = new int[arr.length];\npreSum[0] = arr[0];\nfor (int x = 1; x &lt; arr.length; x++) {\n    preSum[x] = preSum[x - 1] + arr[x];\n}\n\n// postSum finds the summations from N-1 to i all the way to index 0\nint[] postSum = new int[arr.length];\npostSum[arr.length - 1] = arr[arr.length - 1];\nfor (int x = arr.length - 2; x &gt;= 0; x--) {\n    postSum[x] = postSum[x + 1] + arr[x];\n}\n</code></pre><p>All that is left is to find the minimum value and the index where the value needs to be placed.</p><pre><code>// initialize the tuple to be the total sum of the array\nTuple tuple = new Tuple(postSum[0]);\n\nfor (int i = 0; i &lt; arr.length - 1; i++) {\n    // abs difference between postSum[i + 1] and preSum[i]\n    int diff = Math.abs(preSum[i] - postSum[i + 1]);\n    \n    if (diff &lt; tuple.value) {\n        // found smaller difference\n        tuple.value = diff;\n\n        // right &lt; left, add to the right\n        if (postSum[i + 1] &lt; preSum[i])\n            tuple.index = i + 1;\n        else\n            // add to left\n            tuple.index = i;\n    }\n}\n</code></pre><p>You can put both code blocks above in a function (in the order they are shown above) and call it.</p><pre><code>private Tuple findMin(int[] arr) {\n    // find the pre and post sums\n    // ...\n    // find the min diff value and index\n    // ... \n    // return answer\n    return tuple;\n}\n\npublic static void main(String[] args) {\n    int[] input = {5, 4, 9, 7, 3, 4, 7, 8, 1};\n    Tuple answer = new MainClass().findMin(input);\n\n    System.out.println(answer.index + \" \" + answer.value);\n}\n</code></pre>','2018-08-24 00:00:00',1,5,2,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(29,'Website Development Introduction','website-development-introduction','<p>This \"cookbook\" is a roadmap which helps Aszend programmers create nice web applications. It\'s called a cookbook since it has all the ingredients to create software from the ground up, like cooking a cake from scratch. You will learn how to set up XAMPP, which installs MySQL, MariaDB, and comes with a nice interface to manipulate your databases. You will also learn how to install and use composer, which will help download dependencies and make programming a whole lot easier. With composer you can download:</p><ol><li><a href=\"https://kodecentral.com/post/propel\" target=\"_blank\">Propel</a></li><li><a href=\"https://kodecentral.com/post/slim\" target=\"_blank\">Slim</a></li><li>PhpMailer</li><li>Paypal</li><li>etc..</li></ol><p>The same methods have been used to create websites like <a href=\"https://aszend.com\" target=\"_blank\">Aszend</a>, <a href=\"https://Kodecentral.com\" target=\"_blank\">KodeCentral</a>, Do-X-For-Y, and <a href=\"http://legendsgaming.us\" target=\"_blank\">legendsgaming</a> (doxfory and legends are down for the time being). Be aware that the steps have been created using a Mac, so your machine might have different steps, but not too far from what is explained here.</p>','2018-08-27 09:21:16',1,2,0,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(30,'Split date string into separate variables c++','split-date-string-into-separate-variables-c%2B%2B','<p><strong><u>Problem</u></strong></p><p>We have the following string input \"mm/dd/yyyy\" (a date) and we want to split it into its own variables for month, date and year.</p><p><br></p><p><strong><u>Solution</u></strong></p><p>One way to do this is to split at every / and keep splitting until the end, and then parse the current split with atoi (string to int conversion). We must keep track of what variable we are currently setting to avoid errors. The following snippet works great.</p><pre><code>#include &lt;iostream&gt;\n\nint main() {\n    // date in mm/dd/yyyy format\n    char date[] =\"08/21/1998\";\n    // pointer to current split section\n    char * pch;\n    // info needed\n    int month = -1, day = -1, year = -1;\n\n    // split the date from beginning to the first occurrence of /\n    pch = strtok(date,\"/\");\n    // while we have more / chars\n    while (pch != NULL)\n    {\n        // set the variables\n        int num = atoi(pch);\n        if(month == -1) month = num;\n        else if(day == -1) day = num;\n        else if(year == -1) year = num;\n\n        // continue splitting the string\n        pch = strtok (NULL, \"/\");\n    }\n\n    // check if we got correct data\n    printf(\"%d %d %d\", month, day, year);\n    return 0;\n}\n</code></pre>','2018-08-26 22:38:43',1,6,18,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(31,'Create a 16 digit random number generator in Java','create-a-16-digit-random-number-generator-in-java','<p><strong style=\"color: rgb(68, 68, 68);\"><u>Problem:</u></strong><span style=\"color: rgb(68, 68, 68);\"> </span></p><p><span style=\"color: rgb(68, 68, 68);\">Create a 16 digit random number generator in Java</span></p><p><strong style=\"color: rgb(68, 68, 68);\"><u>Solution:</u></strong></p><p><span style=\"color: rgb(68, 68, 68);\">This can be easily achieved by using </span><a href=\"https://docs.oracle.com/javase/7/docs/api/java/util/concurrent/ThreadLocalRandom.html\" target=\"_blank\" style=\"color: rgb(0, 102, 204);\">ThreadLocalRandom</a><span style=\"color: rgb(68, 68, 68);\"> by declaring the bounds equal to the smallest and largest 16 digit numbers.</span></p><pre><code>private static void random() {\n    /* return a random long of 16 length */\n    long smallest = 1000_0000_0000_0000L;\n    long biggest =  9999_9999_9999_9999L;\n\n    // return a long between smallest and biggest (+1 to include biggest as well with the upper bound)\n    long random = ThreadLocalRandom.current().nextLong(smallest, biggest+1);\n    System.out.println(random);\n}\n</code></pre>','2018-10-19 13:43:11',1,6,17,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(32,'Accumulated sum using swing','accumulated-sum-using-swing','<p><strong><u>Problem:</u></strong> Calculate the sum of the current input with the sum of past inputs. You may have:</p><ol><li>JLabel: \"Enter an integer\"</li><li>JTextField: for accepting user input</li><li>JLabel: \"Accumulated sum is\"</li><li>JTextField (non-editable): for displaying the accumulated sum</li></ol><p><br></p><p>The program shall accumulate the number entered in the <em>input textfield </em>and display the sum in the <em>output textfield</em>.</p><p><br></p><p><strong><u>Solution:</u></strong> Although no button was specified as a component, the problem didn\'t specify when to accept input, so to avoid headaches we will accept the input when the button is clicked. Once the button is clicked the current input will be added to previous inputs and be shown in the output textfield. If the input is invalid (not a number) then the input will be ignored. The button click code is shown bellow:</p><p><br></p><pre><code>private void jButton1ActionPerformed(java.awt.event.ActionEvent evt) {                                         \n        // go button clicked\n        long current = 0;\n        try{\n            current = Long.parseLong(inputTextField.getText());\n        }catch(NumberFormatException e){\n            // invalid input (not a number)\n            System.out.println(\"Invalid input\");\n            return;\n        }\n        \n        currentSum +=current;\n        \n        outputTextField.setText(currentSum+\"\");\n        \n    }\n</code></pre><p>GUI:</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/Screen%20Shot%202018-10-21%20at%2011.36.50%20AM.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/Screen%20Shot%202018-10-21%20at%2011.36.50%20AM.png\" style=\"\" width=\"317\"></a></p><p><br></p><p>Complete code and layout (generated by NetBeans):</p><pre><code>﻿package accumulatedsum;\n\n\n/**\n *\n * @author oscartorres\n */\npublic class MainFrame extends javax.swing.JFrame {\n    long currentSum = 0;\n\n\n    /**\n     * Creates new form MainFrame\n     */\n    public MainFrame() {\n        initComponents();\n    }\n\n\n    /**\n     * This method is called from within the constructor to initialize the form.\n     * WARNING: Do NOT modify this code. The content of this method is always\n     * regenerated by the Form Editor.\n     */\n    // created by NetBeans\n    @SuppressWarnings(\"unchecked\")\n    // &lt;editor-fold defaultstate=\"collapsed\" desc=\"Generated Code\"&gt;                          \n    private void initComponents() {\n\n\n        jLabel1 = new javax.swing.JLabel();\n        inputTextField = new javax.swing.JTextField();\n        jLabel2 = new javax.swing.JLabel();\n        outputTextField = new javax.swing.JTextField();\n        jButton1 = new javax.swing.JButton();\n\n\n        setDefaultCloseOperation(javax.swing.WindowConstants.EXIT_ON_CLOSE);\n\n\n        jLabel1.setText(\"Enter an integer\");\n\n\n        jLabel2.setText(\"Accumulated sum is\");\n\n\n        outputTextField.setEditable(false);\n        outputTextField.addActionListener(new java.awt.event.ActionListener() {\n            public void actionPerformed(java.awt.event.ActionEvent evt) {\n                outputTextFieldActionPerformed(evt);\n            }\n        });\n\n\n        jButton1.setText(\"Go\");\n        jButton1.addActionListener(new java.awt.event.ActionListener() {\n            public void actionPerformed(java.awt.event.ActionEvent evt) {\n                jButton1ActionPerformed(evt);\n            }\n        });\n\n\n        javax.swing.GroupLayout layout = new javax.swing.GroupLayout(getContentPane());\n        getContentPane().setLayout(layout);\n        layout.setHorizontalGroup(\n            layout.createParallelGroup(javax.swing.GroupLayout.Alignment.LEADING)\n            .addGroup(layout.createSequentialGroup()\n                .addContainerGap(javax.swing.GroupLayout.DEFAULT_SIZE, Short.MAX_VALUE)\n                .addGroup(layout.createParallelGroup(javax.swing.GroupLayout.Alignment.LEADING)\n                    .addComponent(jLabel2)\n                    .addComponent(jLabel1))\n                .addPreferredGap(javax.swing.LayoutStyle.ComponentPlacement.UNRELATED)\n                .addGroup(layout.createParallelGroup(javax.swing.GroupLayout.Alignment.LEADING, false)\n                    .addComponent(inputTextField, javax.swing.GroupLayout.DEFAULT_SIZE, 84, Short.MAX_VALUE)\n                    .addComponent(outputTextField))\n                .addPreferredGap(javax.swing.LayoutStyle.ComponentPlacement.RELATED)\n                .addComponent(jButton1))\n        );\n        layout.setVerticalGroup(\n            layout.createParallelGroup(javax.swing.GroupLayout.Alignment.LEADING)\n            .addGroup(layout.createSequentialGroup()\n                .addContainerGap()\n                .addGroup(layout.createParallelGroup(javax.swing.GroupLayout.Alignment.BASELINE)\n                    .addComponent(inputTextField, javax.swing.GroupLayout.PREFERRED_SIZE, javax.swing.GroupLayout.DEFAULT_SIZE, javax.swing.GroupLayout.PREFERRED_SIZE)\n                    .addComponent(jLabel1)\n                    .addComponent(jButton1))\n                .addPreferredGap(javax.swing.LayoutStyle.ComponentPlacement.RELATED)\n                .addGroup(layout.createParallelGroup(javax.swing.GroupLayout.Alignment.BASELINE)\n                    .addComponent(jLabel2)\n                    .addComponent(outputTextField, javax.swing.GroupLayout.PREFERRED_SIZE, javax.swing.GroupLayout.DEFAULT_SIZE, javax.swing.GroupLayout.PREFERRED_SIZE))\n                .addContainerGap(javax.swing.GroupLayout.DEFAULT_SIZE, Short.MAX_VALUE))\n        );\n\n\n        pack();\n    }// &lt;/editor-fold&gt;                        \n\n\n    private void outputTextFieldActionPerformed(java.awt.event.ActionEvent evt) {                                                \n        // TODO add your handling code here:\n    }                                               \n\n\n    private void jButton1ActionPerformed(java.awt.event.ActionEvent evt) {                                         \n        // go button clicked\n        long current = 0;\n        try{\n            current = Long.parseLong(inputTextField.getText());\n        }catch(NumberFormatException e){\n            // invalid input (not a number)\n            System.out.println(\"Invalid input\");\n            return;\n        }\n        \n        currentSum +=current;\n        \n        outputTextField.setText(currentSum+\"\");\n        \n    }                                        \n\n\n    /**\n     * @param args the command line arguments\n     */\n    public static void main(String args[]) {\n        /* Set the Nimbus look and feel */\n        //&lt;editor-fold defaultstate=\"collapsed\" desc=\" Look and feel setting code (optional) \"&gt;\n        /* If Nimbus (introduced in Java SE 6) is not available, stay with the default look and feel.\n         * For details see http://download.oracle.com/javase/tutorial/uiswing/lookandfeel/plaf.html \n         */\n        try {\n            for (javax.swing.UIManager.LookAndFeelInfo info : javax.swing.UIManager.getInstalledLookAndFeels()) {\n                if (\"Nimbus\".equals(info.getName())) {\n                    javax.swing.UIManager.setLookAndFeel(info.getClassName());\n                    break;\n                }\n            }\n        } catch (ClassNotFoundException ex) {\n            java.util.logging.Logger.getLogger(MainFrame.class.getName()).log(java.util.logging.Level.SEVERE, null, ex);\n        } catch (InstantiationException ex) {\n            java.util.logging.Logger.getLogger(MainFrame.class.getName()).log(java.util.logging.Level.SEVERE, null, ex);\n        } catch (IllegalAccessException ex) {\n            java.util.logging.Logger.getLogger(MainFrame.class.getName()).log(java.util.logging.Level.SEVERE, null, ex);\n        } catch (javax.swing.UnsupportedLookAndFeelException ex) {\n            java.util.logging.Logger.getLogger(MainFrame.class.getName()).log(java.util.logging.Level.SEVERE, null, ex);\n        }\n        //&lt;/editor-fold&gt;\n\n\n        /* Create and display the form */\n        java.awt.EventQueue.invokeLater(new Runnable() {\n            public void run() {\n                new MainFrame().setVisible(true);\n            }\n        });\n    }\n\n\n    // Variables declaration - do not modify                     \n    private javax.swing.JTextField inputTextField;\n    private javax.swing.JButton jButton1;\n    private javax.swing.JLabel jLabel1;\n    private javax.swing.JLabel jLabel2;\n    private javax.swing.JTextField outputTextField;\n    // End of variables declaration                   \n}\n</code></pre>','2018-10-21 11:42:01',1,6,16,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(33,'Wall tiles without division or multiplication','wall-tiles-without-division-or-multiplication','<p><strong><u>Problem:</u></strong></p><p>We must calculate how many tiles we need to cover a wall without using multiplication or division.</p><p><br></p><p>For example:</p><p><br></p><p>WallLength: 540 (user input)</p><p>WallHeight:240 (user input)</p><p>TileLength: 60 (user input)</p><p>TileHeight:40 (user input)</p><p>Row: 9 (prog - output)</p><p>Column: 6 (prog Output)</p><p><br></p><p><strong><u>Solution:</u></strong></p><p>We will solve this using only while loops and subtraction in java. We must subtract until we can\'t fit anymore tiles, like so:</p><p><br></p><pre><code>Scanner scanner = new Scanner(System.in);\n\nSystem.out.println(\"INPUT WALL DATA\");\nSystem.out.print(\"length: \");\ndouble wallLength = scanner.nextDouble();\nSystem.out.print(\"height: \");\ndouble wallHeight = scanner.nextDouble();\n\nSystem.out.println(\"INPUT TILE DATA\");\nSystem.out.print(\"length: \");\ndouble tileLength = scanner.nextDouble();\nSystem.out.print(\"height: \");\ndouble tileHeight = scanner.nextDouble();\n\n// since you cant divide just subtract until you cant anymore (what divide does)\nint row = 1;\nwhile(tileLength &lt; wallLength){\n    wallLength -= tileLength;\n    row++;\n}\n\nint column = 1;\nwhile(tileHeight &lt; wallHeight){\n    wallHeight -= tileHeight;\n    column++;\n}\nSystem.out.println(\"Row(s): \"+row+\"\\nColumn(s): \"+column);\n</code></pre><p> </p><p>We are dividing without using the divide operation, so the answer meets the requirements.</p>','2018-10-21 12:52:54',1,6,15,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(34,'Adding a submenu in swing','adding-a-submenu-in-swing','<p><strong><u>Problem:</u></strong></p><p>Create a submenu for a menu bar like shown below</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/Screen%20Shot%202018-10-21%20at%202.15.37%20PM.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/Screen%20Shot%202018-10-21%20at%202.15.37%20PM.png\" style=\"\" width=\"290\"></a></p><p><strong><u>Solution:</u></strong></p><p>Adding a submenu to a menu bar can be achieved by first creating another JMenu, adding MenuItems to it, and then adding that JMenu to the main JMenu. In this case, We are going to create a JMenu for Find, and add \"Find\" and \"replace\" as JMenuItems of find. We are then going to add the Find JMenu to the edit menu item, like so:</p><pre><code>JMenuBar menuBar=new JMenuBar();\nframe.setJMenuBar(menuBar);\n// add other menu items here\nJMenu editMenuItem=new JMenu(\"Edit\");\n\nmenuBar.add(editMenuItem);\n\n//EditMenu Items\n﻿JMenuItem copyMenuItem=new JMenuItem(\"Copy\");\nJMenuItem pasteMenuItem=new JMenuItem(\"Paste\");\n\nJSeparator separator2=new JSeparator();\n\n// submenu for find (will stay open on hover)\nJMenu findMenuItem = new JMenu(\"Find\");\n\nJMenuItem mi = new JMenuItem(\"Find\");\nfindMenuItem.add(mi);\nmi = new JMenuItem(\"Replace\");\nfindMenuItem.add(mi);\neditMenuItem.add(findMenuItem);\n        \n// add menus here\neditMenuItem.add(findMenuItem);\n</code></pre>','2018-10-21 14:24:02',1,6,14,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(35,'Alphanumeric input of 25 length','alphanumeric-input-of-25-length','<p><strong><u>Problem</u></strong></p><p>Write a program that will accept 25 alphanumeric characters. Accept the input 5 characters at a time and output them in all uppercase separated by a hyphen.</p><p><br></p><p>Example output: ASDFA-ASDFW-234AS-ALSDF-ASDFQ</p><p><br></p><p><strong><u>Solution</u></strong></p><p>Check that the input is alphanumeric and of length 5 using the regular expression</p><pre><code>[a-zA-Z0-9]{5}\n</code></pre><p>If incorrect input we keep asking until the input is correct. Java solution:</p><pre><code>// get input from keyboard\n    Scanner scanner = new Scanner(System.in);\n    StringBuilder all = new StringBuilder();\n    // x = 0...4 since question wants 5 strings\n    for (int x = 0; x &lt; 5; x++) {\n        System.out.print(\"&gt; \");\n        String five = scanner.next();\n        while (!five.matches(\"[a-zA-Z0-9]{5}\")) {\n            // has to be alphanumeric with five length (keep asking if incorrect)\n            System.out.print(\"Input must be alphanumeric and of five length.\" +\n                    \"\\n&gt; \");\n            five = scanner.next();\n        }\n\n        all.append(five);\n        if (x != 4) {\n            // don\'t append - after last string\n            all.append(\'-\');\n        }\n    }\n\n    // question asks for all caps\n    System.out.println(\"OUTPUT: \" + all.toString().toUpperCase());\n}\n</code></pre>','2018-11-08 06:39:47',1,6,13,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(36,'Selection Sort','selection-sort','<p>Selection sort is an intuitive sort that most of us use day to day. For example, want to sort a stack of papers? You find the paper that has a last name that starts with an A, and keep incrementing until it\'s sorted. In this case we\'re going to use java to sort an array of integers.The algorithm runs as follows</p><p><a href=\"https://upload.wikimedia.org/wikipedia/commons/9/94/Selection-Sort-Animation.gif\" target=\"_blank\"><img src=\"https://upload.wikimedia.org/wikipedia/commons/9/94/Selection-Sort-Animation.gif\" style=\"display: block; margin: auto;\" width=\"48\"></a></p><p>Before looking at the code below ask yourself: \"How can I accomplish this on my own?\"</p><p><br></p><p><strong><u>Solution</u></strong>:</p><p>We first need a swap method that will be called once the min element has been found. Then we keep looking through the rest of the list always replacing the current number with the next smallest.</p><pre><code>private void swap(int[] nums, int ind1, int ind2){\n    int temp = nums[ind1];\n    nums[ind1] = nums[ind2];\n    nums[ind2] = temp;\n}\n\nprivate void selectionSort(int[] nums){\n    // find the min and put it in the ith spot\n    for(int i = 0; i&lt;nums.length; i++){\n        int minIndex = i;\n        for(int m = i; m&lt;nums.length; m++){\n            if(nums[m] &lt; nums[minIndex]){\n                minIndex = m;\n            }\n        }\n        swap(nums, i, minIndex);\n    }\n\n    // display the sorted list\n    for (int num : nums) {\n        System.out.print(num + \" \");\n    }\n}\n</code></pre><p>Selection sort is not an optimal sorting algorithm, but is one of the easiest to implement. Why is it not optimal? Well, the best sorting runtime is O(nlog(n)) and selection sort runs in O(n^2) since it must look N steps every Nth step (look at the code and find a for loop inside a for loop).</p>','2018-12-26 13:12:00',1,7,1,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(37,'Draggable list with propel, slim, and ajax','draggable-list-with-propel%2C-slim%2C-and-ajax','<p><strong><u>Problem</u></strong>:</p><p>Make a program that has draggable &lt;li&gt; objects, that when dragged changes its state in the database.</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/draggable-list.gif\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/draggable-list.gif\" style=\"display: block; margin: auto;\" width=\"168\"></a></p><p><strong><u>Solution</u></strong>:</p><p>Your database needs an attribute to sort by, I will do this with placement_index</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/draggable.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/draggable.png\" style=\"\" width=\"337\"></a></p><p><br></p><p>Make sure you include draggable.js, and jquery (ajax comes with the jquery bundle). Also install slim and Propel through composer installation. Once you have everything installed lets start on our view, mine only consists of the list and some css</p><pre><code>&lt;!DOCTYPE html&gt;\n&lt;html&gt;\n&nbsp; &nbsp;&lt;head&gt;\n&nbsp; &nbsp; &nbsp; &lt;title&gt;Sortable&lt;/title&gt;\n&nbsp; &nbsp; &nbsp; &lt;script src = \"https://code.jquery.com/jquery-3.3.1.min.js\"&gt;&lt;/script&gt;\n&nbsp; &nbsp; &nbsp; &lt;script src = \"https://code.jquery.com/ui/1.10.4/jquery-ui.js\"&gt;&lt;/script&gt;\n\n&nbsp; &nbsp; &nbsp; &lt;style&gt;\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;#sortable { list-style-type: none; margin: 0;\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; padding: 0; width: 25%; }\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;#sortable li { margin: 0 3px 3px 3px; padding: 0.4em;\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; padding-left: 1.5em; font-size: 17px; height: 16px; }\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;.default {\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; background: #21a2f9;\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;}\n&nbsp; &nbsp; &nbsp; &lt;/style&gt;\n&nbsp; &nbsp;&lt;/head&gt;\n\n&nbsp; &nbsp;&lt;body&gt;\n&nbsp; &nbsp; &nbsp; &lt;ul id = \"sortable\"&gt;\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;?php foreach ($items as $item) { ?&gt;\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;li data-id=\"&lt;?=$item-&gt;getId()?&gt;\" class = \"default\"&gt;&lt;?=$item-&gt;getText()?&gt;&lt;/li&gt;\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;?php }?&gt;\n&nbsp; &nbsp; &nbsp; &lt;/ul&gt;\n&nbsp; &nbsp;&lt;/body&gt;\n&lt;/html&gt;\n</code></pre><p>Now we can call the backend with ajax (place a script section before your &lt;/body&gt; tag)</p><pre><code>&lt;script&gt;\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;$(function() {\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; $( \"#sortable\" ).sortable({\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; update: function(item, ui) {\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; item = $(ui.item);\n\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; // make the call\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; $.ajax({\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; url: \"&lt;?=$router-&gt;pathFor(\'post-list\')?&gt;\",\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; method: \'post\',\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; data: {\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; id: item.attr(\'data-id\'),\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; new_index: item.index()+1\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; },\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; success: function(data) {\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; console.log(data);\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; }, done: function(data){\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; console.log(data);\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; }\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; });\n\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; }\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; });\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;});\n&nbsp; &nbsp; &nbsp; &lt;/script&gt;\n</code></pre><p>Now to get this working we must have initial data to pass to the front end (as you can see in the body of html posted above) and also be able to accept the post request from the ajax. This is where Slim and Propel come into play. Have a route to show the data</p><pre><code>$app-&gt;get(\'/\', function ($request, $response, $args) {\n&nbsp; &nbsp; return $this-&gt;view-&gt;render(\n&nbsp; &nbsp; &nbsp; $response,\n&nbsp; &nbsp; &nbsp; \'home.php\',\n&nbsp; &nbsp; &nbsp; [\'router\'=&gt;$this-&gt;router, \'items\'=&gt;\\ItemQuery::create()-&gt;orderByPlacementIndex()]\n&nbsp; );\n});\n</code></pre><p>And have a route to accept the ajax call and change the placementIndex value in the database.</p><pre><code>$app-&gt;post(\'/post-list\', function ($request, $response, $args) {\n&nbsp; &nbsp; $post_params = $request-&gt;getParsedBody();\n&nbsp; &nbsp; $new_index = $post_params[\'new_index\'];\n&nbsp; &nbsp; $items = \\ItemQuery::create()-&gt;orderByPlacementIndex()-&gt;find();\n\n&nbsp; &nbsp; $index = 1;\n&nbsp; &nbsp; foreach ($items as $item) {\n&nbsp; &nbsp; &nbsp; &nbsp; if ($new_index == $index &amp;&amp; $item-&gt;getId() != $post_params[\'id\']) {\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; // this is were the item is supposed to go, so just place the item\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; // we are looking at in the next index\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; $item-&gt;setPlacementIndex(++$index);\n&nbsp; &nbsp; &nbsp; &nbsp; }\n&nbsp; &nbsp; &nbsp; &nbsp; if ($item-&gt;getId() == $post_params[\'id\']) {\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; // found the item we were looking for\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; $item-&gt;setPlacementIndex($new_index);\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; if ($new_index &lt;= $index) {\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; // if we moved item back we have to increment the index to\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; // push other elements one back\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; $index++;\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; }\n&nbsp; &nbsp; &nbsp; &nbsp; } else {\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; // base case, just set index as incremental\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; $item-&gt;setPlacementIndex($index++);\n&nbsp; &nbsp; &nbsp; &nbsp; }\n&nbsp; &nbsp; }\n\n&nbsp; &nbsp; $items-&gt;save();\n\n&nbsp; &nbsp; return $response-&gt;withJson([\'return data here\']);\n})-&gt;setName(\'post-list\');\n\n</code></pre><p>And thats it! Move your list objects and check your database to see the magic happen.</p>','2019-02-24 17:55:03',1,12,2,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(38,'Website Hosting Introduction','website-hosting-introduction','<p>If you\'re here you\'ve already created a beautiful website and want to show the world.  Keep reading to find out how to</p><ol><li>Buy a URL</li><li>Link URL to Digital Ocean servers</li><li>Use software (such as composer) in the server</li><li>Import and export databases</li><li>SSH into server</li><li>Transfer files in and out of the server</li><li>Get FREE SSL Certificate</li><li>Fix most common errors</li></ol><p><br></p><p>Please be aware that hosting and URL\'s do cost money. URL\'s usually cost me around $5 to $15 and Digital Ocean hosting costs $5 per month. I use \'droplet\' and \'server\' interchangeably since Digital Ocean calls servers droplets </p>','2018-12-02 17:02:10',1,8,0,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(39,'Buying URL at Namecheap','buying-url-at-namecheap','<p>Go to <a href=\"namecheap.com\" target=\"_blank\">namecheap.com</a> and search desired URL, I will buy <a href=\"https://petandfeed.com\" target=\"_blank\">petandfeed.com</a></p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/1.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/1.png\" style=\"display: block; margin: auto;\" width=\"396\"></a></p><p><br></p><p>Press the \"add to cart\" button and then view cart</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/2.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/2.png\" style=\"display: block; margin: auto;\" width=\"396\"></a></p><p><br></p><p>If it asks you to create an account or log in do so. Now confirm your order</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/3.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/3.png\" style=\"display: block; margin: auto;\" width=\"396\"></a></p><p><br></p><p>Enter your payment information, and press continue</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/4.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/4.png\" style=\"display: block; margin: auto;\" width=\"395\"></a></p><p><br></p><p>Review your order and pay</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/5.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/5.png\" style=\"display: block; margin: auto;\" width=\"397\"></a></p><p><br></p><p>Congratulations! You now have your URL! Press next to learn how to use Digital Ocean and combine it with your new URL.</p>','2018-12-02 19:16:18',1,8,1,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(40,'Creating a droplet in Digital Ocean','creating-a-droplet-in-digital-ocean','<p>Now that you have bought a url from namecheap.com we need to create a server to host our files. First go to <a href=\"https://digitalocean.com\" target=\"_blank\">DigitalOcean.com</a> and create an account if you don\'t already have one. Then create a new droplet (top right corner)</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/6.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/6.png\" style=\"display: block; margin: auto;\" width=\"311\"></a></p><p><br></p><p>Click \"Marketplace\" and LAMP on VV.VV</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/7.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/7.png\" style=\"display: block; margin: auto;\" width=\"173\"></a></p><p><br></p><p>Choose a plan</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/8.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/8.png\" style=\"display: block; margin: auto;\" width=\"431\"></a></p><p><br></p><p>Choose a datacenter region (<strong>San Francisco by default</strong>)</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/9_1.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/9_1.png\" style=\"display: block; margin: auto;\" width=\"386\"></a></p><p><br></p><p>Scroll down to SSH key and click new</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/10.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/10.png\" style=\"display: block; margin: auto;\" width=\"225\"></a></p><p><br></p><p>Now, you need to generate SSH keys on your local machine, so change directory to where you want your keys to appear and run</p><pre><code>ssh-keygen\n</code></pre><p>The command will prompt for a key name, I will name mine petandfeed for simplicity. Don\'t input passphrases when prompted. A random art will appear when successful. Two keys are created, a private and public one; the private key has no extension while the public key ends in <strong>.pub</strong>. Now that we have SSH keys get the contents by running</p><pre><code>cat petandfeed.pub\n</code></pre><p>(your public key has a different name) and paste the key text into the Digital Ocean prompt</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/11.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/11.png\" style=\"display: block; margin: auto;\" width=\"279\"></a></p><p><br></p><p>﻿﻿Scroll down to \"Finalize and create\". Change the hostname to something simple and press Create</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/13.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/13.png\" style=\"display: block; margin: auto;\" width=\"293\"></a></p><p><br></p><p>And there you go! We have created a droplet successfully. Next we will link the URL and the new droplet.</p>','2019-04-02 15:48:22',1,8,2,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(41,'Connecting URL with droplet','connecting-url-with-droplet','<p>Make sure that you went over the previous posts that explain <a href=\"https://kodecentral.com/post/buying-url-at-namecheap\" target=\"_blank\">how to buy a URL from namecheap</a>, and <a href=\"https://kodecentral.com/post/creating-a-droplet-in-digital-ocean\" target=\"_blank\">how to create a droplet from DigitalOcean</a> before continuing.</p><p><br></p><p>To link your namecheap URL you must add the Digital Ocean nameservers to namecheap. Log into your namecheap account and go to your profile</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/14.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/14.png\" style=\"display: block; margin: auto;\" width=\"481\"></a></p><p><br></p><p>Then go to \"Domain List\" on the left navbar and click \"Manage\" on the URL you are trying to connect</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/15.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/15.png\" style=\"display: block; margin: auto;\" width=\"481\"></a> </p><p><br></p><p>Fill out the nameservers information like below and save</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/16.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/16.png\" style=\"display: block; margin: auto;\" width=\"480\"></a></p><p><br></p><p>You might need to wait a couple of minutes before going to the next step. After namecheap adds the nameservers go back to Digital Ocean. Click the 3 dots on your droplet and click \"Add a Domain\"</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/17.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/17.png\" style=\"display: block; margin: auto;\" width=\"480\"></a></p><p><br></p><p>Fill out domain input with your URL (mine is <a href=\"https://petandfeed.com\" target=\"_blank\">petandfeed.com</a>) and click \"Add Domain\"</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/18.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/18.png\" style=\"display: block; margin: auto;\" width=\"479\"></a></p><p><br></p><p>Now go to your URL with your browser to verify that the URL is linked with your droplet</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/20.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/20.png\" style=\"display: block; margin: auto;\" width=\"477\"></a></p><p><br></p><p>Congratulations! Your URL is linked to a Digital Ocean droplet! Next we will talk about accessing the droplet with SSH.</p>','2021-09-20 21:05:48',1,8,3,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(42,'Accessing your Digital Ocean droplet via SSH','accessing-your-digital-ocean-droplet-via-ssh','<p>To access the server via SSH you need the droplet\'s ip address</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/21.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/21.png\" style=\"display: block; margin: auto;\" width=\"406\"></a></p><p><br></p><p>Open your terminal and cd into the directory where your private and public SSH keys are located. Once you\'re there run</p><pre><code>ssh -i key_name root@ip_address\n</code></pre><p>keyname = your private key name (key without .pub extension)</p><p>ip_address = ip address from droplet that you copied above</p><p><br></p><p>Your terminal will look something like</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/22.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/22.png\" style=\"display: block; margin: auto;\" width=\"405\"></a></p><p>Now that we can SSH into our server we can install mysql and import our database!</p>','2021-06-28 15:09:51',1,8,4,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(44,'Connecting FileZilla to Digital Ocean droplet','connecting-filezilla-to-digital-ocean-droplet','<p>First we need to <a href=\"https://filezilla-project.org/\" target=\"_blank\">install filezilla</a>. Once installed we need to import the private SSH key to connect with the droplet.</p><ol><li>Open settings and find SFTP. </li><li>Click \"Add key file...\" </li><li>Select your private key file (without .pub extension)</li><li>Click \"OK\"</li></ol><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/23.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/23.png\" style=\"display: block; margin: auto;\" width=\"189\"></a></p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/24.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/24.png\" style=\"display: block; margin: auto;\" width=\"343\"></a></p><p><br></p><p>Once your private key is imported connect to your droplet with its ip</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/25.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/25.png\" style=\"display: block; margin: auto;\" width=\"481\"></a></p><p><br></p><p>Press \"Quickconnect\" and trust it</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/26.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/26.png\" style=\"display: block; margin: auto;\" width=\"341\"></a></p><p><br></p><p>And now FileZilla is connected to our droplet. Next we will install composer and move our files into the server.</p>','2018-12-03 17:21:32',1,8,8,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(45,'Transferring files with FileZilla','transferring-files-with-filezilla','<p><a href=\"https://kodecentral.com/post/connecting-filezilla-to-digital-ocean-droplet\" target=\"_blank\" style=\"background-color: rgb(255, 255, 255);\">FTP into droplet with FileZilla</a> before proceeding. Make sure to never transfer the vendor folder as it can be extremely large.</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/35.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/35.png\" style=\"display: block; margin: auto;\" width=\"384\"></a></p><p><br></p><p>Drag and drop folder items into /var/www (html folder should be part of items you drop in)</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/36.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/36.png\" style=\"display: block; margin: auto;\" width=\"387\"></a></p><p><br></p><p>and then SSH into server if you haven\'t done so already. Change directory into /var/www and run</p><pre><code>composer install\n</code></pre><p>to install project dependencies. To autoload class make sure your run</p><pre><code>composer dump-autoload -o\n</code></pre><p><br></p><p>Now visit your URL (mine is <a href=\"https://petandfeed.com\" target=\"_blank\">petandfeed.com</a>) and you should be live now! If you encounter any errors make sure to view the <a href=\"https://kodecentral.com/post/common-errors-in-website-hosting\" target=\"_blank\">common errors page</a>. Happy coding!</p>','2018-12-05 15:58:48',1,8,10,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(46,'Installing Composer in Digital Ocean droplet','installing-composer-in-digital-ocean-droplet','<p>Install the common PHP extensions:</p><pre><code>sudo apt update\nsudo apt install openssl php-common php-curl php-json php-mbstring php-mysql php-xml php-zip\n</code></pre><h2>Installing Composer manually with APT:</h2><pre><code>sudo apt install composer\n</code></pre><h2><br></h2>','2021-09-20 20:28:02',1,8,9,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(47,'Common Errors in Website Hosting','common-errors-in-website-hosting','<p><strong><u>SSH Errors</u></strong></p><p>Error:</p><pre><code>Permissions 0644 for \'key\' are too open.\nIt is required that your private key files are NOT accessible by others.\nThis private key will be ignored.\nLoad key \"key\": bad permissions\nPermission denied (publickey).\n</code></pre><p>Solution:</p><p>Change permissions of your key:</p><pre><code>chmod 400 keyname\n</code></pre><p><br></p><p><strong><u>Composer Errors</u></strong></p><p>Error: Classes can\'t be found </p><p>Solution: make sure your composer.json file has the namespace app\\\\ connected to \"app/\" (don\'t forget the /)</p><p><br></p><p>After composer errors are solved remove vendor</p><pre><code>rm -r vendor\n</code></pre><p><br></p><p>and run</p><pre><code>composer install\n</code></pre><p>again</p><p><br></p><p><strong><u>Common Errors</u></strong></p><p>Error 500 (Internal Sever Error)</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/37.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/37.png\" style=\"display: block; margin: auto;\" width=\"564\"></a></p><p><br></p><p>Run</p><pre><code>sudo tail /var/log/apache2/error.log\n</code></pre><p>in the droplet to view the error</p><p><br></p><p>Error: 1364 Field \'display_name\' doesn\'t have a default value (also happens with GROUP_BY)</p><p>Solution: </p><ul><li>SSH into server</li><li>Sign into MySQL, type: mysql -u username -p</li><li>Enter password</li><li>Type: SET GLOBAL sql_mode=\'\'\";</li><li>Type: exit</li></ul>','2021-06-28 14:59:52',1,8,12,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(48,'SSL Certificate','ssl-certificate','<p>We will use lets-encrypt for a free SSL Certificate. If you\'ve been following along with these posts then just run</p><pre><code>sudo apt-get update\nsudo snap install core; sudo snap refresh core\nsudo snap install --classic certbot\nsudo certbot --apache\n</code></pre><p>but if you have done something different then go to <a href=\"https://certbot.eff.org/lets-encrypt/ubuntubionic-apache\" target=\"_blank\">lets-encrypt</a> and choose software and system and follow the instructions as you scroll down</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/38.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/38.png\" style=\"display: block; margin: auto;\" width=\"346\"></a></p><p>And that\'s it! Go to your website and see the small lock to the left of your search bar!</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/39.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/website%20hosting/39.png\" style=\"display: block; margin: auto;\"></a></p>','2021-06-28 15:22:10',1,8,11,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(49,'Merge Sort','merge-sort','<p>Merge sort is an O(nlogn) runtime sorting algorithm. O(nlogn) is the fastest sorting time when sorting comparable objects. Merge sort is a <strong>divide and conquer algorithm</strong> since it breaks down the problem into smaller subproblems and solves the larger problem that way.</p><p><br></p><p><strong><u>Algorithm:</u></strong></p><ol><li>Divide the list into the smallest unit (1 element)</li><li>Compare each element with the adjacent list</li><li>Sort and merge the two adjacent lists. </li></ol><p>All the elements are sorted and merged:</p><p><a href=\"https://upload.wikimedia.org/wikipedia/commons/c/cc/Merge-sort-example-300px.gif\" target=\"_blank\"><img src=\"https://upload.wikimedia.org/wikipedia/commons/c/cc/Merge-sort-example-300px.gif\" style=\"display: block; margin: auto;\"></a></p><p><a href=\"https://upload.wikimedia.org/wikipedia/commons/thumb/e/e6/Merge_sort_algorithm_diagram.svg/600px-Merge_sort_algorithm_diagram.svg.png\" target=\"_blank\"><img src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/e/e6/Merge_sort_algorithm_diagram.svg/600px-Merge_sort_algorithm_diagram.svg.png\" style=\"display: block; margin: auto;\" width=\"291\"></a></p><p><br></p><p>Before proceeding to the code try to implement the algorithm on your own.</p><p><br></p><p><strong><u>Solution (in java):</u></strong></p><pre><code>public class MergeSort {\n    public static void main(String[] args) {\n        // input array\n        int[] arr = {2, 6, 3, 9, 7, 5, 1, 4, 8};\n\n        // Call merge sort\n        mergeSort(arr);\n\n        // Check the output (should be sorted)\n        System.out.println(java.util.Arrays.toString(arr));\n    }\n\n    public static int[] mergeSort(int[] list) {\n        // do nothing if list is empty\n        if (list.length &lt;= 1) {\n            return list;\n        }\n\n        // Create 2 lists to hold 1st and 2nd half of the list\n        int[] first = new int[list.length / 2];\n        int[] second = new int[list.length - first.length];\n        // Split the array in half and populate above lists\n        System.arraycopy(list, 0, first, 0, first.length);\n        System.arraycopy(list, first.length, second, 0, second.length);\n\n        // Sort each half recursively\n        mergeSort(first);\n        mergeSort(second);\n\n        // Merge both halves together\n        merge(first, second, list);\n        return list;\n    }\n\n    private static void merge(int[] first, int[] second, int[] result) {\n        // Index Position in first array - starting with first element\n        int iFirst = 0;\n\n        // Index Position in second array - starting with first element\n        int iSecond = 0;\n\n        // Index Position in merged array - starting with first position\n        int iMerged = 0;\n\n        // Compare elements at iFirst and iSecond,\n        // and move smaller element at iMerged\n        while (iFirst &lt; first.length &amp;&amp; iSecond &lt; second.length) {\n            if (first[iFirst] &lt; second[iSecond]) {\n                result[iMerged] = first[iFirst];\n                iFirst++;\n            } else {\n                result[iMerged] = second[iSecond];\n                iSecond++;\n            }\n            iMerged++;\n        }\n        // copy remaining elements from both halves\n        System.arraycopy(first, iFirst, result, iMerged, first.length - iFirst);\n        System.arraycopy(second, iSecond, result, iMerged, second.length - iSecond);\n    }\n}\n</code></pre><p><br></p><p>output:</p><pre><code>[1, 2, 3, 4, 5, 6, 7, 8, 9]\n</code></pre><p><br></p><p>Recursion can be tricky, so as you follow along make sure to have paper and pencil to draw down each step.</p><p><br></p><p><strong><u>Clarifications:</u></strong></p><p>The function arraycopy lies in the System class. It copies an array from the specified source array, beginning at the specified position, to the specified position of the destination array:</p><pre><code>public static void arraycopy(Object src, int srcPos, Object dest, int destPos, int length)\n</code></pre><p>Parameters:</p><ul><li>src − The source array</li><li>srcPos − The starting position in the source array</li><li>dest − The destination array</li><li>destPos − The starting position in the destination data</li><li>length − The number of array elements to be copied</li></ul>','2018-12-28 19:15:27',1,7,2,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(50,'Introduction to java','introduction-to-java','<p><strong><u>About this tutorial</u></strong></p><p>This java tutorial is meant for Software Developers new to Java. This tutorial will guide you through all the java fundamentals and quiz you on your progress throughout your readings.</p><p><br></p><p>This tutorial begins by showing instructions for setting up a development environment consisting of a Java Development Kit (JDK) and the Intellij IDE. After setting up the development environment you will learn basic Java development concepts. The concepts will increase in difficulty as you progress through the tutorial, and it is advised that you take breaks.</p><p><br></p><p>Well enough talking, let\'s get to learning!</p>','2019-01-09 15:20:20',1,3,0,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(51,'Bubble Sort','bubble-sort','<p>Bubble Sort is one of the easiest sorts to implement, but is too slow for real world use. Bubble Sort is a simple sorting algorithm that repeatedly steps through the list, compares adjacent pairs and swaps them if they are in the wrong order. This algorithm is named for the way smaller (or larger) numbers bubble to the front of the list. The algorithm runs as follows:</p><p><a href=\"https://upload.wikimedia.org/wikipedia/commons/c/c8/Bubble-sort-example-300px.gif\" target=\"_blank\"><img src=\"https://upload.wikimedia.org/wikipedia/commons/c/c8/Bubble-sort-example-300px.gif\" style=\"display: block; margin: auto;\"></a></p><p><span style=\"color: rgb(68, 68, 68);\">Before proceeding to the code try to implement the algorithm on your own.</span></p><p><br></p><p><strong style=\"color: rgb(68, 68, 68);\"><u>Solution (in java):</u></strong></p><pre><code>import java.util.Arrays;\n\npublic class BubbleSort {\n    static int[] bubbleSort(int[] arr) {\n        int length = arr.length;\n        int temp;\n        for (int i = 0; i &lt; length; i++) {\n            for (int j = 1; j &lt; (length - i); j++) {\n                if (arr[j - 1] &gt; arr[j]) { // change to &lt; for descending order\n                    //swap elements\n                    temp = arr[j - 1];\n                    arr[j - 1] = arr[j];\n                    arr[j] = temp;\n                }\n\n            }\n        }\n        return arr;\n    }\n\n    public static void main(String[] args) {\n        int arr[] = {2, 40, 2, 25, -5, 15, 20, 155};\n        System.out.println(Arrays.toString(bubbleSort(arr)));\n\n    }\n}\n</code></pre><p><br></p><p>Output:</p><pre><code>[-5, 2, 2, 15, 20, 25, 40, 155]\n</code></pre><p><br></p><p>Bubble sort keeps on running until no more swaps are made, and runs in O(n^2) runtime.</p>','2018-12-30 15:05:05',1,7,0,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(52,'Quick Sort','quick-sort','<p>Quicksort is a divide and conquer algorithm. Quicksort first divides a large array into two smaller sub-arrays: the low elements and the high elements. Quicksort can then recursively sort the sub-arrays. Quicksort is an O(nlogn) runtime sorting algorithm, and can be faster than <a href=\"https://kodecentral.com/post/merge-sort\" target=\"_blank\">Mergesort</a> and <a href=\"https://kodecentral.com/post/heap-sort\" target=\"_blank\">Heapsort</a> when implemented correctly.</p><p><br></p><p><strong><u>Algorithm:</u></strong></p><ol><li>Pick an element (called a pivot).</li><li>Reorder the array so that all elements with values less than the pivot come before the pivot, while all elements with values greater than the pivot come after it (equal values can go either way). After this partitioning, the pivot is in its final position. This is called the partition operation.</li><li>Recursively apply the above steps to the sub-array of elements with smaller values and separately to the sub-array of elements with greater values.</li></ol><p>The base case of the recursion is arrays of size &lt; 2, which are in order by definition, so they never need to be sorted.</p><p><br></p><p>The pivot selection and partitioning steps can be done in several different ways; the choice of specific implementation schemes greatly affects the algorithm\'s performance. We will always pick the pivot to be the middle element (not always most efficient way).</p><p><a href=\"https://gifimage.net/wp-content/uploads/2018/04/quicksort-gif.gif\" target=\"_blank\"><img src=\"https://gifimage.net/wp-content/uploads/2018/04/quicksort-gif.gif\" style=\"display: block; margin: auto;\" width=\"247\"></a></p><p><br></p><p><strong><u>Solution (in java):</u></strong></p><pre><code>import java.util.Arrays;\n\npublic class QuickSort {\n    private static int partition(int[] arr, int left, int right) {\n        int i = left, j = right;\n        int tmp;\n\n        // pivot will be middle element\n        int pivot = arr[(left + right) / 2];\n\n        while (i &lt;= j) {\n            while (arr[i] &lt; pivot)\n                i++;\n            while (arr[j] &gt; pivot)\n                j--;\n            if (i &lt;= j) {\n                tmp = arr[i];\n                arr[i] = arr[j];\n                arr[j] = tmp;\n                i++;\n                j--;\n            }\n        }\n        return i;\n    }\n\n    private static int[] quickSort(int[] arr, int left, int right) {\n        int index = partition(arr, left, right);\n        if (left &lt; index - 1)\n            quickSort(arr, left, index - 1);\n        if (index &lt; right)\n            quickSort(arr, index, right);\n\n        return arr;\n    }\n\n    private static int[] quickSort(int[] arr) {\n        if (arr.length &lt; 2)\n            return arr;\n        return quickSort(arr, 0, arr.length - 1);\n    }\n\n    public static void main(String[] args) {\n        int arr[] = {1, 2, 4, 90, 0, -1, 30};\n        System.out.println(Arrays.toString(quickSort(arr)));\n    }\n}\n</code></pre><p><br></p><p>output:</p><pre><code>[-1, 0, 1, 2, 4, 30, 90]\n</code></pre>','2018-12-31 13:05:20',1,7,4,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(53,'Heap Sort','heap-sort','<p>Heapsort can be thought of as an improved <a href=\"https://kodecentral.com/post/selection-sort\" target=\"_blank\">Selectionsort</a>: it divides the input into a sorted and an unsorted region, and it iteratively shrinks the unsorted region by extracting the largest element and moving that to the sorted region. The improvement consists of the use of a heap data structure rather than a linear-time search to find the maximum.</p><p><br></p><p><strong><u>Algorithm:</u></strong></p><p><br></p><ol><li>Call the buildHeap() function on the list. This builds a heap from a list in O(n) operations.</li><li>Swap the first element of the list with the final element. Decrease the considered range of the list by one.</li><li>Call heapify() on the remaining list.</li><li>Go to step 2 unless only 1 element remains</li></ol><p><a href=\"https://i.imgur.com/UQlB9Ko.gif\" target=\"_blank\"><img src=\"https://i.imgur.com/UQlB9Ko.gif\" style=\"display: block; margin: auto;\" width=\"242\"></a></p><p><strong><u>Solution (in java):</u></strong></p><pre><code>import java.util.Arrays;\n\npublic class HeapSort {\n\n    private static void buildHeap(int[] arr) {\n        for (int i = (arr.length - 1) / 2; i &gt;= 0; i--) {\n            heapify(arr, i, arr.length - 1);\n        }\n    }\n\n    private static void heapify(int[] arr, int i, int size) {\n        int left = 2 * i + 1;\n        int right = 2 * i + 2;\n        int max;\n        if (left &lt;= size &amp;&amp; arr[left] &gt; arr[i]) {\n            max = left;\n        } else {\n            max = i;\n        }\n\n        if (right &lt;= size &amp;&amp; arr[right] &gt; arr[max]) {\n            max = right;\n        }\n        // If max is not current node, swap it with max of left and right child\n        if (max != i) {\n            swap(arr, i, max);\n            heapify(arr, max, size);\n        }\n    }\n\n    private static void swap(int[] arr, int i, int j) {\n        int t = arr[i];\n        arr[i] = arr[j];\n        arr[j] = t;\n    }\n\n    private static int[] heapSort(int[] arr) {\n\n        buildHeap(arr);\n        int sizeOfHeap = arr.length - 1;\n        for (int i = sizeOfHeap; i &gt; 0; i--) {\n            swap(arr, 0, i);\n            sizeOfHeap = sizeOfHeap - 1;\n            heapify(arr, 0, sizeOfHeap);\n        }\n        return arr;\n    }\n\n    public static void main(String[] args) {\n        int[] arr = {11, 5, 100, 6, 13, 25, 8};\n        System.out.println(Arrays.toString(heapSort(arr)));\n    }\n}\n</code></pre><p><br></p><p>output:</p><pre><code>[5, 6, 8, 11, 13, 25, 100]\n</code></pre><p><br></p><p>The buildHeap() operation is run once, and is O(n) in performance. The heapify() function is O(log n), and is called n times. Therefore, the performance of this algorithm is O(n + n log n) = O(n log n).</p>','2018-12-30 16:40:33',1,7,3,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(54,'Introduction to Java Telegram Bot Tutorial','introduction-to-java-telegram-bot-tutorial','<p>Hello everyone! Welcome to this Java Telegram Bot Tutorial. While going through this tutorial you will learn how to</p><ul><li>Initialize your first project</li><li>Respond to messages</li><li>Code text based games</li><li>Fetch data from online API\'s</li><li>Use a local SQL db to store game information</li><li>And much more!</li></ul><p><br></p><p>I assume you know Java (programming language) and have used Telegram before.</p><p><br></p><p>Thanks to <a href=\"https://github.com/rubenlagus/\" target=\"_blank\">Ruben</a> for his amazing library!</p>','2019-01-08 09:45:13',1,9,0,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(55,'Dynamic Sitemap with Slim 3 Framework','dynamic-sitemap-with-slim-3-framework','<p><strong><u>What is a Sitemap?</u></strong></p><p>Think about your website as a house, and each link inside your website as a room. The Sitemap is a blueprint of your website and Google is the inspector. We need to let Google know what links are important inside the website since <strong>pages</strong> are also ranked (not just websites).</p><p><br></p><p><strong><u>So Why is This Important?</u></strong></p><p>We want to rank higher in search engines (Search Engine Optimization) since this will result in higher traffic and more revenue. </p><p>Sitemaps are important if</p><ul><li>You have pages that are dynamically created</li><li>Your site is extremely large with multiple pages</li><li>Your site is just newly developed</li></ul><p>It doesn\'t hurt to have a Sitemap even if you believe to not need it.</p><p><br></p><p><strong><u>Using Slim 3 Framework to create Dynamic Sitemap</u></strong></p><p>There are several ways to create a Sitemap, such as creating a <u>.php</u> file that converts to <u>.xml</u>, but we will use slim and set the content type to xml - to avoid rerouting and renaming. First we need to list all the routes that have been registered in $app. To do this execute the following code inside a route:</p><pre><code>&lt;?php\n﻿foreach ($this-&gt;router-&gt;getRoutes() as $r) {\n  echo $r-&gt;getPattern();\n  echo \"&lt;br/&gt;\";\n}\n</code></pre><p>Chose the urls that have no child routes. For Kode Central we have the following routes:</p><pre><code>&lt;?php\n$urls = [\"/\",\"/search\",\"/contact\",\"/about-us\",\"/faq\",\"/all-pages\"];\n</code></pre><p>For other routes that have children routes that change dynamically we will make a Sitemap.php view and render them. Create an Slim App object and render Sitemap.php and pass the desired variables:</p><pre><code>&lt;?php\n// composer autoload file\n﻿require \'../vendor/autoload.php\';\n\n// propels config file to connect to database\nrequire \'../data/generated-conf/config.php\';\n\n$app = new \\Slim\\App([\"settings\" =&gt; [\"displayErrorDetails\" =&gt; true]]);\n\n$container = $app-&gt;getContainer();\n\n// directory where views are located\n$container[\'view\'] = new \\Slim\\Views\\PhpRenderer(\"../app/views/\");\n\n$app-&gt;get(\'/sitemap.xml\', function ($request, $response, $args) {\n&nbsp; &nbsp; // to render xml\n&nbsp; &nbsp; $response = $response-&gt;withHeader(\'Content-type\', \'application/xml\');\n\n&nbsp; &nbsp; // base urls\n&nbsp; &nbsp; $urls = [\"/\",\"/search\",\"/contact\",\"/about-us\",\"/faq\",\"/all-pages\"];\n\n&nbsp; &nbsp; // variables that have children links\n&nbsp; &nbsp; // ex: post/{post-link}\n&nbsp; &nbsp; $posts = \\PostQuery::create()-&gt;find();\n&nbsp; &nbsp; $users = \\UserQuery::create()-&gt;find();\n&nbsp; &nbsp; $libs = \\LibraryQuery::create()-&gt;find();\n&nbsp; &nbsp; return $this-&gt;view-&gt;render(\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; $response,\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; \'sitemap.php\',\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; [\'router\'=&gt;$this-&gt;router, \'urls\'=&gt;$urls, \'posts\'=&gt;$posts, \'users\'=&gt;$users, \'libs\'=&gt;$libs]\n&nbsp; &nbsp; &nbsp; );\n});\n\n$app-&gt;run();\n</code></pre><p>Then output in xml format (sitemap.php view in app/view directory)</p><pre><code>&lt;?php\n$base_url = \'https://kodecentral.com\';\n\n// basic xml header info\necho \'&lt;?xml version=\"1.0\" encoding=\"UTF-8\"?&gt;\'.PHP_EOL.\n\'&lt;urlset xmlns=\"http://www.sitemaps.org/schemas/sitemap/0.9\"&gt;\' . PHP_EOL;\n\nforeach ($urls as $url) {\n&nbsp; &nbsp; echo \'&lt;url&gt;\' . PHP_EOL;\n&nbsp; &nbsp; echo \'&lt;loc&gt;\'.$base_url.$url.\'&lt;/loc&gt;\' . PHP_EOL;\n&nbsp; &nbsp; echo \'&lt;changefreq&gt;daily&lt;/changefreq&gt;\' . PHP_EOL;\n&nbsp; &nbsp; echo \'&lt;/url&gt;\' . PHP_EOL;\n}\n\n// posts\nforeach ($posts as $post) {\n&nbsp; &nbsp; echo \'&lt;url&gt;\' . PHP_EOL;\n&nbsp; &nbsp; echo \'&lt;loc&gt;\'.$base_url.\'/post/\'. $post-&gt;getHyperlink() .\'&lt;/loc&gt;\' . PHP_EOL;\n&nbsp; &nbsp; echo \'&lt;changefreq&gt;daily&lt;/changefreq&gt;\' . PHP_EOL;\n&nbsp; &nbsp; echo \'&lt;/url&gt;\' . PHP_EOL;\n}\n\n// users\nforeach ($users as $user) {\n&nbsp; &nbsp; echo \'&lt;url&gt;\' . PHP_EOL;\n&nbsp; &nbsp; echo \'&lt;loc&gt;\'.$base_url.\'/profile/\'. urlencode($user-&gt;getUsername()) .\'&lt;/loc&gt;\' . PHP_EOL;\n&nbsp; &nbsp; echo \'&lt;changefreq&gt;daily&lt;/changefreq&gt;\' . PHP_EOL;\n&nbsp; &nbsp; echo \'&lt;/url&gt;\' . PHP_EOL;\n}\n\n// libraries\nforeach ($libs as $lib) {\n&nbsp; &nbsp; echo \'&lt;url&gt;\' . PHP_EOL;\n&nbsp; &nbsp; echo \'&lt;loc&gt;\'.$base_url.\'/lib/\'. urlencode($lib-&gt;getName()) .\'&lt;/loc&gt;\' . PHP_EOL;\n&nbsp; &nbsp; echo \'&lt;changefreq&gt;daily&lt;/changefreq&gt;\' . PHP_EOL;\n&nbsp; &nbsp; echo \'&lt;/url&gt;\' . PHP_EOL;\n}\n\n// close tag\necho \'&lt;/urlset&gt;\' . PHP_EOL;\n</code></pre><p>Tags</p><ul><li>&lt;urlset&gt; : Encapsulates the file and references the current protocol standard.</li><li>&lt;url&gt; : Parent tag for each URL entry. The remaining tags are children of this tag.</li><li>&lt;loc&gt; : URL of the page. This URL must begin with the protocol (such as http) and end with a trailing slash, if your web server requires it. This value must be less than 2,048 characters.</li><li>&lt;changefreq&gt; : How frequently the page is likely to change. This value provides general information to search engines and may not correlate exactly to how often they crawl the page.</li><li>More information at <a href=\"https://www.sitemaps.org/protocol.html\" target=\"_blank\">sitemap.org</a></li></ul><p>You can see the Sitemap at <a href=\"https://kodecentral.com/sitemap.xml\" target=\"_blank\">kodecentral.com/sitemap.xml</a></p><p><br></p><p><strong><u>Clarifications:</u></strong></p><p>Composer is used to install Slim, Slim Php View, and Propel ORM. </p><pre><code>{\n&nbsp; \"require\": {\n&nbsp; &nbsp; \"propel/propel\": \"~2.0@dev\",\n&nbsp; &nbsp; \"slim/slim\": \"^3.9\",\n&nbsp; &nbsp; \"slim/php-view\": \"^2.2\"\n&nbsp; },\n&nbsp; \"autoload\": {\n&nbsp; &nbsp; \"classmap\": [\n&nbsp; &nbsp; &nbsp; \"data/models/\"\n&nbsp; &nbsp; ],\n&nbsp; &nbsp; \"psr-4\":{\n&nbsp; &nbsp; &nbsp; \"app\\\\\": \"app/\"\n&nbsp; &nbsp; }\n&nbsp; }\n}\n</code></pre><p>And there you go! Go into your <a href=\"https://search.google.com/search-console/sitemaps\" target=\"_blank\">Google Search Console</a> and link your new Sitemap.</p>','2019-02-24 17:54:20',1,12,1,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(56,'Simple Echo Bot','simple-echo-bot','<p>Before starting we need to contact <a href=\"https://telegram.me/botfather\" target=\"_blank\">@BotFather</a> to receive a bot token.</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/java%20telegram%20bot/1.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/java%20telegram%20bot/1.png\" style=\"display: block; margin: auto;\" width=\"326\"></a></p><h1>Library</h1><p>We have to <a href=\"https://github.com/rubenlagus/TelegramBots\" target=\"_blank\">install Ruben\'s library</a> in able to communicate with Telegram servers easily. You can install TelegramBots library with different methods:</p><ul><li>Using Maven:</li></ul><pre><code>&lt;dependency&gt;\n&nbsp;&lt;groupId&gt;org.telegram&lt;/groupId&gt;\n&nbsp;&lt;artifactId&gt;telegrambots&lt;/artifactId&gt;\n&nbsp;&lt;version&gt;Latest&lt;/version&gt;\n&lt;/dependency&gt;\n</code></pre><ul><li>Using <a href=\"https://jitpack.io/#rubenlagus/TelegramBots/\" target=\"_blank\">Jitpack</a></li><li>Or download <span style=\"background-color: rgb(255, 235, 204);\">.jar</span> file with dependencies from <a href=\"https://github.com/rubenlagus/TelegramBots/releases/latest\" target=\"_blank\">here</a></li></ul><p><br></p><p><strong><u>Importing jar file in intelliJ</u></strong></p><p>Download telegrambots-v.v-jar-with-dependencies.jar (4.1 for me)</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/java%20telegram%20bot/2_1.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/java%20telegram%20bot/2_1.png\" width=\"556\" style=\"display: block; margin: auto;\"></a></p><p>Create a folder lib in your project root directory and place the jar file in it. Then import it.</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/java%20telegram%20bot/2.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/java%20telegram%20bot/2.png\" style=\"display: block; margin: auto;\" width=\"229\"></a></p><p><br></p><h1>Coding</h1><p>Once you install the library we can start on the fun part! We are going to make a bot that sends back what you message it. Open Intellij and create a new project. Under your <span style=\"background-color: rgb(255, 235, 204);\">src</span> folder create 2 new files: <span style=\"background-color: rgb(255, 235, 204);\">Main.java</span> and <span style=\"background-color: rgb(255, 235, 204);\">KodeCentralBot.java</span>. Lets write our bot code:</p><pre><code>import org.telegram.telegrambots.bots.TelegramLongPollingBot;\nimport org.telegram.telegrambots.meta.api.objects.Update;\n\npublic class KodeCentralBot extends TelegramLongPollingBot {\n    @Override\n    public void onUpdateReceived(Update update) {\n        // TODO\n    }\n\n    @Override\n    public String getBotUsername() {\n        // Return bot username\n        // If bot username is @KodeCentralBot, it must return \'KodeCentralBot\'\n        return \"KodeCentralBot\";\n    }\n\n    @Override\n    public String getBotToken() {\n        // Return bot token from BotFather\n        return \"someLongStringHere\";\n    }\n}\n</code></pre><p>getBotToken() and getBotUsername() must be the credentials received from <a href=\"https://telegram.me/botfather\" target=\"_blank\">@BotFather</a>. Now let\'s move to the bot logic. We want to \"echo\" every message we send it. We need to place that code in onUpdateRecieved() since this method is called when an update is received from a user:</p><pre><code>@Override\npublic void onUpdateReceived(Update update) {\n\n    // We check if the update has a message and the message has text\n    if (update.hasMessage() &amp;&amp; update.getMessage().hasText()) {\n        // Set variables\n        String message_text = update.getMessage().getText();\n\n        // id from sent message (will use to send back the message)\n        long chat_id = update.getMessage().getChatId();\n\n        SendMessage message = new SendMessage() // Create a message object\n                .setChatId(chat_id)\n                .setText(message_text);\n        try {\n            execute(message); // Sending our message object to user\n        } catch (TelegramApiException e) {\n            e.printStackTrace();\n        }\n    }\n}\n</code></pre><p>Now we need to run the Bot. Go to <span style=\"background-color: rgb(255, 235, 204);\">Main.java</span> and initialize Api Context, initialize Telegram Bots Api, and register our bot:</p><pre><code>public class Main {\n    public static void main(String[] args) {\n        // Initialize Api Context\n        ApiContextInitializer.init();\n\n        // Instantiate Telegram Bots API\n        TelegramBotsApi botsApi = new TelegramBotsApi();\n\n        // Register our bot\n        try {\n            botsApi.registerBot(new KodeCentralBot());\n        } catch (TelegramApiException e) {\n            e.printStackTrace();\n        }\n    }\n}\n</code></pre><p><br></p><h1>Files</h1><blockquote>Main.java</blockquote><pre><code>import org.telegram.telegrambots.ApiContextInitializer;\nimport org.telegram.telegrambots.meta.TelegramBotsApi;\nimport org.telegram.telegrambots.meta.exceptions.TelegramApiException;\n\npublic class Main {\n    public static void main(String[] args) {\n        // Initialize Api Context\n        ApiContextInitializer.init();\n\n        // Instantiate Telegram Bots API\n        TelegramBotsApi botsApi = new TelegramBotsApi();\n\n        // Register our bot\n        try {\n            botsApi.registerBot(new KodeCentralBot());\n        } catch (TelegramApiException e) {\n            e.printStackTrace();\n        }\n    }\n}\n</code></pre><p><br></p><blockquote>KodeCentralBot.java</blockquote><pre><code>import org.telegram.telegrambots.bots.TelegramLongPollingBot;\nimport org.telegram.telegrambots.meta.api.methods.send.SendMessage;\nimport org.telegram.telegrambots.meta.api.objects.Update;\nimport org.telegram.telegrambots.meta.exceptions.TelegramApiException;\n\npublic class KodeCentralBot extends TelegramLongPollingBot {\n    @Override\n    public void onUpdateReceived(Update update) {\n\n        // We check if the update has a message and the message has text\n        if (update.hasMessage() &amp;&amp; update.getMessage().hasText()) {\n            // Set variables\n            String message_text = update.getMessage().getText();\n\n            // id from sent message (will use to send back the message)\n            long chat_id = update.getMessage().getChatId();\n\n            SendMessage message = new SendMessage() // Create a message object\n                    .setChatId(chat_id)\n                    .setText(message_text);\n            try {\n                execute(message); // Sending our message object to user\n            } catch (TelegramApiException e) {\n                e.printStackTrace();\n            }\n        }\n    }\n\n    @Override\n    public String getBotUsername() {\n        // Return bot username\n        // If bot username is @KodeCentralBot, it must return \'KodeCentralBot\'\n        return \"KodeCentralBot\";\n    }\n\n    @Override\n    public String getBotToken() {\n        // Return bot token from BotFather\n        return \"token\";\n    }\n}\n</code></pre><p><br></p><p>Run the program and message the bot. PROFIT!</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/java%20telegram%20bot/3_chat.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/java%20telegram%20bot/3_chat.png\" style=\"display: block; margin: auto;\"></a></p><p><br></p><p>To make the bot better continue reading on!</p>','2019-04-13 09:08:31',1,9,1,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(57,'Logging','logging','<p>How about printing something instead of seeing an empty console? I got you! We need the code from the previous example to start off:</p><p><br></p><blockquote>KodeCentralBot.java</blockquote><pre><code>import org.telegram.telegrambots.bots.TelegramLongPollingBot;\nimport org.telegram.telegrambots.meta.api.methods.send.SendMessage;\nimport org.telegram.telegrambots.meta.api.objects.Update;\nimport org.telegram.telegrambots.meta.exceptions.TelegramApiException;\n\npublic class KodeCentralBot extends TelegramLongPollingBot {\n    @Override\n    public void onUpdateReceived(Update update) {\n\n        // We check if the update has a message and the message has text\n        if (update.hasMessage() &amp;&amp; update.getMessage().hasText()) {\n            // Set variables\n            String message_text = update.getMessage().getText();\n\n            // id from sent message (will use to send back the message)\n            long chat_id = update.getMessage().getChatId();\n\n            SendMessage message = new SendMessage() // Create a message object\n                    .setChatId(chat_id)\n                    .setText(message_text);\n            try {\n                execute(message); // Sending our message object to user\n            } catch (TelegramApiException e) {\n                e.printStackTrace();\n            }\n        }\n    }\n\n    @Override\n    public String getBotUsername() {\n        // Return bot username\n        // If bot username is @KodeCentralBot, it must return \'KodeCentralBot\'\n        return \"KodeCentralBot\";\n    }\n\n    @Override\n    public String getBotToken() {\n        // Return bot token from BotFather\n        return \"token\";\n    }\n}\n</code></pre><p><br></p><blockquote>Main.java</blockquote><pre><code>import org.telegram.telegrambots.ApiContextInitializer;\nimport org.telegram.telegrambots.meta.TelegramBotsApi;\nimport org.telegram.telegrambots.meta.exceptions.TelegramApiException;\n\npublic class Main {\n    public static void main(String[] args) {\n        // Initialize Api Context\n        ApiContextInitializer.init();\n\n        // Instantiate Telegram Bots API\n        TelegramBotsApi botsApi = new TelegramBotsApi();\n\n        // Register our bot\n        try {\n            botsApi.registerBot(new KodeCentralBot());\n        } catch (TelegramApiException e) {\n            e.printStackTrace();\n        }\n    }\n}\n</code></pre><p><br></p><h1>Logging</h1><p>So now we want to be notified of every update and the response (if any), correct? Let\'s first retrieve additional variables from the update object for better logging.</p><pre><code>String username = update.getMessage().getChat().getUserName();\nlong user_id = update.getMessage().getChat().getId();\nString message_text = update.getMessage().getText();\n</code></pre><p> </p><p>Now lets create a function that will output the following:</p><ol><li>Time received</li><li>Message text</li><li>Sender id</li></ol><p>The function receives the important information through parameters and outputs to the console:</p><pre><code>private void log(String username, String chatId, String textReceived, String botResponse) {\n    System.out.println(\"----------------------------\\n\");\n    // print out in PM/AM time\n    DateFormat dateFormat = new SimpleDateFormat(\"yyyy/MM/dd h:mm a\");\n    Date date = new Date();\n    System.out.println(dateFormat.format(date));\n    System.out.println(\"Message from \" + username + \". (id = \" + chatId + \") \\n Text - \" + textReceived);\n    System.out.println(\"Bot answer: \\n Text - \" + botResponse);\n}\n</code></pre><p><br></p><p>Call this function whenever you need nice logging! Viola!</p><p><br></p><blockquote>KodeCentralBot.java</blockquote><pre><code>import org.telegram.telegrambots.bots.TelegramLongPollingBot;\nimport org.telegram.telegrambots.meta.api.methods.send.SendMessage;\nimport org.telegram.telegrambots.meta.api.objects.Update;\nimport org.telegram.telegrambots.meta.exceptions.TelegramApiException;\n\nimport java.text.DateFormat;\nimport java.text.SimpleDateFormat;\nimport java.util.Date;\n\npublic class KodeCentralBot extends TelegramLongPollingBot {\n    @Override\n    public void onUpdateReceived(Update update) {\n\n        // We check if the update has a message and the message has text\n        if (update.hasMessage() &amp;&amp; update.getMessage().hasText()) {\n\n            // get the username, id, and the message text\n            String username = update.getMessage().getChat().getUserName();\n            long user_id = update.getMessage().getChat().getId();\n            String message_text = update.getMessage().getText();\n            long chat_id = update.getMessage().getChatId();\n\n            SendMessage message = new SendMessage() // Create a message object object\n                    .setChatId(chat_id)\n                    .setText(message_text);\n\n            // since just echo bot, the bot response is the same as the incoming update message text\n            log(username, Long.toString(user_id), message_text, message_text);\n            try {\n                execute(message); // Sending our message object to user\n            } catch (TelegramApiException e) {\n                e.printStackTrace();\n            }\n        }\n    }\n\n    private void log(String username, String chatId, String textReceived, String botResponse) {\n        System.out.println(\"----------------------------\\n\");\n        // print out in PM/AM time\n        DateFormat dateFormat = new SimpleDateFormat(\"yyyy/MM/dd h:mm a\");\n        Date date = new Date();\n        System.out.println(dateFormat.format(date));\n        System.out.println(\"Message from \" + username + \". (id = \" + chatId + \") \\n Text - \" + textReceived);\n        System.out.println(\"Bot answer: \\n Text - \" + botResponse);\n    }\n\n    @Override\n    public String getBotUsername() {\n        // Return bot username\n        // If bot username is @KodeCentralBot, it must return \'KodeCentralBot\'\n        return \"KodeCentralBot\";\n    }\n\n    @Override\n    public String getBotToken() {\n        // Return bot token from BotFather\n        return \"token\";\n    }\n}\n</code></pre><p><br></p><h1>Output</h1><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/java%20telegram%20bot/4_logging.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/java%20telegram%20bot/4_logging.png\" style=\"display: block; margin: auto;\" width=\"314\"></a></p>','2019-04-12 12:04:23',1,9,2,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(58,'Chat Games Setup','chat-games-setup','<p>Let\'s make group chat games! To distinguish each group we use the <span style=\"background-color: rgb(255, 235, 204);\">update.getMessage().getChatId()</span> function since each chat has a unique id. So let\'s start off with the basics: We need an object to hold data about the progress of the current game, and each chat must have its own object. We will accomplish this with a HashMap which will link each chat ID to a game object:</p><pre><code>// to play separate games on separate groups\nprivate static HashMap&lt;Long, Game&gt; games = new HashMap&lt;&gt;();\n</code></pre><p>Create a new file in your <span style=\"background-color: rgb(255, 235, 204);\">src</span> directory named <span style=\"background-color: rgb(255, 235, 204);\">GameHandler.java</span> to keep the bot class clean. We are going to create a static class <span style=\"background-color: rgb(255, 235, 204);\">Game</span> in <span style=\"background-color: rgb(255, 235, 204);\">GameHandler.java</span> which will hold all games being played and their progress:</p><pre><code>private static class Game {\n    // for upcoming tutorial\n    // private ImageGuess guessGame = null;\n}\n</code></pre><p><span style=\"background-color: rgb(255, 235, 204);\">GameHandler</span> will have a static check function that will be called from the <span style=\"background-color: rgb(255, 235, 204);\">KodeCentralBot onUpdateReceived</span> function. Check function:</p><pre><code>public static void check(KodeCentralBot kodeCentralBot, Update update) {\n    Game current = null;\n    long chat_id = update.getMessage().getChatId();\n    if (games.containsKey(chat_id))\n        current = games.get(chat_id);\n    // check what game, etc.. (future)\n}\n</code></pre><p><strong>That\'s all the new code for now.</strong></p><p><br></p><blockquote>KodeCentralBot.java</blockquote><pre><code>import org.telegram.telegrambots.bots.TelegramLongPollingBot;\nimport org.telegram.telegrambots.meta.api.methods.send.SendMessage;\nimport org.telegram.telegrambots.meta.api.objects.Update;\nimport org.telegram.telegrambots.meta.exceptions.TelegramApiException;\n\nimport java.text.DateFormat;\nimport java.text.SimpleDateFormat;\nimport java.util.Date;\n\npublic class KodeCentralBot extends TelegramLongPollingBot {\n    @Override\n    public void onUpdateReceived(Update update) {\n\n        // We check if the update has a message and the message has text\n        if (update.hasMessage() &amp;&amp; update.getMessage().hasText()) {\n\n            // get the username, id, and the message text\n            String username = update.getMessage().getChat().getUserName();\n            long user_id = update.getMessage().getChat().getId();\n            String message_text = update.getMessage().getText();\n            long chat_id = update.getMessage().getChatId();\n\n            SendMessage message = new SendMessage() // Create a message object object\n                    .setChatId(chat_id)\n                    .setText(message_text);\n\n            // echo bot: the bot response is the same as the incoming update message text\n            log(username, Long.toString(user_id), message_text, message_text);\n\n            // NEW:\n            GameHandler.check(this, update);\n            try {\n                execute(message); // Sending our message object to user\n            } catch (TelegramApiException e) {\n                e.printStackTrace();\n            }\n        }\n    }\n\n    private void log(String username, String chatId, String textReceived, String botResponse) {\n        System.out.println(\"----------------------------\\n\");\n        // print out in PM/AM time\n        DateFormat dateFormat = new SimpleDateFormat(\"yyyy/MM/dd h:mm a\");\n        Date date = new Date();\n        System.out.println(dateFormat.format(date));\n        System.out.println(\"Message from \" + username + \". (id = \" + chatId + \") \\n Text - \" + textReceived);\n        System.out.println(\"Bot answer: \\n Text - \" + botResponse);\n    }\n\n    @Override\n    public String getBotUsername() {\n        // Return bot username\n        // If bot username is @KodeCentralBot, it must return \'KodeCentralBot\'\n        return \"KodeCentralBot\";\n    }\n\n    @Override\n    public String getBotToken() {\n        // Return bot token from BotFather\n        return \"token\";\n    }\n}\n</code></pre><p><br></p><blockquote>GameHandler.java</blockquote><pre><code>import org.telegram.telegrambots.meta.api.objects.Update;\n\nimport java.util.HashMap;\n\npublic class GameHandler {\n\n    private static class Game {\n\n        // for upcoming tutorial\n        //private ImageGuess guessGame = null;\n    }\n\n    // to play separate games on separate groups\n    private static HashMap&lt;Long, Game&gt; games = new HashMap&lt;&gt;();\n\n    public static void check(KodeCentralBot kodeCentralBot, Update update) {\n        Game current = null;\n        long chat_id = update.getMessage().getChatId();\n        if (games.containsKey(chat_id))\n            current = games.get(chat_id);\n\n        // check what game, etc.. (future)\n    }\n}\n</code></pre><p>And that\'s it for the setup! We will use this code for all future games!</p>','2019-04-12 12:04:50',1,9,3,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(59,'Image Guess Game','image-guess-game','<p>Let\'s create our first game already! First of all, we need to respect Telegram\'s servers, so we will not send files. We will tell Telegram where the pictures are located (url) and the API will take care of sending them. This is lightweight on both the server and our storage. To send photos we create a sendPhoto instance and set the chat id and url. Then we call execute and pass the sendPhoto instance:</p><pre><code>public void sendPhoto(String chatId, String url) {\n    SendPhoto sendPhoto = new SendPhoto();\n    sendPhoto.setChatId(chatId);\n    sendPhoto.setPhoto(url);\n    try {\n        execute(sendPhoto);\n    } catch (TelegramApiException e) {\n        e.printStackTrace();\n    }\n}\n</code></pre><p>We also need a function to send text messages, which is very similar to the above sendPhoto function:</p><pre><code>public void sendMessage(String chatId, String message) {\n    SendMessage sendMessageRequest = new SendMessage();\n    sendMessageRequest.setChatId(chatId);\n    sendMessageRequest.setText(message);\n    try {\n        execute(sendMessageRequest);\n    } catch (TelegramApiException e) {\n        e.printStackTrace();\n    }\n}\n</code></pre><p>Now we are going to create <span style=\"background-color: rgb(255, 235, 204);\">ImageGuess.java</span> in our <span style=\"background-color: rgb(255, 235, 204);\">src</span> directory. ImageGuess will have a url and an answer variable. It will also contain a list of ImageGuess objects and a function to retrieve a random one:</p><blockquote>ImageGuess.java</blockquote><pre><code>import java.util.ArrayList;\nimport java.util.Random;\n\nclass ImageGuess {\n    private String url;\n    private String answer;\n\n    public ImageGuess(String url, String answer) {\n        this.url = url;\n        this.answer = answer;\n    }\n\n    public String getUrl() {\n        return url;\n    }\n\n    public String getAnswer() {\n        return answer;\n    }\n\n    private static ArrayList&lt;ImageGuess&gt; l = new ArrayList&lt;&gt;();\n\n    private static void initList() {\n\n        l.add(new ImageGuess(\"https://bit.ly/2R9FiRU\", \"zebra\"));\n        l.add(new ImageGuess(\"https://bit.ly/2RCc3Gu\", \"horse\"));\n        l.add(new ImageGuess(\"https://bit.ly/2RxAcOD\", \"shark\"));\n        // and so forth...\n    }\n\n    // get a random image\n    static ImageGuess random() {\n        if (l.isEmpty())\n            initList();\n        return l.get(new Random().nextInt(l.size()));\n    }\n}\n</code></pre><p>We then modify <span style=\"background-color: rgb(255, 235, 204);\">ImageGuess</span> check function to create a new ImageGuess instance if <span style=\"background-color: rgb(204, 224, 245);\">/guess</span> is sent. We also need to check if there is already a game in progress, and if an incoming message is the answer:</p><pre><code>public static void check(KodeCentralBot kodeCentralBot, Update update) {\n    // create a new game if this group doesn\'t have one already, otherwise grab from HashMap\n    Game game = new Game();\n    long chatId = update.getMessage().getChatId();\n    if (games.containsKey(chatId))\n        game = games.get(chatId);\n    else {\n        games.put(chatId, game);\n    }\n\n    // variables\n    Message message = update.getMessage();\n    String message_text = message.getText();\n    String message_text_lower = message_text.toLowerCase();\n    String username = message.getFrom().getUserName();\n\n    // check if starting a new guess game\n    if (message_text_lower.equals(\"/guess\") || message_text_lower.equals(\"???? guess\")) {\n        // only create a new guess game if there isn\'t one\n        if (game.guessGame == null) {\n            game.guessGame = ImageGuess.random();\n        }\n        kodeCentralBot.sendPhoto(Long.toString(chatId), game.guessGame.getUrl());\n    } \n    // check if guess game answered correctly\n    else if (game.guessGame != null &amp;&amp; message_text_lower.contains(game.guessGame.getAnswer())) {\n        // reset the guess game!\n        game.guessGame = null;\n        kodeCentralBot.sendMessage(Long.toString(chatId), username + \" has won!\");\n    }\n}\n</code></pre><p><br></p><h1>Files</h1><blockquote>KodeCentralBot.java</blockquote><pre><code>import org.telegram.telegrambots.bots.TelegramLongPollingBot;\nimport org.telegram.telegrambots.meta.api.methods.send.SendMessage;\nimport org.telegram.telegrambots.meta.api.methods.send.SendPhoto;\nimport org.telegram.telegrambots.meta.api.objects.Update;\nimport org.telegram.telegrambots.meta.exceptions.TelegramApiException;\n\nimport java.text.DateFormat;\nimport java.text.SimpleDateFormat;\nimport java.util.Date;\n\npublic class KodeCentralBot extends TelegramLongPollingBot {\n    @Override\n    public void onUpdateReceived(Update update) {\n\n        // We check if the update has a message and the message has text\n        if (update.hasMessage() &amp;&amp; update.getMessage().hasText()) {\n            // NEW:\n            GameHandler.check(this, update);\n        }\n    }\n\n    private void log(String username, String chatId, String textReceived, String botResponse) {\n        System.out.println(\"----------------------------\\n\");\n        // print out in PM/AM time\n        DateFormat dateFormat = new SimpleDateFormat(\"yyyy/MM/dd h:mm a\");\n        Date date = new Date();\n        System.out.println(dateFormat.format(date));\n        System.out.println(\"Message from \" + username + \". (id = \" + chatId + \") \\n Text - \" + textReceived);\n        System.out.println(\"Bot answer: \\n Text - \" + botResponse);\n    }\n\n    public void sendPhoto(String chatId, String url) {\n        SendPhoto sendPhoto = new SendPhoto();\n        sendPhoto.setChatId(chatId);\n        sendPhoto.setPhoto(url);\n\n        try {\n            execute(sendPhoto);\n        } catch (TelegramApiException e) {\n            e.printStackTrace();\n        }\n    }\n\n    public void sendMessage(String chatId, String message) {\n        SendMessage sendMessageRequest = new SendMessage();\n        sendMessageRequest.setChatId(chatId);\n        sendMessageRequest.setText(message);\n        try {\n            execute(sendMessageRequest);\n        } catch (TelegramApiException e) {\n            e.printStackTrace();\n        }\n    }\n\n    @Override\n    public String getBotUsername() {\n        // Return bot username\n        // If bot username is @KodeCentralBot, it must return \'KodeCentralBot\'\n        return \"KodeCentralBot\";\n    }\n\n    @Override\n    public String getBotToken() {\n        // Return bot token from BotFather\n        return \"token\";\n    }\n}\n</code></pre><p><br></p><blockquote>GameHandler.java</blockquote><pre><code>import org.telegram.telegrambots.meta.api.objects.Message;\nimport org.telegram.telegrambots.meta.api.objects.Update;\n\nimport java.util.HashMap;\n\npublic class GameHandler {\n\n    private static class Game {\n\n        // for upcoming tutorial\n        private ImageGuess guessGame = null;\n    }\n\n    // to play separate games on separate groups\n    private static HashMap&lt;Long, Game&gt; games = new HashMap&lt;&gt;();\n\n    public static void check(KodeCentralBot kodeCentralBot, Update update) {\n        // create a new game if this group doesn\'t have one already, otherwise grab from HashMap\n        Game game = new Game();\n        long chatId = update.getMessage().getChatId();\n        if (games.containsKey(chatId))\n            game = games.get(chatId);\n        else {\n            games.put(chatId, game);\n        }\n\n        // variables\n        Message message = update.getMessage();\n        String message_text = message.getText();\n        String message_text_lower = message_text.toLowerCase();\n        String username = message.getFrom().getUserName();\n\n        // check if starting a new guess game\n        if (message_text_lower.equals(\"/guess\") || message_text_lower.equals(\"???? guess\")) {\n            // only create a new guess game if there isn\'t one\n            if (game.guessGame == null) {\n                game.guessGame = ImageGuess.random();\n            }\n            kodeCentralBot.sendPhoto(Long.toString(chatId), game.guessGame.getUrl());\n        }\n        // check if guess game answered correctly\n        else if (game.guessGame != null &amp;&amp; message_text_lower.contains(game.guessGame.getAnswer())) {\n\n            // reset the guess game!\n            game.guessGame = null;\n            kodeCentralBot.sendMessage(username + \" has won!\", chatId);\n        }\n    }\n}\n</code></pre><p><br></p><blockquote>ImageGuess.java</blockquote><pre><code>import java.util.ArrayList;\nimport java.util.Random;\n\nclass ImageGuess {\n    private String url;\n    private String answer;\n\n    public ImageGuess(String url, String answer) {\n        this.url = url;\n        this.answer = answer;\n    }\n\n    public String getUrl() {\n        return url;\n    }\n\n    public String getAnswer() {\n        return answer;\n    }\n\n    private static ArrayList&lt;ImageGuess&gt; l = new ArrayList&lt;&gt;();\n\n    private static void initList() {\n\n        l.add(new ImageGuess(\"https://bit.ly/2R9FiRU\", \"zebra\"));\n        l.add(new ImageGuess(\"https://bit.ly/2RCc3Gu\", \"horse\"));\n        l.add(new ImageGuess(\"https://bit.ly/2RxAcOD\", \"shark\"));\n        // and so forth...\n    }\n\n    // get a random image\n    static ImageGuess random() {\n        if (l.isEmpty())\n            initList();\n        return l.get(new Random().nextInt(l.size()));\n    }\n}\n</code></pre><p><br></p><h1>Example output</h1><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/java%20telegram%20bot/5_guess%20game.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/java%20telegram%20bot/5_guess%20game.png\" width=\"367\" style=\"display: block; margin: auto;\"></a></p><p>And there you have it! Next we will learn how to save player scores to a local database!</p>','2019-04-12 12:05:37',1,9,4,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(60,'Saving Game Data','saving-game-data','<p>We are going to use SQLite JDBC because it\'s simple to set up. <a href=\"https://bitbucket.org/xerial/sqlite-jdbc/downloads/\" target=\"_blank\">Download the latest .jar file</a> and import it. We have one game so far, so we need to create a game table that holds usernames and scores.</p><p><br></p><h1>SQL</h1><p>Create game table:</p><pre><code>String sql = \"CREATE TABLE IF NOT EXISTS games (\"\n        + \" username text NOT NULL UNIQUE,\\n\"\n        + \" guess_score INTEGER NOT NULL);\";\n</code></pre><p>Insert new player into game table (0 score for all games):</p><pre><code>String sql = \"INSERT INTO \" + TABLE_GAME +\n        \"(username,guess_score) VALUES(?,0)\";\n</code></pre><p>Increment score for player by 1:</p><pre><code>String sql = \"UPDATE \" + TABLE_GAME +\n        \" SET \" + game_name + \" = \" + game_name + \" + 1 \"+\n        \" WHERE username = ?\";\n</code></pre><p>Get scores for player:</p><pre><code>String sql = \"SELECT \" + game_name + \" \"\n        + \"FROM \" + TABLE_GAME + \" WHERE username = ?\";\n</code></pre><p><br></p><h1>Code</h1><p>Let\'s put all the SQL code together and get a working database! The basic functions we need are:</p><ol><li>Connection</li><li>Creating table</li><li>Inserting players</li><li>Updating player scores</li><li>Getting scores</li></ol><p>These functions will use the SQL mentioned above.</p><p><br></p><p>The final Database class will look like this:</p><blockquote>Database.java</blockquote><pre><code>import java.sql.*;\n\npublic class Database {\n\n    private static Database db = null;\n\n    public static Database getInstance() {\n        if (db == null) {\n            db = new Database();\n        }\n        return db;\n    }\n\n    private final String DB_NAME = \"jdbc:sqlite:database.db\";\n    private final String TABLE_GAME = \"game\";\n\n    public Database() {\n        createDatabase();\n        createGameTable();\n    }\n\n    private void createDatabase() {\n\n        try {\n            DriverManager.getConnection(DB_NAME);\n        } catch (Exception e) {\n            System.out.println(e.getMessage());\n        }\n    }\n\n    private void createGameTable() {\n        // SQL statement for creating a new table\n        String sql = \"CREATE TABLE IF NOT EXISTS \" + TABLE_GAME + \"(\"\n                + \"    username text NOT NULL UNIQUE,\\n\"\n                + \" guess_score INTEGER NOT NULL);\";\n\n        try (Connection conn = DriverManager.getConnection(DB_NAME);\n             Statement stmt = conn.createStatement()) {\n            // create a new table\n            stmt.execute(sql);\n        } catch (Exception e) {\n            System.out.println(e.getMessage());\n        }\n    }\n\n    private Connection connect() {\n        // SQLite connection string\n        Connection conn = null;\n        try {\n            Class.forName(\"org.sqlite.JDBC\");\n            conn = DriverManager.getConnection(DB_NAME);\n        } catch (Exception e) {\n            System.out.println(e.getMessage());\n        }\n        return conn;\n    }\n\n    // com.bit.telebot.game methods\n    private void createGameEntry(String username) {\n        String sql = \"INSERT INTO \" + TABLE_GAME +\n                \"(username,guess_score) VALUES(?,0)\";\n\n        try (Connection conn = this.connect();\n             PreparedStatement pstmt = conn.prepareStatement(sql)) {\n            pstmt.setString(1, username);\n            pstmt.executeUpdate();\n        } catch (Exception e) {\n            //System.out.println(e.getMessage());\n        }\n    }\n\n    private void incrementScore(String username, String game_name, int val) {\n        // try to update the type score for the username, if not successful it means that\n        // that user is not in db, so add em with a 1 score for type\n        createGameEntry(username);\n        String sql = \"UPDATE \" + TABLE_GAME +\n                \" SET \" + game_name + \" = \" + game_name + \" + \" + val + \" \" +\n                \" WHERE username = ?\";\n\n        try (Connection conn = this.connect();\n             PreparedStatement pstmt = conn.prepareStatement(sql)) {\n            pstmt.setString(1, username);\n            pstmt.executeUpdate();\n        } catch (Exception e) {\n            System.out.println(e.getMessage());\n        }\n    }\n\n    public void incrementGuessScore(String username) {\n        incrementScore(username, \"guess_score\", 1);\n    }\n\n    private long getScore(String username, String game_name) {\n        createGameEntry(username);\n        String sql = \"SELECT \" + game_name + \" \"\n                + \"FROM \" + TABLE_GAME + \" WHERE username = ?\";\n\n        try (Connection conn = this.connect();\n             PreparedStatement pstmt = conn.prepareStatement(sql)) {\n\n            // set the value\n            pstmt.setString(1, username);\n\n            ResultSet rs = pstmt.executeQuery();\n\n            // loop through the result set\n            if (rs.next()) {\n                return rs.getInt(game_name);\n            }\n            return -1;\n        } catch (SQLException e) {\n            System.out.println(e.getMessage());\n            return -2;\n        }\n    }\n\n    public long getGuessScore(String username) {\n        return getScore(username, \"guess_score\");\n    }\n\n}\n</code></pre><p>I would go through how everything works, but we want to get to the juicy section of the steak! The Database code is mostly self explanatory. If you struggle to understand how it works <a href=\"http://www.sqlitetutorial.net/sqlite-java\" target=\"_blank\">read this</a>. Ok, so let\'s get to saving information! In the <span style=\"background-color: rgb(255, 235, 204);\">GameHandler</span> class will call</p><pre><code>Database.getInstance().incrementGuessScore(username);\n</code></pre><p>whenever the user was correct in their guess:</p><blockquote>GameHandler check function</blockquote><pre><code>// check if guess game answered correctly\nelse if (game.guessGame != null &amp;&amp; message_text_lower.contains(game.guessGame.getAnswer())) {\n    Database.getInstance().incrementGuessScore(username);\n    // reset the guess game!\n    game.guessGame = null;\n    kodeCentralBot.sendMessage(Long.toString(chatId), username + \" has won!\");\n}\n</code></pre><p>Ok, so now the database will keep track of scores, but how do we see them? Let\'s add another command <span style=\"background-color: rgb(204, 224, 245);\">/scores</span> which will retrieve the guess scores for that user and return a message:</p><blockquote>GameHanlder check function</blockquote><pre><code>else if (message_text_lower.equals(\"/scores\")) {\n    Database d = Database.getInstance();\n    kodeCentralBot.sendMessage(Long.toString(chatId), \"Guess: \" + d.getGuessScore(username));\n}\n</code></pre><h1><br></h1><h1>Files</h1><blockquote>Main.java</blockquote><pre><code>import org.telegram.telegrambots.ApiContextInitializer;\nimport org.telegram.telegrambots.meta.TelegramBotsApi;\nimport org.telegram.telegrambots.meta.exceptions.TelegramApiException;\n\npublic class Main {\n    public static void main(String[] args) {\n        // Initialize Api Context\n        ApiContextInitializer.init();\n\n        // Instantiate Telegram Bots API\n        TelegramBotsApi botsApi = new TelegramBotsApi();\n\n        // Register our bot\n        try {\n            botsApi.registerBot(new KodeCentralBot());\n        } catch (TelegramApiException e) {\n            e.printStackTrace();\n        }\n    }\n}\n</code></pre><p><br></p><blockquote>KodeCentralBot.java</blockquote><pre><code>import org.telegram.telegrambots.bots.TelegramLongPollingBot;\nimport org.telegram.telegrambots.meta.api.methods.send.SendMessage;\nimport org.telegram.telegrambots.meta.api.methods.send.SendPhoto;\nimport org.telegram.telegrambots.meta.api.objects.Update;\nimport org.telegram.telegrambots.meta.exceptions.TelegramApiException;\n\nimport java.text.DateFormat;\nimport java.text.SimpleDateFormat;\nimport java.util.Date;\n\npublic class KodeCentralBot extends TelegramLongPollingBot {\n    public void onUpdateReceived(Update update) {\n        // We check if the update has a message and the message has text\n        if (update.hasMessage() &amp;&amp; update.getMessage().hasText()) {\n            // NEW:\n            GameHandler.check(this, update);\n        }\n    }\n\n    private void log(String username, String chatId, String textReceived, String botResponse) {\n        System.out.println(\"----------------------------\\n\");\n        // print out in PM/AM time\n        DateFormat dateFormat = new SimpleDateFormat(\"yyyy/MM/dd h:mm a\");\n        Date date = new Date();\n        System.out.println(dateFormat.format(date));\n        System.out.println(\"Message from \" + username + \". (id = \" + chatId + \") \\n Text - \" + textReceived);\n        System.out.println(\"Bot answer: \\n Text - \" + botResponse);\n    }\n\n    public void sendPhoto(String chatId, String url) {\n        SendPhoto sendPhoto = new SendPhoto();\n        sendPhoto.setChatId(chatId);\n        sendPhoto.setPhoto(url);\n\n        try {\n            execute(sendPhoto);\n        } catch (TelegramApiException e) {\n            e.printStackTrace();\n        }\n    }\n\n    public void sendMessage(String chatId, String message) {\n        SendMessage sendMessageRequest = new SendMessage();\n        sendMessageRequest.setChatId(chatId);\n        sendMessageRequest.setText(message);\n        try {\n            execute(sendMessageRequest);\n        } catch (TelegramApiException e) {\n            e.printStackTrace();\n        }\n    }\n\n    public String getBotUsername() {\n        // Return bot username\n        // If bot username is @KodeCentralBot, it must return \'KodeCentralBot\'\n        return \"KodeCentralBot\";\n    }\n\n    @Override\n    public String getBotToken() {\n        // Return bot token from BotFather\n        return \"token\";\n    }\n}\n</code></pre><p><br></p><blockquote>GameHandler.java</blockquote><pre><code>import org.telegram.telegrambots.meta.api.objects.Message;\nimport org.telegram.telegrambots.meta.api.objects.Update;\n\nimport java.util.HashMap;\n\npublic class GameHandler {\n\n    private static class Game {\n\n        // for upcoming tutorial\n        private ImageGuess guessGame = null;\n    }\n\n    // to play separate games on separate groups\n    private static HashMap&lt;Long, Game&gt; games = new HashMap&lt;Long, Game&gt;();\n\n    public static void check(KodeCentralBot kodeCentralBot, Update update) {\n        // create a new game if this group doesn\'t have one already, otherwise grab from HashMap\n        Game game = new Game();\n        long chatId = update.getMessage().getChatId();\n        if (games.containsKey(chatId))\n            game = games.get(chatId);\n        else {\n            games.put(chatId, game);\n        }\n\n        // variables\n        Message message = update.getMessage();\n        String message_text = message.getText();\n        String message_text_lower = message_text.toLowerCase();\n        String username = message.getFrom().getUserName();\n\n        // check if starting a new guess game\n        if (message_text_lower.equals(\"/guess\") || message_text_lower.equals(\"???? guess\")) {\n            // only create a new guess game if there isn\'t one\n            if (game.guessGame == null) {\n                game.guessGame = ImageGuess.random();\n            }\n            kodeCentralBot.sendPhoto(Long.toString(chatId), game.guessGame.getUrl());\n        }\n        // check if guess game answered correctly\n        else if (game.guessGame != null &amp;&amp; message_text_lower.contains(game.guessGame.getAnswer())) {\n            Database.getInstance().incrementGuessScore(username);\n            // reset the guess game!\n            game.guessGame = null;\n            kodeCentralBot.sendMessage(Long.toString(chatId), username + \" has won!\");\n        } else if (message_text_lower.equals(\"/scores\")) {\n            Database d = Database.getInstance();\n            kodeCentralBot.sendMessage(Long.toString(chatId), \"Guess: \" + d.getGuessScore(username));\n        }\n    }\n}\n</code></pre><p><br></p><blockquote>Database.java</blockquote><pre><code>import java.sql.*;\n\npublic class Database {\n\n    private static Database db = null;\n\n    public static Database getInstance() {\n        if (db == null) {\n            db = new Database();\n        }\n        return db;\n    }\n\n    private final String DB_NAME = \"jdbc:sqlite:database.db\";\n    private final String TABLE_GAME = \"game\";\n\n    public Database() {\n        createDatabase();\n        createGameTable();\n    }\n\n    private void createDatabase() {\n\n        try {\n            DriverManager.getConnection(DB_NAME);\n        } catch (Exception e) {\n            System.out.println(e.getMessage());\n        }\n    }\n\n    private void createGameTable() {\n        // SQL statement for creating a new table\n        String sql = \"CREATE TABLE IF NOT EXISTS \" + TABLE_GAME + \"(\"\n                + \"    username text NOT NULL UNIQUE,\\n\"\n                + \" guess_score INTEGER NOT NULL);\";\n\n        try (Connection conn = DriverManager.getConnection(DB_NAME);\n             Statement stmt = conn.createStatement()) {\n            // create a new table\n            stmt.execute(sql);\n        } catch (Exception e) {\n            System.out.println(e.getMessage());\n        }\n    }\n\n    private Connection connect() {\n        // SQLite connection string\n        Connection conn = null;\n        try {\n            Class.forName(\"org.sqlite.JDBC\");\n            conn = DriverManager.getConnection(DB_NAME);\n        } catch (Exception e) {\n            System.out.println(e.getMessage());\n        }\n        return conn;\n    }\n\n    // com.bit.telebot.game methods\n    private void createGameEntry(String username) {\n        String sql = \"INSERT INTO \" + TABLE_GAME +\n                \"(username,guess_score) VALUES(?,0)\";\n\n        try (Connection conn = this.connect();\n             PreparedStatement pstmt = conn.prepareStatement(sql)) {\n            pstmt.setString(1, username);\n            pstmt.executeUpdate();\n        } catch (Exception e) {\n            //System.out.println(e.getMessage());\n        }\n    }\n\n    private void incrementScore(String username, String game_name, int val) {\n        // try to update the type score for the username, if not successful it means that\n        // that user is not in db, so add em with a 1 score for type\n        createGameEntry(username);\n        String sql = \"UPDATE \" + TABLE_GAME +\n                \" SET \" + game_name + \" = \" + game_name + \" + \" + val + \" \" +\n                \" WHERE username = ?\";\n\n        try (Connection conn = this.connect();\n             PreparedStatement pstmt = conn.prepareStatement(sql)) {\n            pstmt.setString(1, username);\n            pstmt.executeUpdate();\n        } catch (Exception e) {\n            System.out.println(e.getMessage());\n        }\n    }\n\n    public void incrementGuessScore(String username) {\n        incrementScore(username, \"guess_score\", 1);\n    }\n\n    private long getScore(String username, String game_name) {\n        createGameEntry(username);\n        String sql = \"SELECT \" + game_name + \" \"\n                + \"FROM \" + TABLE_GAME + \" WHERE username = ?\";\n\n        try (Connection conn = this.connect();\n             PreparedStatement pstmt = conn.prepareStatement(sql)) {\n\n            // set the value\n            pstmt.setString(1, username);\n\n            ResultSet rs = pstmt.executeQuery();\n\n            // loop through the result set\n            if (rs.next()) {\n                return rs.getInt(game_name);\n            }\n            return -1;\n        } catch (SQLException e) {\n            System.out.println(e.getMessage());\n            return -2;\n        }\n    }\n\n    public long getGuessScore(String username) {\n        return getScore(username, \"guess_score\");\n    }\n\n}\n</code></pre><p><br></p><blockquote>ImageGuess.java</blockquote><pre><code>import java.util.ArrayList;\nimport java.util.Random;\n\nclass ImageGuess {\n    private String url;\n    private String answer;\n\n    public ImageGuess(String url, String answer) {\n        this.url = url;\n        this.answer = answer;\n    }\n\n    public String getUrl() {\n        return url;\n    }\n\n    public String getAnswer() {\n        return answer;\n    }\n\n    private static ArrayList&lt;ImageGuess&gt; l = new ArrayList&lt;ImageGuess&gt;();\n\n    private static void initList() {\n\n        l.add(new ImageGuess(\"https://bit.ly/2R9FiRU\", \"zebra\"));\n        l.add(new ImageGuess(\"https://bit.ly/2RCc3Gu\", \"horse\"));\n        l.add(new ImageGuess(\"https://bit.ly/2RxAcOD\", \"shark\"));\n        // and so forth...\n    }\n\n    // get a random image\n    static ImageGuess random() {\n        if (l.isEmpty())\n            initList();\n        return l.get(new Random().nextInt(l.size()));\n    }\n}\n</code></pre><p><strong>I included all files in case yours got messed up along the way.</strong></p><p><br></p><p>And there you have it! Your own bot that can now keep track of games and scores! See you soon!</p><p><br></p><h1>Output</h1><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/java%20telegram%20bot/6_saving%20java%20telegram%20bot%20game%20scores.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/java%20telegram%20bot/6_saving%20java%20telegram%20bot%20game%20scores.png\" style=\"display: block; margin: auto;\" width=\"257\"></a></p>','2019-04-12 12:06:32',1,9,5,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(61,'Most Recurrent Number in List using HashMap','most-recurrent-number-in-list-using-hashmap','<p><strong><u>Problem:</u></strong></p><p>Find the most recurrent number in the list, then print the value and times it was repeated.</p><p><br></p><p><strong><u>Examples:</u></strong></p><p>input: {1, 3, 3}</p><p>output: KEY = 3, REPEATED = 2</p><p><br></p><p>input: {1, 2, 3, 1, 4, 5, 6, 4, 3, 4, 4, 4, 4, 9, 8, 6, 8, 7}</p><p>output: KEY = 4, REPEATED = 6</p><p><br></p><p><strong><u>Solution (in java):</u></strong></p><pre><code>import java.util.HashMap;\n\npublic class MostRecurrent {\n\n    private static void solve(int[] arr) {\n        if (arr.length == 0) {\n            System.out.println(\"Empty list\");\n            // return; gets out of (finalizes) the method\n            return;\n        }\n\n        HashMap&lt;Integer, Integer&gt; map = new HashMap&lt;&gt;();\n\n        // loop through arr and add to map\n        for (int a : arr) {\n            if (map.containsKey(a)) {\n                // seen before, increment by 1\n                map.put(a, map.get(a) + 1);\n            } else {\n                // first time seeing, put 1\n                map.put(a, 1);\n            }\n        }\n\n        // now loop through the list again, but comparing recurrences\n        int key = 0;\n        int repeat = -1;\n        for (int a : arr) {\n            int value = map.get(a);\n            if (value &gt; repeat) {\n                key = a;\n                repeat = value;\n            }\n        }\n\n        System.out.println(\"KEY = \" + key + \", REPEATED = \" + repeat);\n    }\n\n    public static void main(String[] args) {\n        int[] arr = {1, 2, 3, 1, 4, 5, 6, 4, 3, 4, 4, 4, 4, 9, 8, 6, 8, 7};\n        solve(arr);\n    }\n}\n</code></pre><p>output:</p><pre><code>KEY = 4, REPEATED = 6\n</code></pre><p><br></p><p>The big O runtime of the algorithm is O(n):</p><ol><li>First loop iterates through the input and inserts into the HashMap</li><li>Second loop iterates through the input and accesses HashMap data</li></ol><ul><li>HashMap insertions and lookup runtimes are constant O(1)</li><li>O(n * 1)+(n * 1) = O(2n) = O(n)</li></ul><p><br></p><p>Comment below if you have any questions!</p>','2019-01-07 11:13:44',1,5,1,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(62,'Binary Search','binary-search','<p>Binary Search is used to <strong>search through sorted lists</strong> very rapidly.</p><p>Algorithm:</p><ol><li>Grab the middle element (let it be mid)</li><li>if mid = element you are looking for -&gt; done</li><li>if mid &lt; key -&gt; check the right side</li><li>if mid &gt; key -&gt; check the left side</li><li>repeat steps 2 to 4 until start and end index cross</li></ol><p>For better visualization you can play with <a href=\"http://www.cs.armstrong.edu/liang/animation/web/BinarySearch.html\" target=\"_blank\">this tool</a>.</p><p><br></p><p><strong><u>Solution (in java):</u></strong></p><p><strong>Non-recursive approach:</strong></p><pre><code>private static void binarySearch(int[] array, int key) {\n    int first = 0;\n    int last = array.length - 1;\n\n    int mid;\n    while (first &lt;= last) {\n        // get middle element\n        mid = (first + last) / 2;\n        if (array[mid] &lt; key) {\n            // check the right side\n            first = mid + 1;\n        } else if (array[mid] == key) {\n            // found element\n            System.out.println(key + \" at index \" + mid);\n            break;\n        } else {\n            // check left side\n            last = mid - 1;\n        }\n    }\n    if (first &gt; last) {\n        System.out.println(\"Element is not found!\");\n    }\n}\n</code></pre><p>Invoking the function:</p><pre><code>public static void main(String[] args) {\n    int[] num = {1, 2, 4, 9, 40, 54, 58, 67, 77, 78, 80, 101, 120, 139};\n    binarySearch(num, 40);\n}\n</code></pre><p><br></p><p><strong>Recursive approach:</strong></p><pre><code>private static void recursiveBinarySearch(int[] array, int key, int first, int last) {\n    if (first &gt; last) {\n        // base case\n        System.out.println(key + \" no found!\");\n    }\n    int mid = (first + last) / 2;\n    if (array[mid] &lt; key) {\n        // check right side\n        recursiveBinarySearch(array, key, mid + 1, last);\n    } else if (array[mid] == key) {\n        // found it\n        System.out.println(key + \" at index \" + mid);\n    } else {\n        // check left side\n        recursiveBinarySearch(array, key, first, mid - 1);\n    }\n}\n</code></pre><p>Invoking the function:</p><pre><code>public static void main(String[] args) {\n    int[] num = {1, 2, 4, 9, 40, 54, 58, 67, 77, 78, 80, 101, 120, 139};\n    recursiveBinarySearch(num, 40, 0, num.length - 1);\n}\n</code></pre><p><br></p><p>output:</p><pre><code>40 at index 4\n</code></pre><p><br></p><p>Binary search splits the input into half at every step making binary search run better than linear search (linear search must look at every index). Since binary search \"splits\" the data in half at every step the total look up time for binary search is O(log(n)) while linear search is O(n) (both at worst case). Binary search only works for sorted lists, which is a downside if you are dealing with random data, but will be efficient if your data is always sorted!</p>','2019-01-07 12:14:29',1,10,0,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(63,'Setting up your Java Development Environment','setting-up-your-java-development-environment','<p>The JDK includes tools for compiling and running java code. An IDE contains useful features, such as code compilation and debugging, organization of project files, and nice visual interfaces.</p><p><br></p><h1>Install the JDK</h1><p>Follow these steps to download and install the JDK:</p><ul><li>Go to <a href=\"https://www.oracle.com/technetwork/java/javase/downloads/index.html\" target=\"_blank\">Java SE Downloads</a> and click JDK</li></ul><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/java%20tutorial/1_jdk.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/java%20tutorial/1_jdk.png\" width=\"269\" style=\"display: block; margin: auto;\"></a></p><ul><li>Agree to the license terms</li><li>Choose the download that matches your operating system</li></ul><p><strong><u>Windows</u></strong></p><ul><li>Save the file</li><li>When the download is complete, run the install program. Install the JDK to your hard drive in a location such as C:\\home\\Java\\jdk1.8.0_92. </li></ul><p><strong><u>OS X</u></strong></p><ul><li>When the download is complete, double-click it to mount it.</li><li>Run the install program. You do not get to choose where the JDK is installed. You can run <em>/usr/libexec/java_home</em> to see the location of JDK on your Mac. The path that\'s displayed is similar to /Library/Java/JavaVirtualMachines/jdk1.8.0_92.jdk/Contents/Home</li></ul><p><br></p><p>Now that you have JDK on your machine let\'s install Intellij IDE.</p><h1><br></h1><h1>Install Intellij</h1><p>Follow these steps to download and install Intellij IDE:</p><ul><li>Go to <a href=\"https://www.jetbrains.com/idea/download/\" target=\"_blank\">Inllelij IDE downloads</a> and download the community edition</li></ul><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/java%20tutorial/2_intellij%20download.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/java%20tutorial/2_intellij%20download.png\" style=\"display: block; margin: auto;\" width=\"356\"></a></p><p>If Intellij prompts you to set up project SDK</p><p><strong><u>Windows</u></strong></p><ul><li>Navigate to where you saved the JDK on your drive (such as C:\\home\\Java\\jdk1.8.0_92)</li></ul><p><strong><u>OS X</u></strong></p><ul><li>Run <em>/usr/libexec/java_home</em> to see the location of JDK on your Mac</li></ul><p><br></p><h1>Creating your First Project</h1><p>Follow these steps to create your first project in Intellij IDE:</p><ul><li>Open intellij and press \"Create New Project\"</li></ul><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/java%20tutorial/3_intellij%20new%20project.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/java%20tutorial/3_intellij%20new%20project.png\" style=\"display: block; margin: auto;\" width=\"227\"></a></p><ul><li>Choose \"Java\" from the list of press \"Next\" on the bottom right corner</li><li>Press next again (no template if prompted)</li><li>Fill out the project name</li></ul><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/java%20tutorial/4_intellij%20new%20project%20name.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/java%20tutorial/4_intellij%20new%20project%20name.png\" style=\"display: block; margin: auto;\" width=\"494\"></a></p><ul><li>Press \"Finish\"</li></ul><p>Your project structure should look like this:</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/java%20tutorial/5_project%20structure.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/java%20tutorial/5_project%20structure.png\" style=\"display: block; margin: auto;\" width=\"200\"></a></p><p><strong><u>Creating a new source file</u></strong></p><ul><li>Right click on your \"src\" file (shown above) and select new -&gt; Java Class</li><li>Select a class name</li></ul><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/java%20tutorial/6_new%20class.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/java%20tutorial/6_new%20class.png\" style=\"display: block; margin: auto;\" width=\"393\"></a></p><ul><li>Press \"OK\"</li></ul><p>Intellij will create a new class inside that source file:</p><pre><code>public class Dog {\n}\n</code></pre><p><br></p><p>And there you go! We can start learning java now!</p>','2019-01-09 16:24:09',1,3,1,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(64,'Code Structure','code-structure','<h1>The main components</h1><p>Java has 3 main components: source files, components, and methods!</p><p><br></p><p><strong><u>What goes in a Source File?</u></strong></p><p>A source code file has the .java extension and holds one <strong><em>class </em></strong>definition.</p><p><br></p><p><strong><u>What Goes in a Class?</u></strong></p><p>A class can have one or several methods.</p><p><br></p><p><strong><u>What Goes in a Method?</u></strong></p><p>You write instructions within methods. Method statements are procedures or sets of statements.</p><p><br></p><h1>Main Method</h1><p>In java, everything goes in a class. When you run the Dog class (shown below) you are telling the Java Virtual Machine to load the class and start executing its <span style=\"background-color: rgb(255, 235, 204);\">main</span> method. We will go into more detail in the next section, but for now, all you need to know is that it all begins in <span style=\"background-color: rgb(255, 235, 204);\">main</span>. No matter how many lines of code, you must have a <span style=\"background-color: rgb(255, 235, 204);\">main</span> method.</p><p><br></p><h1>Example Class</h1><pre><code>public class Dog {\n    public void bark(int times) {\n        // for loop. Loop from 0 to times-1\n        for (int x = 0; x &lt; times; x++) {\n            System.out.println(\"bark!\");\n        }\n    }\n\n    // main method! Everything starts here\n    public static void main(String[] args) {\n        Dog choco = new Dog();\n        choco.bark(3);\n    }\n}\n</code></pre><p><br></p><p>output:</p><pre><code>bark!\nbark!\nbark!\n</code></pre>','2019-01-11 21:41:24',1,3,2,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(65,'HashMap vs HashSet vs HashTable in java','hashmap-vs-hashset-vs-hashtable-in-java','<h1>HashMap</h1><ul><li>Implements Map interface</li><li>uses <span style=\"background-color: rgb(255, 235, 204);\">put</span> method to store key-value pairs</li><li>Doesn\'t allow duplicate keys but values can be duplicated</li><li>Maximum of one NULL key but any number of NULL values</li><li>Internally uses an array</li></ul><h1>HashSet</h1><ul><li>Implements Set interface</li><li>uses <span style=\"background-color: rgb(255, 235, 204);\">add</span> method to store only unique objects</li><li>Doesn\'t allow duplicate objects</li><li>Allows maximum of one NULL object</li><li>Internally uses HashMap to store unique objects</li></ul><h1>HashTable</h1><ul><li>Synchronized</li><li>Considered legacy code</li><li>Doesn\'t allow NULL keys or values</li></ul><p><br></p><p><strong>Whatever can be done in HashTable can be done with a HashMap, so stick to HashMaps.</strong></p><p><br></p><h2>When to use HashMap?</h2><ul><li>Synchronization is not needed</li><li>Key value pairs are wanted</li><li>Search operation on multiple threads<span class=\"ql-cursor\">﻿﻿</span></li></ul><p><br></p><h2>When to use HashSet?</h2><ul><li>Order is not required</li><li>Mathematical sets (ex: {1, 2, 3, 4})</li><li>Don\'t want duplicate keys</li></ul>','2019-01-11 21:15:36',1,6,12,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(66,'Java Basics','java-basics','<h1>Comparison operators</h1><p>The main comparison operators include </p><ul><li>&lt; (less than)</li><li>&gt; (Greater than)</li><li>== (equal to)</li></ul><p><br></p><h1>Pre and Post Increment/Decrement Operator</h1><p>the shortcut for adding or subtracting 1 from a variable:</p><ul><li>x<span style=\"color: rgb(230, 0, 0);\">++</span>; // same as x = x + 1;</li><li>x<span style=\"color: rgb(230, 0, 0);\">--</span>; // same as x = x - 1;</li></ul><p>The place of the operator (either before of after the variable) can affect the result. Putting the operator before the variable means \"first increment and then use the new value\" (++x).</p><p>For example:</p><pre><code>int x = 0;\nint z = ++x;\n\nSystem.out.println(\"x = \"+x + \", z = \" + z);\n</code></pre><p>will output x = 1, z = 1, but</p><pre><code>int x = 0;\nint z = x++;\n\nSystem.out.println(\"x = \"+x + \", z = \" + z);\n</code></pre><p>will output</p><p>x = 1, <strong>z = 0</strong>! z gets the value of x and <em>then</em> x is changed.</p><p><br></p><h1>Conditional Branching</h1><p>Conditional branching uses comparison operators to compare values. Saying \"If there is a dog, run away\" would be conditional branching since you will only run away if a dog is present. Conditional branching includes if statements and loops:</p><pre><code>int age = 16;\nif(age &lt; 21){\n    System.out.println(\"You are too young to own a dog!\");\n} else{\n    System.out.println(\"Wow you sure are old!\");\n}\n</code></pre><p>output:</p><p>You are too young to own a dog!</p><p>If we increase the age to 22 then we get the output \"<em>Wow you sure are old!\"</em></p><p><br></p><h1>Loops</h1><p>There are three main loop constructs: <em>while</em>, <em>do-while</em>, and <em>for</em>. They are helpful when repeating statements!</p><h2>While loop</h2><p>As long as the condition is true execute the statements inside the block (blocks are encapsulated by curly braces).</p><pre><code>int x = 0; // assign 0 to x\nwhile (x &lt; 3) {\n    // loop will run since 0 &lt; 3\n    System.out.println(x); // print current value of x\n    x = x + 1; // add 1 to x to avoid being here infinitely\n}\n</code></pre><p>output:</p><pre><code>0\n1\n2\n</code></pre><h2>Do-While loop</h2><p>Do-while loops are similar to while loops but evaluate the expression <strong>after</strong> executing the block at least once. The block inside the do{} block will <strong>always</strong> execute at least once:</p><pre><code>int x = 1;\ndo {\n    System.out.println(x);\n    x++;\n} while (x &lt; 1);\n</code></pre><h2>Non-enhanced For Loop</h2><p>A for loop is used when you want to loop a certain number of times:</p><pre><code>for (int x = 0; x &lt; 4; x++) {\n    System.out.println(x);\n}\n</code></pre><p>output:</p><pre><code>0\n1\n2\n3\n</code></pre><p>Steps:</p><ol><li>Create a variable x and set it to 0</li><li>Repeat while i is less than 4</li><li>At the end of each loop iteration, add 1 to x</li></ol><h2>Enhanced For Loop</h2><p>Enhanced for loops are used to easily iterate through elements in a collection (such as arrays).</p><pre><code>int[] arr = {0, 6, 3, 2, 1};\nfor (int a : arr) {\n    System.out.println(a);\n}\n</code></pre><p>output:</p><pre><code>0\n6\n3\n2\n1\n</code></pre><p>You will learn about arrays when we look into <a href=\"https://kodecentral.com/post/java-variables\" target=\"_blank\">variables</a>.</p>','2019-01-12 11:03:45',1,3,3,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(67,'Java Variables','java-variables','<h1>What are Variables?</h1><p>Variables can be either primitive or reference. We can use variables as instance variables (object state), local variables (variables declared in methods), arguments (values sent to a method when calling it), and as return types (values sent back to the caller of the method).</p><h1>Primitive vs Object Reference</h1><p>Primitives hold the fundamental values (the simplest pieces of information, such as numbers and characters) while Object references hold references to objects (objects hold states and behaviors like stated previously, and also contain primitives within).</p><h1>Declaring a variable</h1><p>In java, you must be careful with type. You can\'t declare an integer variable (whole number) and assign it a double (decimal). While writing code in java the compiler can detect most variable type problems such as referencing a Dog into a Cat variable. Variables <strong>must</strong> have a type and name. Primitives can hold different values and are used each for different purposes. For example, when talking about weight you need decimals to be precise, so you can use a double or a float, but when talking about age and only care about the years we can use an integer as your type.</p><p><strong><u>Primitive types:</u></strong></p><p>boolean - true of false</p><p>char - character</p><p><br></p><p><em>numeric:</em></p><p>byte - 8 bits</p><p>short - 16 bits</p><p>int - 32 bits</p><p>long - 64 bits</p><p><br></p><p><em>floating point:</em></p><p>float - 32 bits</p><p>double - 64 bits</p><p><br></p><p>You can assign value to a variable by:</p><ul><li>Typing a literal value after the equals sign (y = 9, c = \'e\', etc)</li><li>Assigning the value of one variable to another (y = x)</li><li>A combination of previous assignments (x = y + x + 3)</li></ul><p>For example:</p><pre><code>double pi = 3.14;\nchar last = \'e\';\nboolean isHungry = true;\ndouble radius = 4.8;\ndouble circ = 2 * pi * rad;\n</code></pre><p><br></p>','2019-01-23 15:42:34',1,3,5,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(68,'Introduction to Java Objects','introduction-to-java-objects','<h1>What is an Object?</h1><p>Java objects are representations of real world objects. When thinking about objects note states and behaviors. For example, a Cat has different states and behaviors.</p><p>Cat states:</p><ul><li>Color</li><li>Weight</li><li>Breed</li></ul><p>Cat behaviors:</p><ul><li>Eat</li><li>Meow</li><li>Nag</li></ul><p>What an object can do we call methods, while an object knows about itself are called instance variables.</p><h1>Whats the Difference Between a Class and an Object?</h1><p>A class is <strong><em>blueprint</em></strong> of an object. The class tells the virtual machine how to make an object of that type. You may define several objects from the class. For example, you might create 100 different dogs with a unique breed with the same class implementation.</p><h1>Making Objects</h1><p>We will create two objects: The object we want to test, and an object to test our main object. Let\'s make a Cat class to create several Cat objects which all have a meow method:</p><ol><li>Write Cat Class</li><li>Write TestDrive class</li><li>In your TestDrive class make a Cat object and access the variables and methods</li></ol><p><br></p><h2>Code</h2><blockquote>Cat.java</blockquote><pre><code>class Cat {\n    String name;\n    int age;\n    String color;\n\n    void meow() {\n        System.out.println(\"MEOWWW!\");\n    }\n}\n</code></pre><p><br></p><blockquote>TestDrive.java</blockquote><pre><code>public class TestDrive {\n    // main method! Everything starts here\n    public static void main(String[] args) {\n        Cat one = new Cat();\n        one.age = 90;\n        one.color = \"White\";\n        one.name = \"Snowball\";\n        one.meow();\n\n        Cat two = new Cat();\n        two.age = 1;\n        two.color = \"Orange\";\n        two.name = \"Garfield\";\n        two.meow();\n\n        Cat three = new Cat();\n        three.age = 2;\n        three.color = \"Grey\";\n        three.name = \"Space Cat\";\n        three.meow();\n    }\n}\n</code></pre><p><br></p><h2>The Dot Operator (.)</h2><p>In the TestDrive example uses the period after the Cat object, but why? The period, called the dot operator, is used to access an object\'s state and behavior</p><p><br></p><p>The main method should only be used to:</p><ul><li>Test your real classes</li><li>Start you Java application</li></ul>','2019-01-12 19:11:13',1,3,4,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(69,'Gloves in the dark!','gloves-in-the-dark%21','<h1><strong>Problem</strong></h1><p>There are 20 gloves in a drawer: 5 pairs of black gloves, 3 pairs of white, and 2 pairs of red. You select the gloves in the dark and can only check them after a selection has been made. What is the smallest number of gloves you need to select to guarantee getting the following?</p><p><br></p><ol><li>At least one matching pair</li><li>At least one matching pair of each color</li></ol><p><br></p><h1><strong>Solution</strong></h1><p>Keep in mind that a pair of gloves consists of 2 gloves of the same color but of different hand (2 gloves of the same color, 1 is for left hand and the other is for right hand). When thinking of the \"at least\" then we have to consider the worst case.</p><p><br></p><ol><li>To have at least one matching pair we have to go through all the colors, and always get one side (always right hand or always left hand). We get 5 black gloves, then 3 white gloves, and then 2 red gloves. The next glove HAS to be the glove to complete the pair. So the minimum gloves needed to guarantee 1 pair is 5+3+2+1 = 11.</li><li>To have at least one pair of EACH color then we have to get the all pairs of the colors except for the last color. The worst case is to choose all the black gloves, then all the white gloves, then 2 red gloves of the same hand. The next glove has be the matching pair to the red glove. So the minimum gloves needed is (5×2)+(3×2)+2+1 = 19.</li></ol>','2019-02-18 13:01:17',1,11,0,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(70,'Setting up Google reCAPTCHA with the Slim 3 Framework and Ajax','setting-up-google-recaptcha-with-the-slim-3-framework-and-ajax','<h1>Purpose</h1><p>Hate getting spam to your email from your contact form? Yeah, me too. Let\'s stop these bots with some good Google CAPTCHA! An example of this can be found in the <a href=\"https://kodecentral.com/contact\" target=\"_blank\">contact form of this website</a>.</p><p><br></p><h1>Getting keys</h1><p>Go to <a href=\"https://www.google.com/recaptcha/admin\" target=\"_blank\" style=\"color: rgb(3, 102, 214); background-color: rgb(255, 255, 255);\">https://www.google.com/recaptcha/admin</a> to get version 2 of reCAPTCHA or <a href=\"https://g.co/recaptcha/v3\" target=\"_blank\" style=\"color: rgb(3, 102, 214); background-color: rgb(255, 255, 255);\">https://g.co/recaptcha/v3</a> for version 3. Google will provide you with 2 keys, 1 is for your html form, and the other is for your backend.</p><p><br></p><h1>Setting up the form</h1><p>Add Google recaptcha\'s external javascript file to your website (in the head tag or before your body tag ends)</p><pre><code>&lt;script src=\'https://www.google.com/recaptcha/api.js\'&gt;&lt;/script&gt;\n</code></pre><p><br></p><p>Then create a form with the reCAPTCHA code:</p><pre><code>&lt;div class=\"g-recaptcha\" data-sitekey=\"front-end-secret-key\"&gt;&lt;/div&gt;\n</code></pre><p><br></p><p>The form in the contact page of this website uses the current html:</p><blockquote>view.php</blockquote><pre><code>&lt;form class=\"form-horizontal\" id=\"contact-form\" method=\"post\" action=\"\"&gt;\n&nbsp; &lt;fieldset class=\"container\"&gt;\n&nbsp; &nbsp; &lt;div class=\"form-group row\"&gt;\n&nbsp; &nbsp; &nbsp; &lt;label for=\"inputEmail\" autocomplete=\"false\" class=\"col-lg-2 control-label\"&gt;Email&lt;/label&gt;\n&nbsp; &nbsp; &nbsp; &lt;div class=\"col-lg-9\"&gt;\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;input type=\"email\" class=\"form-control\" id=\"inputEmail\" placeholder=\"Email\" name=\"email\"&gt; &lt;/div&gt;\n&nbsp; &nbsp; &lt;/div&gt;\n&nbsp; &nbsp; &lt;div class=\"form-group row\"&gt;\n&nbsp; &nbsp; &nbsp; &lt;label for=\"textArea\" class=\"col-lg-2 control-label\"&gt;Message&lt;/label&gt;\n&nbsp; &nbsp; &nbsp; &lt;div class=\"col-lg-9\"&gt;\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;textarea class=\"form-control\" rows=\"3\" id=\"textArea\" placeholder=\"Your message...\" name=\"message\"&gt;&lt;/textarea&gt;\n&nbsp; &nbsp; &nbsp; &lt;/div&gt;\n&nbsp; &nbsp; &lt;/div&gt;\n&nbsp; &nbsp; &lt;div class=\"form-group row\"&gt;\n&nbsp; &nbsp; &nbsp; &lt;div class=\"col-lg-2\"&gt;&lt;/div&gt;\n&nbsp; &nbsp; &nbsp; &lt;div class=\"col-lg-9\"&gt;\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;div class=\"g-recaptcha\" data-sitekey=\"front-end-secret-key\"&gt;&lt;/div&gt;\n&nbsp; &nbsp; &nbsp; &lt;/div&gt;\n&nbsp; &nbsp; &lt;/div&gt;\n&nbsp; &nbsp; &lt;div class=\"form-group row justify-content-end\"&gt;\n&nbsp; &nbsp; &nbsp; &lt;div class=\"col-lg-10\"&gt;\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;button type=\"submit\" class=\"btn btn-raised btn-primary\"&gt;Submit&lt;/button&gt;\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;button type=\"button\" class=\"btn btn-danger\"&gt;Cancel&lt;/button&gt;\n&nbsp; &nbsp; &nbsp; &lt;/div&gt;\n&nbsp; &nbsp; &lt;/div&gt;\n&nbsp; &lt;/fieldset&gt;\n&lt;/form&gt;\n</code></pre><p>Thing to note here is that your reCAPTCHA is part of the form, and that the key is used in the tag \"data-sitekey\".</p><p><br></p><h1>Making The Call</h1><blockquote>contact.js</blockquote><pre><code>$(function() {\n&nbsp; $(\'#contact-form\').on(\'submit\', function(e) {\n&nbsp; &nbsp; $.ajax({\n&nbsp; &nbsp; &nbsp; type: \"POST\",\n&nbsp; &nbsp; &nbsp; url: \"\",\n&nbsp; &nbsp; &nbsp; dataType: \"json\",\n&nbsp; &nbsp; &nbsp; data: {\n&nbsp; &nbsp; &nbsp; &nbsp; email: $(\'#inputEmail\').val(),\n&nbsp; &nbsp; &nbsp; &nbsp; message: $(\'#textArea\').val(),\n&nbsp; &nbsp; &nbsp; &nbsp; captcha: grecaptcha.getResponse()\n&nbsp; &nbsp; &nbsp; },\n&nbsp; &nbsp; &nbsp; success: function(data) {\n&nbsp; &nbsp; &nbsp; &nbsp; console.log(data);\n&nbsp; &nbsp; &nbsp; }\n&nbsp; &nbsp; });\n&nbsp; &nbsp; return false;\n&nbsp; });\n});\n</code></pre><p>Note that the captcha is being passed to the back-end with the ajax call, we will verify this with Google in the back-end with Slim.</p><p><br></p><h1>Receiving The Call</h1><p>The Ajax call will call a route in the back-end. My form calls it\'s current route \"/contact\". The route looks something like the following:</p><blockquote>App.php</blockquote><pre><code>$app-&gt;post(\'/contact\', function ($request, $response, $args) {\n&nbsp; &nbsp; $params = $request-&gt;getParsedBody();\n\n&nbsp; &nbsp; if (!filter_var($params[\'email\'], FILTER_VALIDATE_EMAIL) ||\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; $params[\'message\'] == \"\" || $params[\'message\'] == null) {\n&nbsp; &nbsp; &nbsp; &nbsp; return $response-&gt;withJson([\'success\'=&gt;false, \'msg\'=&gt;\'Invalid data\']);\n&nbsp; &nbsp; }\n\n&nbsp; &nbsp; // check captcha\n&nbsp; &nbsp; $secret = \"back-end-key\";\n&nbsp; &nbsp; $captcha = $params[\'captcha\'];\n\n\n&nbsp; &nbsp; $verify=file_get_contents(\"https://www.google.com/recaptcha/api/siteverify?secret={$secret}&amp;response={$captcha}\");\n&nbsp; &nbsp; $captcha_success=json_decode($verify);\n\n\n&nbsp; &nbsp; if ($captcha_success-&gt;success==false) {\n&nbsp; &nbsp; &nbsp; &nbsp; return $response-&gt;withJson([\'success\'=&gt;\'false\', \'msg\'=&gt;\'Are you a robot?\']);\n&nbsp; &nbsp; }\n\n    // do something once you know its not a robot\n&nbsp; &nbsp; // $arr = \\app\\utils\\Mail::contactUs($params[\'email\'], $params[\'message\']);\n&nbsp; &nbsp; return $response-&gt;withJson($arr);\n});\n</code></pre><p>Replace $secret  with your own back-end key</p><p><br></p><p>There you go! Of course this was only a short tutorial without any real user validation. Make your own adjustments as needed :) Happy coding.</p>','2019-02-24 22:03:11',1,12,0,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(71,'Theater Sitting in Spiral','theater-sitting-in-spiral','<h1>Problem</h1><p>In a theater, Seats are arranged in the N by M grid. The number of each seat is indicated by the coordinates of the corresponding grid. For example, when N = 3 and M = 5, the seats are like below.</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/hwk1/1.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/hwk1/1.png\" style=\"display: block; margin: auto;\" width=\"394\"></a></p><p>Many people stand in waiting lines to enter this venue. The waiting people receive the waiting list in the order 1, 2, 3, 4, ... from the front. We start with (1, 1) seats for people with a waiting number, turn clockwise and assign the audience to the empty seats in order like below. </p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/hwk1/2.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/hwk1/2.png\" style=\"display: block; margin: auto;\" width=\"226\"></a></p><p><br></p><p>Visual aid:</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/hwk1/spiral_matrix_theatre.gif\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/hwk1/spiral_matrix_theatre.gif\" style=\"display: block; margin: auto;\" width=\"291\"></a></p><p>If N and M are given, a program should be created to find the seat number (x, y) to be assigned to the audience whose waiting sequence is K. If there is no seat for K, the program returns 0.</p><p>T = number of test case</p><p><strong>Input</strong></p><p>T</p><p>N M K</p><p>N M K</p><p><strong>Output</strong></p><p>x y</p><p>x y</p><p><br></p><p><u>Example</u></p><p><strong>Input</strong></p><p>3</p><p>6 7 11</p><p>6 7 87</p><p>100 100 3000</p><p><strong>Output</strong></p><p>66 0</p><p>9 64</p><p><br></p><h1>Solution</h1><pre><code>import java.util.Scanner;\n\npublic class Theater {\n\n    private static void printMap(int[][] map) {\n        for (int[] a : map) {\n            for (int b : a) {\n                System.out.printf(\"%-5d\", b);\n            }\n            System.out.println();\n        }\n        System.out.println();\n    }\n\n    public static void main(String[] args) {\n        String i = \"3\\n\" +\n                \"7 6 31\\n\" +\n                \"7 6 87\\n\" +\n                \"100 100 3000\\n\";\n\n        Scanner s = new Scanner(i);\n\n        int T = s.nextInt();\n        for (int t = 0; t &lt; T; t++) {\n            int N = s.nextInt();\n            int M = s.nextInt();\n            int K = s.nextInt();\n\n            if (K &gt; N * M) {\n                // dont fit\n                System.out.println(0);\n                continue;\n            }\n\n            int[][] mat = new int[M][N];\n\n            int u = 0, r = 0, d = 0, l = 0;\n            int x = 0, y = M;\n            int dir = 0; // 0 = up, 1 = right, 2 = down, 3 = left\n\n            for (int move = 1; move &lt; K + 1; move++) {\n                if (dir == 0) {\n                    if (y - 1 - u == 0) {\n                        dir = 1;\n                        l++;\n                    }\n                    mat[--y][x] = move;\n                } else if (dir == 1) {\n                    if ((x + r) + 2 == N) {\n                        dir = 2;\n                        u++;\n                    }\n                    mat[y][++x] = move;\n                } else if (dir == 2) {\n                    if ((y + 2) + d == M) {\n                        dir = 3;\n                        r++;\n                    }\n\n                    mat[++y][x] = move;\n                } else if (dir == 3) {\n                    if (x - l == 1) {\n                        dir = 0;\n                        d++;\n                    }\n                    mat[y][--x] = move;\n                }\n\n            }\n            printMap(mat);\n            System.out.println((x + 1) + \" \" + (M - y));\n        }\n    }\n}\n</code></pre><p>Sorry, limited comments! That\'s up to you.</p><p><br></p><p><span style=\"color: rgb(187, 187, 187);\">Disclaimer: Don\'t copy paste the code if you\'re going to submit! Change it to be yours! I am not responsible if you get in any trouble. This post is only meant for me to come back to later when practicing. It is not in my control to if anyone comes and copies it. Have a good day.</span></p>','2019-02-24 19:13:28',1,6,11,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(72,'Ant Maze','ant-maze','<h1>Problem</h1><p>There is a two-dimensional n by m grid space. This grid is (0,0) lower left and (n, m) upper right as shown below:</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/hwk1/ant_maze.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/hwk1/ant_maze.png\" style=\"display: block; margin: auto;\" width=\"248\"></a></p><p>There is an ant on the coordinates (i, j) in this space. (i=1 and j=4 in the example). The ant begins to move at a constant speed in the right upper 45 ° direction. The ant that first started from (i, j) moves to (i + 1, j + 1) after one hour. However, if hit the interface, it will move to the other direction at the same speed.</p><p><br></p><p>Make a program that calculates the position of ant after H hours.</p><p><br></p><p>Visual Aid:</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/hwk1/ant_maze.gif\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/hwk1/ant_maze.gif\" style=\"display: block; margin: auto;\"></a></p><p><br></p><p><strong>Input &amp; Output Format</strong></p><p>T = number of test case</p><p><br></p><p><strong>Input</strong></p><p>T</p><p>N M I J H</p><p>N M I J H</p><p><br></p><p><strong>Output</strong></p><p>X Y</p><p>X Y</p><p><br></p><p><strong>Example</strong></p><p>Input</p><p>2</p><p>4 6 1 4 8</p><p>5 7 3 5 4</p><p><br></p><p><strong>Output</strong></p><p>1 0</p><p>3 5</p><p><br></p><h1>Solution</h1><pre><code>import java.util.Scanner;\n\npublic class AntMaze {\n\n    private static void print(int[][] map) {\n        for (int[] a : map) {\n            for (int b : a) {\n                System.out.print(b + \"\\t\");\n            }\n            System.out.println();\n        }\n        System.out.println();\n    }\n\n    public static void main(String[] args) {\n        String in = \"2\\n\" +\n                \"4 6 1 4 8\\n\" +\n                \"5 7 3 5 4\";\n\n        Scanner s = new Scanner(in);\n\n        int T = s.nextInt();\n\n        for (int t = 0; t &lt; T; t++) {\n            int N = s.nextInt() + 1;\n            int M = s.nextInt() + 1;\n            int I = N - s.nextInt() - 1;\n            int J = s.nextInt();\n            int H = s.nextInt();\n\n            int[][] map = new int[N][M];\n\n            map[I][J] = 1;\n\n            int dir = 0;\n\n            for (int h = 0; h &lt; H; h++) {\n                if (I == 0 &amp;&amp; J + 1 == M) {\n                    dir = 2;\n                }\n                else if (I == 0 &amp;&amp; J == 0) {\n                    dir = 3;\n                }\n                else if (I + 1 == N &amp;&amp; J + 1 == M) {\n                    dir = 1;\n                }\n                else if (I + 1 == N &amp;&amp; J == 0) {\n                    dir = 0;\n                }\n                else if (J + 1 == M) {\n                    if (dir == 0) {\n                        dir = 1;\n                    } else if (dir == 3) {\n                        dir = 2;\n                    }\n                }\n                else if (J == 0) {\n                    if (dir == 1) {\n                        dir = 0;\n                    } else if (dir == 2) {\n                        dir = 3;\n                    }\n                }\n                else if (I == 0) {\n                    if (dir == 1) {\n                        dir = 2;\n                    } else if (dir == 0) {\n                        dir = 3;\n                    }\n                }\n                // check if hit bottom wall\n                else if (I + 1 == N) {\n                    if (dir == 2) {\n                        dir = 1;\n                    } else if (dir == 3) {\n                        dir = 0;\n                    }\n                }\n                map[I][J] = 0;\n\n                if (dir == 0) {\n                    I--;\n                    J++;\n                } else if (dir == 1) {\n                    I--;\n                    J--;\n                } else if (dir == 2) {\n                    I++;\n                    J--;\n                } else if (dir == 3) {\n                    I++;\n                    J++;\n                }\n\n                map[I][J] = 1;\n                print(map);\n            }\n\n\n            System.out.println((N - I - 1) + \" \" + J);\n        }\n    }\n}\n</code></pre><p>Sorry, but no comments.</p><p><br></p><p><span style=\"color: rgb(187, 187, 187);\">Disclaimer: Don\'t copy paste the code if you\'re going to submit! Change it to be yours! I am not responsible if you get in any trouble. This post is only meant for me to come back to later when practicing. It is not in my control to if anyone comes and copies it. Have a good day.</span></p>','2019-03-03 11:13:42',1,6,10,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(73,'Phase 1','phase-1','<h1>Problem</h1><p>Make a computer simulator written in C. Recognize the commands from a few characters (\"dir\" = \"directory\") and alert the user when the program requires parameters, or doesn\'t require parameters and some were given. The program should use outside libraries, and commands, such as strtok are not allowed when breaking up strings.</p><p><br></p><p><u>List of commands:</u></p><p><strong>load filename</strong>: will call the load function to load the specified file.</p><p><strong>execute</strong>: will call the computer simulation program to execute the program that was previously loaded in memory.</p><p><strong>debug</strong>: will allow you to execute in debug mode.</p><p><strong>dump start end</strong>: will call the dump function, passing the values of start and end.&nbsp;Start and end will be hexadecimal values(but this does not need to be verified yet).</p><p><strong>help</strong>:will print out a list of available commands.&nbsp;&nbsp;If an unrecognized command is typed at the command level, a message to type help should be displayed.</p><p><strong>assemble filename</strong>: will assemble an SIC assembly language program into a load module and store it in a file.</p><p><strong>directory</strong>: will list the files stored in the current directory. Do this by&nbsp;<span style=\"background-color: rgb(255, 235, 204);\">system(\"ls\");</span>.You will need the directive&nbsp;&nbsp;#include&lt;stdlib.h&gt;.</p><p><strong>exit</strong>: will exit from the simulator.</p><p><br></p><h1>Solution</h1><pre><code>#include &lt;stdio.h&gt;\n#include &lt;string.h&gt;\n#include &lt;stdlib.h&gt;\n\n#define LOAD 1\n#define EXECUTE 2\n#define DEBUG 3\n#define DUMP 4\n#define HELP 5\n#define ASSEMBLE 6\n#define DIRECTORY 7\n#define EXIT 8\n#define INVALIDKEY 0\n\ntypedef struct { char *key; int val; } sym_table_struct;\n\nstatic sym_table_struct lookUpTable[] = {\n        { \"load\", LOAD }, { \"execute\", EXECUTE },\n        { \"debug\", DEBUG }, { \"dump\", DUMP },\n        { \"help\", HELP }, { \"assemble\", ASSEMBLE },\n        { \"directory\", DIRECTORY }, { \"exit\", EXIT }\n};\n\n#define NKEYS (sizeof(lookUpTable)/sizeof(sym_table_struct))\n\nint startsWith(const char *pre, const char *str)\n{\n    return strncmp(pre, str, strlen(pre)) == 0;\n}\n\nint strToInt(char* num) {\n    int dec = 0;\n    for (int i = 0; i &lt; strlen(num); i++) {\n        dec = dec * 10 + (num[i] - \'0\');\n    }\n\n    printf(\"number %d\\n\", dec);\n\n    return dec;\n}\n\nint key_from_string(char *key) {\n    sym_table_struct *sym = lookUpTable;\n\n    int found = 0;\n    int temp = INVALIDKEY;\n\n    for (int i = 0; i &lt; NKEYS; i++) {\n        if (startsWith(key, sym-&gt;key)) {\n            temp = sym-&gt;val;\n            found++;\n        }\n        sym++;\n    }\n\n    if(found &gt; 1 || found == 0){\n        // many start the same or not found at all\n        return INVALIDKEY;\n    }\n\n    return temp;\n}\n\n\nvoid load(char* filename)\n{\n    printf(\"Loading file: %s\\n\", filename);\n}\n\nvoid execute()\n{\n    printf(\"Executing \\n\");\n}\n\nvoid debug()\n{\n    printf(\"Debugging\\n\");\n}\n\nvoid dump(int start, int end)\n{\n    printf(\"Dumping start: %x end: %x\\n\", start, end);\n}\n\nvoid help()\n{\n    printf(\"List of commands:\\n\");\n    printf(\"load &lt;filename&gt;\\n\");\n    printf(\"execute\\n\");\n    printf(\"debug\\n\");\n    printf(\"dump start end\\n\");\n    printf(\"help\\n\");\n    printf(\"assemble &lt;filename&gt;\\n\");\n    printf(\"directory\\n\");\n    printf(\"exit\\n\");\n}\n\nvoid assemble(char* filename)\n{\n    printf(\"Assembling %s\\n\", filename);\n}\n\nvoid directory()\n{\n    system(\"ls\");\n}\n\nvoid call_exit()\n{\n    printf(\"Exit.\\n\");\n}\n\nint main(int argc, char const *argv[]) {\n    printf(\"Welcome to tiny interpreter!\\n\");\n    printf(\"Type help to get list of commands.\\n\");\n\n    char quit = 0;\n    char command[100], buf[3][100];\n\n    while (!quit) {\n        // clear garbage from previous command\n        memset(command, 0, 100);\n        memset(buf[0], 0, 100);\n        memset(buf[1], 0, 100);\n        memset(buf[2], 0, 100);\n\n        printf(\"\\n&gt; \");\n\n        fgets(command, 100, stdin);\n\n        // remove newline\n        long len = strlen(command);\n        if (command[len - 1] == \'\\n\')\n            command[len - 1] = 0;\n\n        int j = 0,k = 0;\n        for (int i = 0; command[i] != \'\\0\' || j &gt; 2; ++i) {\n            if (command[i] == \' \') {\n                buf[j][k] = \'\\0\';\n                if (k &gt; 0) j++;\n                k = 0;\n            } else buf[j][k++] = command[i];\n        }\n\n        int key = key_from_string(buf[0]);\n\n        switch (key) {\n            case LOAD:\n                //run load\n                if (strlen(buf[1]) &gt; 0 &amp;&amp; strlen(buf[2]) == 0) {\n                    load(buf[1]);\n                } else {\n                    printf(\"LOAD NEEDS ONE PARAMETER!\");\n                }\n                break;\n\n            case EXECUTE:\n                //run execute\n                execute();\n                break;\n\n            case DEBUG:\n                //run debug\n                debug();\n                break;\n\n            case DUMP:\n                //run dump\n                if (strlen(buf[1]) &gt; 0 &amp;&amp; strlen(buf[2]) &gt; 0) {\n                    int start = (int) strtol(buf[1], NULL, 16);\n                    int end = (int) strtol(buf[2], NULL, 16);\n                    dump(start, end);\n                } else {\n                    printf(\"DUMP NEEDS 2 PARAMETERS!\");\n                }\n                break;\n\n            case HELP:\n                //run help\n                help();\n                break;\n\n            case ASSEMBLE:\n                //run assemble\n                if (strlen(buf[1]) &gt; 0 &amp;&amp; strlen(buf[2]) == 0) {\n                    assemble(buf[1]);\n                } else {\n                    printf(\"ASSEMBLE NEEDS 1 PARAMETER!\");\n                }\n                break;\n\n            case DIRECTORY:\n                //run directory\n                directory();\n                break;\n\n            case EXIT:\n                //exit\n                call_exit();\n                quit = 1;\n                break;\n            case INVALIDKEY:\n                help();\n                break;\n            default:\n                break;\n        }\n    }\n}\n</code></pre><p><br></p><p><span style=\"color: rgb(187, 187, 187);\">Disclaimer: Don\'t copy paste the code if you\'re going to submit! Change it to be yours! I am not responsible if you get in any trouble. This post is only meant for me to come back to later when practicing. It is not in my control to if anyone comes and copies it. Have a good day.</span></p>','2019-02-27 10:19:23',1,13,0,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(74,'Phase 2','phase-2','<h1>Problem</h1><p>Pass one will read each line of the source file, and begin the process of translating it to object code. (Note: it will be to your advantage to have a separate procedure handle reading, and perhaps tokenizing, the source file.) Among other things, this pass will create the symbol table. At the end of the pass, the symbol table should be printed, showing each symbol together with its location. This pass must also recognize and handle the assembler mnemonics in addition to the directives <strong>START</strong>, <strong>END</strong>, <strong>BYTE</strong>, <strong>WORD</strong>, <strong>RESB</strong>, and <strong>RESW</strong>. It should also be able to recognize the following types of errors:</p><ul><li>Duplicate labels</li><li>Illegal label (note: could specify why it is illegal, but not necessary)</li><li>Illegal operation</li><li>Missing or illegal operand on data storage directive</li><li>Missing or illegal operand on START directive</li><li>Missing or illegal operand on END directive (note: you do not need to check if the symbol is defined) Too many symbols in source program</li><li>Program too long</li></ul><p>After flagging an error, your assembler should continue processing the source file so that all errors are flagged in a single run. These errors will not be printed, but must be passed to the second pass of the assembler.</p><p><strong>NOTE: Your assembler should not terminate abnormally because of anything (legal or not) in the source program being assembled.</strong></p><p>Since some processing must take place on each line during pass one, it is advantageous to save this information in an intermediate file for use by pass two. Some things you may wish to place in this file are:</p><ul><li>copy of source line</li><li>value of location counter</li><li>values of mnemonics used (since they had to be looked up)</li><li>operand (since you had to get it)</li><li>error messages (from pass 1 - best to use codes and not the actual message)</li></ul><p>This information should be easy to retrieve – that is, you should not have to break up anything to get this saved information.</p><p><br></p><p><a href=\"https://pastebin.com/RM6Pdqmq\" target=\"_blank\">Source.asm file</a></p><p><br></p><h1>Solution</h1><p>The following steps can be used to solve the problem:</p><ol><li>Break the link</li><li>Check if line is a comment or empty</li><li>Check if line is START or END</li><li>Check for predefined opcodes</li><li>Add labels to symbol table (hashTable)</li><li>Get labels from symbol table (hashTable)</li><li>Increment the location counter accordingly</li></ol><p>One thing missing from this program are all the error checks, I have placed comments where some errors would be caught, but the rest is up to you :)</p><pre><code>#include &lt;stdio.h&gt;\n#include &lt;string.h&gt;\n#include &lt;stdlib.h&gt;\n\n// booleans are easier to work with :)\n#define bool int\n#define true 1\n#define false 0\n\n#define SOURCE_FILE \"source.asm\"\n#define INTERMEDIATE_FILE \"int_file\"\n\n#define COLUMN_LENGTH 33\n#define MAX_LINE_LENGTH 1024\n\n#define SYMBOL_TABLE_LENGTH 18661\n#define OPTAB_LENGTH 25\n#define INVALID_OPCODE (-1)\n\ntypedef struct Op {\n    char Mnemonic[9];\n    int Code;\n} OPCODE;\n\ntypedef struct Sym {\n    char Label[7];\n    int Address;\n} SYMBOL;\n\nOPCODE OPCODE_TABLE[] ={{\"ADD\",  0x18}, {\"AND\",  0x58}, {\"COMP\", 0x28},\n                 {\"DIV\",  0x24}, {\"J\",    0x3C}, {\"JEQ\",  0x30},\n                 {\"JGT\",  0x34}, {\"JLT\",  0x38}, {\"JSUB\", 0x48},\n                 {\"LDA\",  0x00}, {\"LDCH\", 0x50}, {\"LDL\",  0x08},\n                 {\"LDX\",  0x04}, {\"MUL\",  0x20}, {\"OR\",   0x44},\n                 {\"RD\",   0xD8}, {\"RSUB\", 0x4C}, {\"STA\",  0x0C},\n                 {\"STCH\", 0x54}, {\"STL\",  0x14}, {\"STX\",  0x10},\n                 {\"SUB\",  0x1C}, {\"TD\",   0xE0}, {\"TIX\",  0x2C},\n                 {\"WD\",   0xDC}};\n\nSYMBOL SYMBOL_TABLE[SYMBOL_TABLE_LENGTH];\n\nvoid passOne();\n\nint stringToNum(char * str, int base);\nbool streq(const char *a, const char *b);\nbool breakString(char * line, char * LABEL, char * OPCODE, char * OPERAND);\nint findOpcode(char * OPCODE);\nbool isPredefinedOpcode(char * OPCODE);\nlong getHashKey(char * str);\nint addSymbolToHashTable(char *str);\nSYMBOL findSymbolInHashTable(char *str);\nint byteDirectiveValue(char *c);\nvoid printSymbolTable(void);\n\nint main() {\n    passOne();\n    return 0;\n}\n\n// will be set by pass 1\nint startAddress = 0x0;\nint locationCounter = 0x0;\nchar programName[COLUMN_LENGTH];\nint programLength = 0x0;\nint numberOfSymbols = 0;\n\nvoid passOne() {\n    FILE *file = fopen(SOURCE_FILE, \"rt\");\n    FILE *intFile = fopen(INTERMEDIATE_FILE, \"wa\");\n\n    if (file != NULL) {\n        // if file opened\n        char line[MAX_LINE_LENGTH];\n        char LABEL[COLUMN_LENGTH], OPCODE[COLUMN_LENGTH], OPERAND[COLUMN_LENGTH];\n        int lineNumber = 0;\n\n        while (fgets(line, MAX_LINE_LENGTH, file) != NULL) {\n            fprintf(intFile, \"%s\", line);\n\n            // break up line and uppercase all of the fields\n            bool blankLine = breakString(line, LABEL, OPCODE, OPERAND);\n            if (LABEL[0] == \'.\' &amp;&amp; !blankLine) {\n                // is comment or blank\n                continue;\n            }\n\n\n            // 3 cases, START, END, others\n            if (lineNumber == 0) {\n                if (streq(OPCODE, \"START\")) {\n                    strcpy(programName, LABEL);\n                    locationCounter = stringToNum(OPERAND, 16);\n                } else {\n                    // no start found (put error in error tab)\n                    locationCounter = 0x0;\n                }\n\n                startAddress = locationCounter;\n\n                fprintf(intFile, \"%x\\n%s\\n%x\\n\", locationCounter, OPCODE, stringToNum(OPERAND, 16));\n            } else if (streq(OPCODE, \"END\")) {\n                fprintf(intFile, \"END\\n\");\n                // end program\n                break;\n            } else {\n                fprintf(intFile, \"%x\\n\", locationCounter);\n\n                int hasOpcode = findOpcode(OPCODE);\n                if (isPredefinedOpcode(OPCODE)) {\n                    // write OPCODE TO int file\n                    fprintf(intFile, \"%s\\n\", OPCODE);\n\n                } else if (hasOpcode) {\n                    // write hasOpcode to int file\n                    fprintf(intFile, \"%x\\n\", hasOpcode);\n                } else {\n                    fprintf(intFile, \"\\n\");\n                }\n\n                fprintf(intFile, \"%s\\n\", OPERAND);\n\n                if (LABEL[0] != 0) {\n                    // has label\n                    if (streq(findSymbolInHashTable(LABEL).Label, LABEL)) {\n                        // already in table, catch error\n                    } else {\n                        // check for too many symbols and other errors\n                        if(addSymbolToHashTable(LABEL)){\n                            numberOfSymbols++;\n                        }\n                    }\n                }\n\n                // do some extra checks (e.g. WORD can only take decimals as operand)\n                if (streq(OPCODE, \"WORD\")) {\n                    locationCounter += 3;\n                } else if (streq(OPCODE, \"RESB\")) {\n                    locationCounter += stringToNum(OPERAND, 10);\n                } else if (streq(OPCODE, \"RESW\")) {\n                    locationCounter += (3 * stringToNum(OPERAND, 10));\n                } else if (streq(OPCODE, \"BYTE\")) {\n                    locationCounter += byteDirectiveValue(OPERAND);\n                } else {\n                    locationCounter += 3;\n                }\n            }\n\n            lineNumber++;\n            fprintf(intFile, \"\\n\");\n        }\n    }\n    programLength = locationCounter - startAddress;\n    // here write down errors caught at the end\n\n    printSymbolTable();\n    printf(\"START ADDRESS = %x\\n\", startAddress);\n    printf(\"FINAL LOCATION COUNTER = %x\\n\", locationCounter);\n    printf(\"PROGRAM LENGTH = %x\\n\", programLength);\n\n    fclose(file);\n    fclose(intFile);\n}\nint stringToNum(char *str, int base) {\n    return ((int) strtol(str, NULL, base));\n}\n\nbool streq(const char *a, const char *b){\n    return strcmp(a, b) == 0;\n}\n\n// return true if empty\nbool breakString(char * line, char * LABEL, char * OPCODE, char * OPERAND) {\n    // mess with a copy\n    char copy[MAX_LINE_LENGTH];\n    strcpy(copy, line);\n\n    // clear previous garbage\n    memset(LABEL, 0, COLUMN_LENGTH);\n    memset(OPCODE, 0, COLUMN_LENGTH);\n    memset(OPERAND, 0, COLUMN_LENGTH);\n\n    char * buffer[] = {LABEL, OPCODE, OPERAND};\n\n    // remove last \\n from fgets input\n    int len = (int) (strlen(copy) - 1);\n    if (copy[len] == \'\\n\')\n        copy[len] = \'\\0\';\n\n    // break the string\n    for (int i = 0, j = 0, k = 0; (line[i] != \'\\0\' || j &gt; 2) &amp;&amp; j != 3; ++i) {\n        if (j == 0 &amp;&amp; (copy[0] == \' \' || copy[0] == \'\\t\')) {\n            // line starts with whitespace, so ignore\n            j++;\n            k = 0;\n        }\n        if (line[i] == \' \' || line[i] == \'\\t\' || line[i] == \'\\n\') {\n            // word grabbed\n            buffer[j][k] = \'\\0\';\n\n            if (k &gt; 0) j++;\n            k = 0;\n        } else {\n            // capitalize every char\n            char cap = line[i];\n            if (cap &gt;= \'a\' &amp;&amp; cap &lt;= \'z\') {\n                cap = (char) ((int) cap - 32);\n            }\n            buffer[j][k++] = cap;\n        }\n    }\n\n    // lets get back our original string\n    strcpy(line, copy);\n\n    return (buffer[0][0] == 0 &amp;&amp; buffer[1][0] &amp;&amp; buffer[2][0] == 0) ? true : false;\n}\n\n// uses binary search\nint findOpcode(char *OPCODE) {\n    // if not found return FALSE, else return hex val\n    int start = 0;\n    int middle;\n    int end = OPTAB_LENGTH - 1;\n    while (start &lt;= end) {\n        middle = (start + end) / 2;\n        if (streq(OPCODE_TABLE[middle].Mnemonic, OPCODE)) {\n            return OPCODE_TABLE[middle].Code;\n        } else if (strcmp(OPCODE_TABLE[middle].Mnemonic, OPCODE) &gt; 0) {\n            end = middle - 1;\n        } else if (strcmp(OPCODE_TABLE[middle].Mnemonic, OPCODE) &lt; 0) {\n            start = middle + 1;\n        }\n    }\n\n    return INVALID_OPCODE;\n}\n\nbool isPredefinedOpcode(char * OPCODE){\n    return streq(OPCODE, \"WORD\") || streq(OPCODE, \"RESB\") ||\n            streq(OPCODE, \"RESW\") || streq(OPCODE, \"BYTE\");\n}\n\nlong getHashKey(char *str) {\n    unsigned long h = 18287;\n    for (int x = 0; x &lt; strlen(str); x++) {\n        h = h * 101 + str[x];\n    }\n    return h % SYMBOL_TABLE_LENGTH;\n}\n\nint addSymbolToHashTable(char *str) {\n    long index = getHashKey(str);\n\n    if (streq(SYMBOL_TABLE[index].Label, str)) {\n        return false;\n    } else {\n\n        unsigned long step = 1;\n        index += step;\n        while (SYMBOL_TABLE[index].Label[0] != \'\\0\') {\n            if (streq(SYMBOL_TABLE[index].Label, str)) {\n                return false;\n            }\n            step *= step;\n            index += step;\n            index %= SYMBOL_TABLE_LENGTH;\n        }\n\n        if (SYMBOL_TABLE[index].Label[0] == \'\\0\') {\n            strcpy(SYMBOL_TABLE[index].Label, str);\n            SYMBOL_TABLE[index].Address = locationCounter;\n            return true;\n        }\n\n        return false;\n    }\n}\n\nSYMBOL findSymbolInHashTable(char *str) {\n    long index = getHashKey(str);\n\n    if (streq(SYMBOL_TABLE[index].Label, str))\n        return SYMBOL_TABLE[index];\n    else {\n        unsigned long step = 1;\n        index += step;\n        while (!streq(SYMBOL_TABLE[index].Label, str)) {\n            if (SYMBOL_TABLE[index].Label[0] == \'\\0\') {\n                // found empty tray\n                break;\n            }\n            step *= step;\n            index += step;\n            index %= SYMBOL_TABLE_LENGTH;\n        }\n\n        return SYMBOL_TABLE[index];\n    }\n}\n\nint byteDirectiveValue(char *c) {\n    char str[COLUMN_LENGTH];\n    // make a copy\n    strcpy(str, c);\n    int len = (int) strlen(str);\n\n    if ((str[0] == \'c\' || str[0] == \'C\') || (str[0] == \'x\' || str[0] == \'X\')) {\n        if (str[1] == \'\\\'\') {\n            // has start\n            int m = 0;  /* length between \'...\'*/\n            bool hasApostrophe = false;\n            for (int x = 2; x &lt; len; x++) {\n                if (str[x] == \'\\\'\') {\n                    // found 2nd \'\n                    hasApostrophe = true;\n                    break;\n                }\n                m++;\n            }\n\n            if (!hasApostrophe) {\n                // couldn\'t find last \'\n                return 0;\n            }\n\n            if (str[0] == \'x\' || str[0] == \'X\') {\n\n                // m must be even\n                return m / 2;\n            } else\n                return m;\n        } else return 0;\n    } else return 0;\n}\n\nvoid printSymbolTable() {\n    // print symbol table\n    for (int x = 0; x &lt; SYMBOL_TABLE_LENGTH; x++) {\n        if (SYMBOL_TABLE[x].Label[0] != \'\\0\') {\n            printf(\"SYMBOL: %s, ADDRESS: %x\\n\", SYMBOL_TABLE[x].Label, SYMBOL_TABLE[x].Address);\n        }\n    }\n}\n</code></pre><p><br></p><p><span style=\"color: rgb(187, 187, 187);\">Disclaimer: Don\'t copy paste the code if you\'re going to submit! Change it to be yours! I am not responsible if you get in any trouble. This post is only meant for me to come back to later when practicing. It is not in my control to if anyone comes and copies it. Have a good day.</span></p>','2019-03-06 09:56:38',1,13,1,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(75,'Field Trip Room Capacity Problem!','field-trip-room-capacity-problem%21','<h1>Problem</h1><p>A high school decided to go on a field trip for two nights and three days. There are three types of rooms in the hotel where students can stay. The capacity of the room (the number of beds in the room) are given, and it is assumed that the number of rooms are unlimited. The students are assigned to these rooms, but we do not want to have any empty beds in all assigned rooms.</p><p><br></p><p>For example, if the three types (capacity) of the room are five (type1), nine(type2), or twelve(type3), and the entire student is 113, you can book four type1, five type2, and four type3 rooms without an empty bed in any room. However, if the room types are like three, six, and nine for type 1, 2, and 3 respectively, and the whole student is 112, it is impossible to assign a room without an empty bed.</p><p><br></p><p>Write a program that determines if room assignments are possible so that there are no empty beds in all assigned rooms when there are three numbers representing the capacity of the three types of room and one number representing the total number of students. It is allowed to use only one type or two types of rooms without using all three types of rooms.</p><p><br></p><p>Input and output should be through a text file. The file name should be “input.txt” and “output.txt”</p><p><br></p><p><strong>Input file &amp; Output file Format</strong></p><p>A = capacity of room type 1</p><p>B = capacity of room type 2</p><p>C = capacity of room type 3</p><p>N = Total number of students</p><p>T = number of test case</p><p>S = 1 or 0</p><p><br></p><p><strong>Input file</strong></p><p>A B C N</p><p>A B C N</p><p>.</p><p>.</p><p>.</p><p><br></p><p><strong>Output file</strong></p><p>S</p><p>S</p><p>.</p><p>.</p><p>.</p><p><br></p><p><strong>Example</strong></p><p><br></p><p><strong>Input file</strong></p><p>5 9 12 113</p><p>3 6 9 112</p><p><br></p><p><strong>Output file</strong></p><p>1</p><p>0</p><p><br></p><h1>Solution</h1><p>So, this sounds very familiar to that change problem, doesn\'t it? Let\'s use some dynamic programming to solve this! What does it mean for 113 to fit in rooms with 5 beds, 9 beds and 12 beds? Note that we have infinite number of rooms. We can fill 4 rooms with 5 beds, 5 rooms with 9 beds, and 4 rooms with 12 beds for a total of 4x5+5x9+4x12 = 113! Since all beds are filled we write a 1. Now, let\'s break down the problem into smaller pieces. What does it mean to fill rooms with 113 students? What about 108 (113 - 5), 104 (113 - 9), or 101 (113 - 12) students? We can grab all the students and say \"If we use one room of 5 we still have 108, can we fill those? What if instead we use a room of 9?\". See the pattern? I calculated if rooms from 0 to the number of students were fillable. For the previous example, we can check if 108 is fillable, if so, then 113 is also fillable since it\'s 5 away, and we can use a room of 5 capacity.</p><p><br></p><pre><code>import java.io.File;\nimport java.io.FileWriter;\nimport java.io.IOException;\nimport java.io.PrintWriter;\nimport java.util.Scanner;\n\npublic class Main {\n    static int canFit(int capacity1, int capacity2, int capacity3, int students) {\n        int[] capacities = {capacity1, capacity2, capacity3};\n        int[] savedValues = new int[students + 1];\n\n        // Base case\n        savedValues[0] = 1;\n\n        for (int i = 1; i &lt;= students; i++) {\n            for (int c = 0, coinsLength = capacities.length; c &lt; coinsLength; c++) {\n                int capacity = capacities[c];\n                if (capacity &lt;= i) {\n                    // take away the current capacity\n                    int diff = savedValues[i - capacity];\n                    if (diff != 0) {\n                        // difference exists, so therefore this is possible\n                        savedValues[i] = 1;\n                        break;\n                    }\n                }\n            }\n        }\n        return savedValues[students];\n    }\n\n    public static void main(String[] args) throws IOException {\n        Scanner s = new Scanner(new File(\"input.txt\"));\n\n        FileWriter fw = new FileWriter(\"output.txt\");\n        PrintWriter pw = new PrintWriter(fw);\n\n        while (s.hasNextLine()) {\n            int capacity1 = s.nextInt();\n            int capacity2 = s.nextInt();\n            int capacity3 = s.nextInt();\n\n            int students = s.nextInt();\n\n            pw.println(canFit(capacity1, capacity2, capacity3, students));\n        }\n\n        s.close();\n        pw.close();\n    }\n}\n</code></pre><p><br></p><p><span style=\"color: rgb(187, 187, 187);\">Disclaimer: Don\'t copy paste the code if you\'re going to submit! Change it to be yours! I am not responsible if you get in any trouble. This post is only meant for me to come back to later when practicing. It is not in my control to if anyone comes and copies it. Have a good day.</span></p>','2019-03-04 10:00:29',1,6,9,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(76,'School Marks','school-marks','<h1>Problem</h1><p>Write a java method based program that uses and 2×2 array marks to store CAT 1 out of 10 CAT 2 out of 20 end main exam out of 70 marks for 8 course units of a student at the university </p><p>Array subject to store unit name and units code the marks are randomly generated </p><p>The unit name and codes are hard coded the program should then process the marks array to get the sum aggregate of all the marks </p><p>And the grade for each units </p><p>It should print out the performance score card of the student in the format shown</p><h1>Solution</h1><pre><code>public class MainClass {\n\n    public static void main(String[] args) {\n\n        int number = 8;\n\n        double[][] marks = new double[number][];\n\n\n        for (int x = 0; x &lt; number; x++) {\n            double cat1 = Math.random() * 10;\n            double cat2 = Math.random() * 20;\n            double exam = Math.random() * 70;\n\n\n            double total = cat1 + cat2 + exam;\n            double grade = total / 3;\n            marks[x] = new double[]{cat1, cat2, exam, total, grade};\n        }\n\n        String[][] subject = {{\"Name1\", \"Code1\"}, {\"Name2\", \"Code2\"}, {\"Name3\", \"Code3\"}, {\"Name4\", \"Code4\"},\n                {\"Name5\", \"Code5\"}, {\"Name6\", \"Code6\"}, {\"Name7\", \"Code7\"}, {\"Name8\", \"Code8\"}};\n\n\n        System.out.printf(\"%-30s%-30s%-30s\\n\", \"Student Number\", \"Name\", \"Date\");\n        System.out.printf(\"%-20s%-20s%-20s%-20s%-20s%-20s%-20s\\n\", \"Unit Code\", \"Name\", \"Cat1\", \"Cat2\", \"Exam\", \"Aggregate\", \"Grade\");\n\n        for (int x = 0; x &lt; number; x++) {\n            System.out.printf(\"%-20s%-20s%-20.2f%-20.2f%-20.2f%-20.2f%-20.2f\\n\", subject[x][1], subject[x][0], marks[x][0], marks[x][1], marks[x][2], marks[x][3], marks[x][4]);\n        }\n    }\n}\n</code></pre>','2019-03-18 16:39:09',1,6,8,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(77,'Make a Java Program to Differentiate Simple Equations','make-a-java-program-to-differentiate-simple-equations','<h1>Problem</h1><p>Make a java program to differentiate simple equations such as -5x^3+3x^2+5x-7.5x = -5x^3+3x^2-2.5x^1 =&gt; -15x^2+6x^12-2.5x^0</p><h1>Solution</h1><p>First format the string to make it workable (e.g., make -x into -1x and +x into +1x). Then split the input into tokens such as -5x^3, -3x^2, etc. After you split the string, sort by power, so all the same powers are together. After doing this, print out the differentiated equation (nx^(n-1)). There is room for improvement. I haven\'t caught many cases, or stress tested it with different inputs. This program is meant as a stepping stone to differentiate equations without using heavy libraries :)</p><blockquote>MainClass.java</blockquote><pre><code>import java.util.ArrayList;\n\npublic class MainClass {\n    public static void main(String[] args) {\n        String input = \"-5x^3+3x^2+5x-7.5x\";\n\n        // make workable\n        input = formatInput(input);\n\n        // first split input\n        ArrayList&lt;Token&gt; tokens = new ArrayList&lt;&gt;();\n        splitIntoTokens(tokens, input);\n\n        // sort by power so it can be easier to add like terms\n        tokens.sort((t1, t2) -&gt; {\n            return t1.getPower() &gt; t2.getPower() ? -1 : 0; // Descending\n        });\n\n        printDiff(tokens);\n    }\n\n    private static String formatInput(String input) {\n\n        input = input.trim();\n        if (!(input.startsWith(\"-\") || input.startsWith(\"+\"))) {\n            input = \'+\' + input;\n        }\n\n        input = input.replaceAll(\"\\\\s+\", \"\").replaceAll(\"(-x)\", \"-1x\")\n                .replaceAll(\"(\\\\+x)\", \"+1x\");\n        return input;\n    }\n\n    private static void splitIntoTokens(ArrayList&lt;Token&gt; tokens, String input) {\n\n        char var = \'x\';\n        if (input.isEmpty()) {\n            return;\n        }\n\n        int varIndex = input.indexOf(var);\n\n        System.out.println(input);\n        // System.out.println(varIndex);\n        if (varIndex != -1) {\n            int plusIndex = input.substring(varIndex).indexOf(\"+\");\n            int minusIndex = input.substring(varIndex).indexOf(\"-\");\n\n            if (plusIndex == -1 &amp;&amp; minusIndex == -1) {\n                // no operator\n                Token t = Token.build(input, varIndex);\n                tokens.add(t);\n            } else if (minusIndex != -1 &amp;&amp; minusIndex &lt; plusIndex || plusIndex == -1) {\n                // minus found\n                Token t = Token.build(input.substring(0, minusIndex + varIndex), varIndex);\n                tokens.add(t);\n\n                splitIntoTokens(tokens, input.substring(minusIndex + varIndex));\n            } else {\n                // plus found\n                Token t = Token.build(input.substring(0, plusIndex + varIndex), varIndex);\n                tokens.add(t);\n\n                splitIntoTokens(tokens, input.substring(plusIndex + varIndex));\n            }\n        }\n    }\n\n    // small method to show + with positive numbers\n    private static String withSign(double in) {\n        return in &gt;= 0 ? \"+\" + in : \"\" + in;\n    }\n\n    private static void printDiff(ArrayList&lt;Token&gt; tokens) {\n        double total = tokens.get(0).getNumber();\n        int p = tokens.get(0).getPower();\n        for (int x = 1; x &lt; tokens.size(); x++) {\n            Token t = tokens.get(x);\n\n            if (t.getPower() == p) {\n                total += t.getNumber();\n            } else {\n                // power changed\n                System.out.print(withSign(total * p) + \"x^\" + (p - 1));\n                p = t.getPower();\n                total = t.getNumber();\n            }\n\n        }\n        System.out.print(withSign(total * p) + \"x^\" + (p - 1));\n    }\n}\n\n</code></pre><p><br></p><blockquote>Token.java</blockquote><pre><code>public class Token {\n    private double number;\n    private int power;\n\n    public Token(double number, int power) {\n        this.number = number;\n        this.power = power;\n    }\n\n    public static Token build(String input, int respectIndex) {\n        if (respectIndex != -1) {\n            String number = input.substring(0, respectIndex);\n            int pow = input.substring(respectIndex).indexOf(\"^\");\n            if (pow != -1) {\n                // has a power\n                return new Token(Double.parseDouble(number), Integer.parseInt(input.substring(pow + respectIndex + 1)));\n            }\n            return new Token(Double.parseDouble(number), 1);\n\n        } else {\n            return new Token(Double.parseDouble(input), 1);\n        }\n    }\n\n    public double getNumber() {\n        return number;\n    }\n\n\n    public int getPower() {\n        return power;\n    }\n\n    @Override\n    public String toString() {\n        return \"number = \" + number + \", power = \" + power;\n    }\n}\n</code></pre>','2019-03-18 23:38:00',1,6,7,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(78,'Find Number of Triangles With The Same Perimeter','find-number-of-triangles-with-the-same-perimeter','<h1>Problem</h1><p>Given a perimeter p, find the number of triangles that have sides a, b, and c that add up to p. Make sure to not repeat triangles, e.g 0, 0, 9 = 9, 0, 0 (same triangle but flipped).</p><p><br></p><h1>Solution</h1><p>For a faster run time, and to avoid duplicates, sort the sides from smallest to greatest (9, 5, 6 will become 5, 6, 9). We don\'t need to check all possibilities since a + b + c = p, and an equilateral triangle means a = b = c, so therefore, we only need to check from 0 to p/3 for one side. A 2D array is used to make search easier and faster. Variable a will represent the rows, b the columns, and c the contents inside [a][b].</p><p><br></p><h1>Code (java)</h1><pre><code>import java.util.Scanner;\n\npublic class Main {\n\n    public static void main(String[] args) {\n        Scanner scanner = new Scanner(System.in);\n\n        System.out.print(\"Enter perimeter: \");\n        int p = scanner.nextInt();\n        int[][] mat = new int[p / 3 + 1][p / 2 + 1];\n\n        for (int i = 0; i &lt; mat.length; i++) {\n            for (int i1 = 0; i1 &lt; mat[i].length; i1++) {\n                mat[i][i1] = -1;\n            }\n        }\n\n        //printMat(mat);\n\n        scanner.close();\n\n        int num = 0;\n\n        for (int a = 0; a &lt; p/3 + 1; a++) {\n\n            for (int b = 0; b + a &lt; p + 1; b++) {\n                int c = p - (a + b);\n\n                // sort (to hash)\n                int a1 = smallest(a, b, c);\n                int b1;\n                int c1 = biggest(a, b, c);\n\n                if (a1 == a) {\n                    b1 = min(b, c);\n                } else if (a1 == b) {\n                    b1 = min(a, c);\n                } else {\n                    b1 = min(a, b);\n                }\n\n                if (mat[a1][b1] == -1) {\n                    num++;\n                    mat[a1][b1] = c1;\n                    System.out.println(\"a: \" + a1 + \", b: \" + b1 + \", c: \" + c1);\n                }\n            }\n\n        }\n\n        System.out.println(\"TOTAL: \" + num);\n        printMat(mat);\n    }\n\n    private static void printMat(int[][] mat) {\n        System.out.println(\"Printing matrix...\");\n        for (int[] ints : mat) {\n            for (int anInt : ints) {\n                System.out.printf(\"%-5s\", (anInt == -1) ? \"\" : anInt);\n            }\n\n            System.out.println();\n        }\n    }\n\n    private static int smallest(int a1, int b1, int c1) {\n        return min(a1, min(b1, c1));\n    }\n\n    private static int biggest(int a1, int b1, int c1) {\n        return max(a1, max(b1, c1));\n    }\n\n    private static int min(int a1, int b1) {\n        if (a1 &lt; b1)\n            return a1;\n        return b1;\n    }\n\n    private static int max(int a1, int b1) {\n        if (a1 &gt; b1)\n            return a1;\n        return b1;\n    }\n}\n</code></pre><p><br></p><h1>Output</h1><pre><code>Enter perimeter: 9\na: 0, b: 0, c: 9\na: 0, b: 1, c: 8\na: 0, b: 2, c: 7\na: 0, b: 3, c: 6\na: 0, b: 4, c: 5\na: 1, b: 1, c: 7\na: 1, b: 2, c: 6\na: 1, b: 3, c: 5\na: 1, b: 4, c: 4\na: 2, b: 2, c: 5\na: 2, b: 3, c: 4\na: 3, b: 3, c: 3\nTOTAL: 12\nPrinting matrix...\n9&nbsp;&nbsp;8&nbsp;&nbsp;7&nbsp;&nbsp;6&nbsp;&nbsp;5&nbsp;&nbsp;&nbsp;\n&nbsp;&nbsp;&nbsp;7&nbsp;&nbsp;6&nbsp;&nbsp;5&nbsp;&nbsp;4&nbsp;&nbsp;&nbsp;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;5&nbsp;&nbsp;4&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;3&nbsp;&nbsp;&nbsp;\n</code></pre>','2019-04-07 16:17:56',1,6,6,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(79,'Environment Setup','environment-setup','<h1>PHP</h1><p><strong>Windows:</strong></p><ul><li>Download the ZIP file for <a href=\"https://windows.php.net/download#php-7.3\" target=\"_blank\">PHP7.3</a></li><li>Extract to a folder called \"PHP7\" in your C: drive</li><li>Go to Control panel -&gt; System variables</li><li>Add a System path variable called \"PHP7\" with the path \"C:\\PHP7\"</li><li>If you see an application error, download the <a href=\"https://www.microsoft.com/en-us/download/details.aspx?id=52685\" target=\"_blank\">VC++ 2015 update</a></li></ul><p><a href=\"https://www.diskgenius.com/how-to/img/fix-error-code-0xc000007b-01.png\" target=\"_blank\"><img src=\"https://www.diskgenius.com/how-to/img/fix-error-code-0xc000007b-01.png\"></a></p><ul><li>If you are missing a .dll download and install it into your machine<span class=\"ql-cursor\">﻿﻿﻿﻿﻿﻿. Google search \"missing \'dll file name\' dd﻿l file﻿﻿﻿﻿﻿﻿﻿﻿﻿﻿﻿﻿﻿﻿﻿﻿﻿﻿﻿</span></li></ul><p><strong>Linux:</strong></p><pre><code>sudo apt-get update\nsudo apt -y install software-properties-common\nsudo add-apt-repository ppa:ondrej/php\nsudo apt-get update\nsudo apt -y install php7.4\nsudo apt-get install php7.4-cli php7.4-fpm php7.4-bcmath php7.4-curl php7.4-gd php7.4-intl php7.4-json php7.4-mbstring php7.4-mysql php7.4-opcache php7.4-sqlite3 php7.4-xml php7.4-zip\n</code></pre><h1>Composer</h1><p><strong>Windows:</strong></p><ul><li>Windows has a <a href=\"https://getcomposer.org/doc/00-intro.md#installation-windows\" target=\"_blank\">setup.exe</a> file that installs composer</li></ul><p><strong>Unix based systems:</strong></p><ul><li>Download <a href=\"https://getcomposer.org/download/\" target=\"_blank\">composer.phar</a> from the \"manual download\" section</li><li>Move composer.phar to /usr/local/bin/composer (remove the .phar extension)</li><li>chmod 777 /usr/local/bin/composer</li></ul><p>Download and install <a href=\"https://git-scm.com/downloads\" target=\"_blank\">Git bash</a>.</p><h1>VirtualBox</h1><p><strong>Windows:</strong></p><ul><li>	Windows has a <a href=\"https://www.virtualbox.org/wiki/Downloads\" target=\"_blank\">exe</a> file that installs VirtualBox</li></ul><p><strong>Linux:</strong></p><pre><code>sudo add-apt-repository multiverse &amp;&amp; sudo apt-get update\nsudo apt-get install virtualbox\nsudo apt-get install virtualbox-ext-pack\n</code></pre><h1>Vagrant</h1><p><strong>Mac and Windows:</strong></p><ul><li>Download and install <a href=\"https://www.vagrantup.com/downloads.html\" target=\"_blank\">Vagrant by HashiCorp</a>.</li></ul><p><strong>Linux:</strong></p><pre><code>curl -fsSL https://apt.releases.hashicorp.com/gpg | sudo apt-key add -\nsudo apt-add-repository \"deb [arch=amd64] https://apt.releases.hashicorp.com $(lsb_release -cs) main\"\nsudo apt-get update &amp;&amp; sudo apt-get install vagrant\n</code></pre><h1>FileZilla</h1><p><strong>Linux:</strong></p><pre><code>sudo apt install software-properties-common\nsudo add-apt-repository ppa:n-muench/programs-ppa\nsudo apt update\nsudo apt install filezilla\n</code></pre><p>Run the following command in your terminal to install homestead on vagrant</p><pre><code>vagrant box add laravel/homestead \n</code></pre><p>Download <a href=\"https://atom.io/\" target=\"_blank\" style=\"background-color: rgb(255, 255, 255);\">atom</a> and install some Laravel plugins for it.</p>','2021-08-16 10:41:23',1,14,0,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(80,'Creating a project','creating-a-project','<p>Time to create a Laravel project!</p><p>First cd into your projects folder (the folder where your Laravel projects will live).</p><p>Open your terminal and run the following command:</p><pre><code>composer create-project --prefer-dist laravel/laravel project-name\n</code></pre><p>cd into created project folder</p><pre><code>cd project-name\n</code></pre><p>Download the homestead package</p><pre><code>composer require laravel/homestead --dev\n</code></pre><p>Install homestead.</p><p>Windows:</p><pre><code>vendor\\\\bin\\\\homestead make\n</code></pre><p>Unix-based machie:</p><pre><code>php vendor/bin/homestead make\n</code></pre><p>Start up vagrant box</p><pre><code>vagrant up\n</code></pre><p><strong style=\"color: rgb(230, 0, 0);\">If \"missing private key\" error run the following command:</strong></p><pre><code>ssh-keygen -t rsa -f ~/.ssh/id_rsa\n</code></pre><p>SSH into vagrant box</p><pre><code>vagrant ssh\n</code></pre><p>You should see something like this:</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/laravel/homestead_1.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/laravel/homestead_1.png\" style=\"display: block; margin: auto;\" width=\"627\"></a></p><p>Open your browser and go to <a href=\"http://192.168.10.10\" target=\"_blank\">http://192.168.10.10</a></p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/laravel/laravel_chrome_1.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/laravel/laravel_chrome_1.png\" style=\"display: block; margin: auto;\" width=\"635\"></a></p><p><strong style=\"color: rgb(230, 0, 0);\">If \"No Application Encryption Key Has Been Specified\" error run the following command:</strong></p><pre><code>php artisan key:generate\n</code></pre><p><strong style=\"color: rgb(230, 0, 0);\">If the previous command throws an \".env file missing\" error, copy the .env.example file into a .env file.</strong></p><p><br></p><p>To link your ip to homestead.test you need to modify your host file. On Mac and Linux, this file is located at <em>/etc/hosts</em>. On Windows, it is located at <em>C:\\Windows\\System32\\drivers\\etc\\hosts</em>. The line you add to this file is the following: </p><pre><code>192.168.10.10&nbsp;homestead.test\n</code></pre><p>Test your project by going to homestead.test instead of the ip!</p>','2020-05-25 11:36:12',1,14,1,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(81,'Common Errors in Laravel Development','common-errors-in-laravel-development','<h1><strong style=\"color: rgb(240, 102, 102);\">Error:</strong></h1><p>\"Route [<strong>school_information-inline-create-save</strong>] not defined.\'... WHEN CREATING A inline-create ROUTE</p><p><strong style=\"color: rgb(102, 163, 224);\">Solution:</strong></p><p>Make sure your code is correct.</p><p>Example code:</p><pre><code>CRUD::field(\'school_information_id\')-&gt;type(\'relationship\')\n-&gt;model(\'App\\Models\\SchoolInformation\')\n-&gt;ajax(false)-&gt;data_source(backpack_url(\'user/fetch/school-information\'))\n-&gt;inline_create([\'entity\'=&gt;\'school-information\'])-&gt;attribute(\'school_name\');\n</code></pre><h1><strong style=\"color: rgb(240, 102, 102);\">Error:</strong></h1><p>\"SQLSTATE[42S22]: Column not found: 1054 Unknown column \'id\'... WHEN CREATING A BACKPACK CRUD FOR MANY-TO-MANY RELATIONSHIP TABLE</p><p><strong style=\"color: rgb(102, 163, 224);\">Solution:</strong></p><p>Search/find function looks for \'id\' as the primary key, so override: </p><pre><code>protected $primaryKey = \'work_order_id\';\n</code></pre><h1><strong style=\"color: rgb(240, 102, 102);\">Error:</strong></h1><p>The VirtualBox was created with a user that doesn\'t match the current user running  Vagrant. VirtualBox requires the same user be used to manage the vM that was created. Please re-run vagrant with that user. This is not a Vagrant issue.</p><p>Your UID: x</p><p><strong style=\"color: rgb(102, 163, 224);\">Solution:</strong></p><p>go to .<em>vagrant/machines/web/virtualbox/creator_uid</em> and set the value to your UID.</p><h1><strong style=\"color: rgb(240, 102, 102);\">Error:</strong></h1><p>A VirtualBox machine with the name \"name\" already exists. Please use another name or delete the machine with the existing name, and try again.</p><p><strong style=\"color: rgb(102, 163, 224);\">Solution:</strong></p><pre><code>vboxmanage list vms\n</code></pre><p>Output:</p><p>\"my-vm\" {c700b8b6-b766-4638-871b-736b44b7db18}</p><h1><strong style=\"color: rgb(240, 102, 102);\">Error:</strong></h1><p>The provider \'virtualbox\' that was requested to back the machine</p><p>\'bfeqservices\' is reporting that it isn\'t usable on this system. The</p><p>reason is shown below:</p><p><br></p><p>VirtualBox is complaining that the installation is incomplete. Please</p><p>run `VBoxManage --version` to see the error message which should contain</p><p>instructions on how to fix this error.</p><p><strong style=\"color: rgb(102, 163, 224);\">Solution:</strong></p><p>Install a fresh version of VirtualBox.</p><p>Remove VirtualBox:</p><pre><code>sudo apt-get purge virtualbox\nsudo apt-get remove virtualbox-dkms\nsudo apt autoremove\n</code></pre><p>Install VirtualBox</p><pre><code>sudo add-apt-repository multiverse &amp;&amp; sudo apt-get update\nsudo apt-get install virtualbox\nsudo apt-get install virtualbox-ext-pack\n</code></pre>','2021-08-22 21:39:34',1,14,6,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(82,'Creating LAMP WebSocket server with Rachet','creating-lamp-websocket-server-with-rachet','<p>We will be working in a LAMP server in DigitalOcean with a URL. Proceed only if you know how to access your files via ssh and sftp.</p><p><br></p><p>First, <a href=\"https://kodecentral.com/post/ssl-certificate\" target=\"_blank\">get SSL in your server</a>.</p><p><br></p><p>SSH into your droplet/server and run the following command:</p><pre><code>sudo a2enmod proxy_http\n</code></pre><p><br></p><p>Download <a href=\"https://github.com/gabrielfs7/ratchet-chat\" target=\"_blank\">https://github.com/gabrielfs7/ratchet-chat</a> and extract it into your var/www folder such that chat-server.php is located in <em>var/www/bin/chat-server.php</em>.</p><p><br></p><p>Edit your <em>var/www/bin/chat-server.php </em>file such that we use port 8000 (not the default 8080). If you decide to skip this make sure to replace the next steps with the new port number (xxxx instead of 8000).</p><p><br></p><p>Edit your /var/www/html/index.php file such that the connection is:</p><pre><code>var conn = new WebSocket(\'wss://yourdomain.com/wss2/\');\n</code></pre><p><br></p><p>In your server, open your <em>/etc/apache2/sites-available/000-default-le-ssl.conf </em>file and add <strong>ProxyPass /wss2/ ws://yourdomain.com:8000</strong>:</p><pre><code>&lt;VirtualHost *:443&gt;\n...\n&nbsp; &nbsp; &nbsp; &nbsp; ProxyPass /wss2/ ws://yourdomain.com:8000\n...\n&lt;/VirtualHost&gt;\n</code></pre><p><br></p><p>To get the https based load balancer working, run the following commands:</p><pre><code>sudo a2enmod ssl\nsudo a2enmod proxy\nsudo a2enmod proxy_balancer\nsudo a2enmod proxy_http\nsudo a2enmod proxy_wstunnel\n</code></pre>','2020-05-24 18:28:48',1,14,5,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(83,'Routing and rewriting','routing-and-rewriting','<p>Change the web root from /html/ to /public/ (for laravel):</p><p>edit 000-default.config:</p><pre><code>sudo nano /etc/apache2/sites-enabled/000-default.conf\n</code></pre><p><br></p><p>change all /html/ to /public/</p><p><br></p><p>If the app only works through url.com/index.php/route (with index.php) make sure to allow override:</p><pre><code>sudo nano /etc/apache2/apache2.conf\n</code></pre><ul><li>look for &lt;<em>Directory /var/www/&gt;</em></li><li>Change \"AllowOverride None\" to \"AllowOverride All\"</li><li>Do the same thing under &lt;<em>Directory /usr/share/&gt;</em></li><li><em>Save and exit the file</em></li></ul><p><br></p><p>Then allow override and restart the server:</p><pre><code>sudo a2enmod rewrite\nsudo service apache2 restart\n</code></pre>','2021-06-28 14:56:02',1,8,5,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(84,'Installing PHPMyAdmin in DigitalOcean','installing-phpmyadmin-in-digitalocean','<h1>Getting Started:</h1><p>Install packages</p><pre><code>sudo apt update\nsudo apt install phpmyadmin php-mbstring php-zip php-gd php-json php-curl\n</code></pre><p><span style=\"color: rgb(0, 102, 204);\">When prompted \"Configuring phpmyadmin\"</span></p><p>Press <strong>SPACEBAR</strong>, then <strong>TAB</strong>, then <strong>ENTER</strong>.</p><p><span style=\"color: rgb(0, 102, 204);\">When prompted \"Configuring phpmyadmin\" again</span></p><p>Press <strong>TAB</strong>, then <strong>ENTER</strong></p><p><br></p><p>Enable mbstring</p><pre><code>sudo phpenmod mbstring\n</code></pre><p>Restart the server</p><pre><code>sudo systemctl restart apache2\n</code></pre><h1>MySQL user:</h1><pre><code>sudo mysql\n</code></pre><p>Inside mysql:</p><pre><code>CREATE USER \'admin\'@\'localhost\' IDENTIFIED BY \'password\';\nGRANT ALL PRIVILEGES ON *.* TO \'admin\'@\'localhost\' WITH GRANT OPTION;\n</code></pre><p><br></p><p>making it secure: <a href=\"https://www.digitalocean.com/community/tutorials/how-to-install-and-secure-phpmyadmin-on-ubuntu-20-04\" target=\"_blank\">https://www.digitalocean.com/community/tutorials/how-to-install-and-secure-phpmyadmin-on-ubuntu-20-04</a></p><p><br></p>','2021-10-22 23:21:07',1,8,6,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(85,'PHPMyAdmin with Homestead','phpmyadmin-with-homestead','<p>SSH into the Homestead vagrant box</p><pre><code>vagrant ssh\n</code></pre><p>Then cd into /home/vagrant/</p><pre><code>cd /home/vagrant/\n</code></pre><p>Get the .zip file from <a href=\"https://phpmyadmin.net/downloads\" target=\"_blank\">phpmyadmin.net/downloads</a> by right clicking on the green \"download v.v.v\" (top right) button and copying the link. I have the 5.0.4 version. Use wget to download the zip into your /home/vagrant/ directory:</p><pre><code>wget https://files.phpmyadmin.net/phpMyAdmin/5.0.4/phpMyAdmin-5.0.4-all-languages.zip\n</code></pre><p>Unzip the file:</p><pre><code>unzip phpMyAdmin-5.0.4-all-languages.zip\n</code></pre><p>And rename the new extracted folder to phpmyadmin:</p><pre><code>mv phpMyAdmin-5.0.4-all-languages phpmyadmin\n</code></pre><p>A phpmyadmin folder is created: /home/vagrant/phpmyadmin/</p><p>Delete the .zip file:</p><pre><code>rm phpMyAdmin-5.0.4-all-languages.zip\n</code></pre><p><br></p><p>Exit your Homestead vagrant box:</p><pre><code>exit\n</code></pre><p><br></p><p>Open homestead.yaml (on your project root directory) and add these lines:</p><blockquote>sites:</blockquote><blockquote>     -</blockquote><blockquote>          map: homestead.test</blockquote><blockquote>          to: /home/vagrant/code/public</blockquote><blockquote>     -</blockquote><blockquote>          <strong>map: phpmyadmin.homestead.test</strong></blockquote><blockquote><strong>          to: /home/vagrant/phpmyadmin</strong></blockquote><p><br></p><p>Open your /etc/hosts file with the command:</p><pre><code>sudo nano /etc/hosts\n</code></pre><p>and append the following lines:</p><blockquote>192.168.10.10 homestead.test</blockquote><blockquote><strong>192.168.10.10 phpmyadmin.homestead.test</strong></blockquote><p><br></p><p>If vagrant is already running run the command:</p><pre><code>vagrant reload --provision\n</code></pre><p><br></p><p>Now go to <a href=\"http://phpmyadmin.homestead.test\" target=\"_blank\">phpmyadmin.homestead.test</a> on your browser. </p><p>The username is <strong>homestead</strong>, and your password is <strong>secret</strong>.</p>','2021-09-01 21:24:11',1,14,2,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(86,'Important DBeaver Features','important-dbeaver-features','<p>The three DBeaver features I use most are: importing databases, exporting databases, and using ER-Diagrams.</p><h1>Importing Database</h1><p>If this is a new database make sure to create it.</p><p><br></p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/laravel/dbeaver/new1.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/laravel/dbeaver/new1.png\" style=\"display: block; margin: auto;\" width=\"379\"></a></p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/laravel/dbeaver/new2.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/laravel/dbeaver/new2.png\" style=\"display: block; margin: auto;\" width=\"341\"></a></p><p>Once created you should see something like this (the tables section is empty):</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/laravel/dbeaver/new3.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/laravel/dbeaver/new3.png\" style=\"display: block; margin: auto;\" width=\"399\"></a></p><p>Once you create the database you can import it.</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/laravel/dbeaver/imp1.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/laravel/dbeaver/imp1.png\" style=\"display: block; margin: auto;\" width=\"402\"></a></p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/laravel/dbeaver/imp2.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/laravel/dbeaver/imp2.png\" style=\"display: block; margin: auto;\" width=\"434\"></a></p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/laravel/dbeaver/imp3.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/laravel/dbeaver/imp3.png\" style=\"display: block; margin: auto;\" width=\"414\"></a></p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/laravel/dbeaver/imp4.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/laravel/dbeaver/imp4.png\" style=\"display: block; margin: auto;\" width=\"450\"></a></p><p>Your database should now have the corresponding tables.</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/laravel/dbeaver/imp5.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/laravel/dbeaver/imp5.png\" style=\"display: block; margin: auto;\" width=\"334\"></a></p><p><br></p><h1>Exporting Database</h1><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/laravel/dbeaver/exp1.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/laravel/dbeaver/exp1.png\" style=\"display: block; margin: auto;\" width=\"425\"></a></p><p>If you get the error \"<span style=\"color: rgb(230, 0, 0);\">Native client is not specified in connection</span>\", make sure you set up your native client connection:</p><p>Make sure you have mysql-server installed:</p><p>Linux:</p><pre><code>sudo apt-get install mysql-server\nsudo apt-get update\nwhich mysql﻿﻿\n</code></pre><p>The last command \"which mysql\" should tell you where mysql is installed. Mine is <strong>/usr/bin/mysql</strong></p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/laravel/dbeaver/exp_err_1.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/laravel/dbeaver/exp_err_1.png\" style=\"display: block; margin: auto;\" width=\"307\"></a><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/laravel/dbeaver/exp_err_2.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/laravel/dbeaver/exp_err_2.png\" style=\"display: block; margin: auto;\" width=\"226\"></a><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/laravel/dbeaver/exp_err_3.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/laravel/dbeaver/exp_err_3.png\" style=\"display: block; margin: auto;\" width=\"245\"></a></p><p>Then \"Add home\" to /usr/bin (since my mysql is installed in /usr/bin/mysql):</p><p><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/laravel/dbeaver/exp_err_4.png\" style=\"display: block; margin: auto;\"></p><p>Finally, the exported file should be in your dbeaver-ce snap folder. Mine is /home/&lt;user&gt;/snap/dbeaver-ce/90/dbdumpfilename.sql</p><p><br></p><p><strong style=\"color: rgb(230, 0, 0);\">IF YOU STILL CAN\'T RESTORE OR IMPORT YOUR .SQL FILE YOU NEED TO INSTALL A DIFFERENT VERSION OF DBEAVER (21.1.1 WORKS AS OF RIGHT NOW).</strong></p><h1>ER-Diagram</h1><p>To access the ER-Diagram menu double click on the database name.</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/laravel/dbeaver/erd1.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/laravel/dbeaver/erd1.png\" style=\"display: block; margin: auto;\"></a></p><p>The database options menu will open on the right. Click on \"ER Diagram\" to the right of properties.</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/laravel/dbeaver/erd2.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/laravel/dbeaver/erd2.png\" style=\"display: block; margin: auto;\" width=\"750\"></a></p><p>Once you see your ER-Diagram you can right click anywhere in empty space and view the options.</p><p><a href=\"https://raw.githubusercontent.com/oscar0812/images/master/laravel/dbeaver/erd3.png\" target=\"_blank\"><img src=\"https://raw.githubusercontent.com/oscar0812/images/master/laravel/dbeaver/erd3.png\" style=\"display: block; margin: auto;\" width=\"736\"></a></p>','2021-06-28 11:03:03',1,8,7,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(87,'Section Text Chain Compression','section-text-chain-compression','<h2><strong>Part 1:</strong></h2><p>Enter a section chain to compress:</p><p>kkkpppppaaaaaaabttttttttttt</p><p>The compressed string is: k3p5a7b1t11</p><p><br></p><p><br></p><h2><strong>Part 2:</strong></h2><p>Enter a compressed string:</p><p>b1k2g14</p><p>The restored string is: bkkgggggggggggggg</p><p><br></p><pre><code>if __name__ == \'__main__\':\n\n    \'\'\'\n    PART 1\n    A chain of letters: aabccc -&gt; aa b ccc -&gt; a2b1c3\n    \'\'\'\n    keyboard_in = input(\"Enter a section chain to compress:\\n\")\n\n    prev_char = keyboard_in[0]\n    current_counter = 0\n    final_string = \"\"\n    for i in range(0, len(keyboard_in)+1):\n        if i == (len(keyboard_in)) or keyboard_in[i] != prev_char:\n            # at the end or character changed\n            final_string += str(prev_char) + str(current_counter)\n            current_counter = 1\n        elif keyboard_in[i] == prev_char:\n            # current character = previous character\n            current_counter += 1\n        if i &lt; len(keyboard_in):\n            # not at the end\n            prev_char = keyboard_in[i]\n\n    print(\"the compressed string is:\", final_string)\n\n    \'\'\'\n    PART 2\n    single letter followed by multi-digit: K1U8I2 -&gt; K1 U8 I2 -&gt; KUUUUUUUUII\n    \'\'\'\n    keyboard_in = input(\"Enter a compressed string:\\n\")\n\n    current_letter = keyboard_in[0]\n    running_digit = \"\"\n    final_string = \"\"\n\n    for i in range(0, len(keyboard_in)+1):\n        if i == len(keyboard_in) or not keyboard_in[i].isdigit():\n            # either hit a new letter, or just started reading\n            if running_digit != \"\":\n                for _ in range(0, int(running_digit)):\n                    final_string += current_letter\n                running_digit = \"\"\n            if i &lt; len(keyboard_in):\n                # not at the end so can still read\n                current_letter = keyboard_in[i]\n        else:\n            # its a digit\n            running_digit += keyboard_in[i]\n\n    print(\"The restored string is:\", final_string)\n</code></pre><p><br></p>','2020-12-26 18:58:43',1,6,5,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(88,'Alternately Sorted','alternately-sorted','<h2><strong>Question:</strong></h2><p>A logical recursive function should be written that gets a list of integers and checks whether the members with equal indicators are arranged in descending order, and the members with odd indexes are sorted in ascending order.</p><p>To test the functionality, write an initial function that receives from the user the length of the list and then the end members, a basic function that receives from the user the length of the end members.</p><p>Order not by rotation if the error is repeated.</p><p><br></p><h2><strong>Examples:</strong></h2><p>[2, 18, 3, 15, 3, 9, 7, 4]</p><p>alternately sorted</p><p>[2, 18, 3, 15, 3, 9, 7, 14]</p><p>not alternately sorted</p><p><br></p><h2><strong>Answer:</strong></h2><pre><code>def alternatively_sorted(in_list):\n&nbsp; &nbsp; if len(in_list) &lt;= 2:\n&nbsp; &nbsp; &nbsp; &nbsp; # base case, 2 or less items are sorted\n&nbsp; &nbsp; &nbsp; &nbsp; return True\n&nbsp; &nbsp; else:\n&nbsp; &nbsp; &nbsp; &nbsp; if len(in_list) &gt; 3 and in_list[3] &gt; in_list[1]:\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; # has next even, but even is not descending\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; return False\n\n\n&nbsp; &nbsp; &nbsp; &nbsp; if in_list[2] &lt; in_list[0]:\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; # odd is not ascending\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; return False\n\n\n&nbsp; &nbsp; &nbsp; &nbsp; return alternatively_sorted(in_list[2:])&nbsp; # remove first 2 elements\n\n\n\n\nif __name__ == \'__main__\':\n&nbsp; &nbsp; len_ = int(input(\"Enter length of list: \"))\n&nbsp; &nbsp; l_in = input(\"Enter list elements separated by commas (2, 4, 5, 7, 10, ...): \")\n&nbsp; &nbsp; l_in = [int(x.strip()) for x in l_in.split(\",\")]&nbsp; # split by comma and remove extra space around with strip()\n&nbsp; &nbsp; a = alternatively_sorted(l_in)\n&nbsp; &nbsp; if len_ != len(l_in):\n&nbsp; &nbsp; &nbsp; &nbsp; print(\"Lengths are incorrect!\")\n&nbsp; &nbsp; else:\n&nbsp; &nbsp; &nbsp; &nbsp; # lengths are good\n&nbsp; &nbsp; &nbsp; &nbsp; print(len_, l_in, a)\n&nbsp; &nbsp; &nbsp; &nbsp; # test cases\n&nbsp; &nbsp; &nbsp; &nbsp; b = alternatively_sorted([2, 18, 3, 15, 3, 9, 7, 4])\n&nbsp; &nbsp; &nbsp; &nbsp; c = alternatively_sorted([2, 18, 3, 15, 3, 9, 7, 14])\n\n\n&nbsp; &nbsp; &nbsp; &nbsp; print(b, c)\n</code></pre><p><br></p>','2021-01-09 12:15:27',1,6,4,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(89,'All elements greater than its neighbors','all-elements-greater-than-its-neighbors','<h2><strong>Question:</strong></h2><p>Write&nbsp;function receive a matrix&nbsp;</p><p>Checks for each number in the matrix whether its value is larger than all its neighbors</p><p>(Neighbors of an number are the numbers adjacent to it, Up, down right, left, diagonals)</p><p><br></p><p>The function will print the numbers in the matrix that larger than their neighbors</p><p>And return a counter that count how many number fulfills the condition</p><p><br></p><p>(Numpy must not be used)</p><p><br></p><h2><strong>Examples:</strong></h2><pre><code># input\nmat = [[2, 3, 4, 5, 6],\n       [6, 5, 7, 4, 3],\n       [3, 4, 9, 8, 2],\n       [5, 4, 8, 7, 6],\n       [1, 2, 9, 5, 9]]\n\n# output\n﻿1. matr[0][4]=6 &gt; (5, 4, 3)\n2. matr[1][0]=6 &gt; (3, 4, 5, 3, 2)\n3. matr[2][2]=9 &gt; (5, 4, 4, 8, 7, 8, 4, 7)\n4. matr[3][0]=5 &gt; (1, 2, 4, 4, 3)\n5. matr[4][2]=9 &gt; (4, 2, 5, 7, 8)\n6. matr[4][4]=9 &gt; (7, 5, 6)\n\n\ncount = 6\n</code></pre><p><br></p><h2><strong>Solution:</strong></h2><pre><code># return True if matrix[row][col] exists (row, column is in bounds)\ndef in_bounds(matrix, row, col):\n    if row &lt; 0 or col &lt; 0:\n        return False\n    if row &gt; len(matrix) - 1 or col &gt; len(matrix) - 1:\n        return False\n    return True\n\n\ndef get_neighbors(matrix, x, y):\n    # get the surrounding indices\n    neighbors_arr = [[x - 1, y - 1], [x, y - 1], [x + 1, y - 1], [x + 1, y], [x + 1, y + 1], [x, y + 1], [x - 1, y + 1],\n                     [x - 1, y]]\n    # check if indices are in bounds and return the list\n    return [matrix[n[0]][n[1]] for n in neighbors_arr if in_bounds(matrix, n[0], n[1])]\n\n\n# returns true if element is greater than all the values in list_, false otherwise\ndef greater_than_all(element, list_):\n    for e in list_:\n        if e &gt;= element:\n            return False\n\n    return True\n\n\n# param: matrix\n# return: number of elements which are greater than all their neighbors\ndef count_greater(matrix):\n    count_ = 0\n    for i in range(len(matrix)):\n        for j in range(len(matrix[i])):\n            neighbors = get_neighbors(matrix, i, j)\n            if greater_than_all(matrix[i][j], neighbors):\n                count_ += 1\n                print(\"{0}. matr[{1}][{2}]={3} &gt; ({4})\".format(count_, i, j, matrix[i][j],\n                                                               \', \'.join(map(str, neighbors))))\n\n    return count_\n\n\nif __name__ == \'__main__\':\n    mat = [[2, 3, 4, 5, 6],\n           [6, 5, 7, 4, 3],\n           [3, 4, 9, 8, 2],\n           [5, 4, 8, 7, 6],\n           [1, 2, 9, 5, 9]]\n\n    print(\"\\ncount = {0}\".format(count_greater(mat)))\n</code></pre><p><br></p><h2><strong>Solution 2 (requested without .join() or .format())</strong></h2><pre><code># return True if matrix[row][col] exists (row, column is in bounds)\ndef in_bounds(matrix, row, col):\n    if row &lt; 0 or col &lt; 0:\n        return False\n    if row &gt; len(matrix) - 1 or col &gt; len(matrix) - 1:\n        return False\n    return True\n\n\ndef get_neighbors(matrix, x, y):\n    # get the surrounding indices\n    neighbors_arr = [[x - 1, y - 1], [x, y - 1], [x + 1, y - 1], [x + 1, y], [x + 1, y + 1], [x, y + 1], [x - 1, y + 1],\n                     [x - 1, y]]\n    # check if indices are in bounds and return the list\n    return [matrix[n[0]][n[1]] for n in neighbors_arr if in_bounds(matrix, n[0], n[1])]\n\n\n# returns true if element is greater than all the values in list_, false otherwise\ndef greater_than_all(element, list_):\n    for e in list_:\n        if e &gt;= element:\n            return False\n\n    return True\n\n\ndef array_to_string(arr_):\n    f_string = \"\"\n    for a in arr_:\n        f_string += \" \" + str(a)\n\n    return f_string.strip().replace(\" \", \", \")\n\n\n# param: matrix\n# return: number of elements which are greater than all their neighbors\ndef count_greater(matrix):\n    count_ = 0\n    for i in range(len(matrix)):\n        for j in range(len(matrix[i])):\n            neighbors = get_neighbors(matrix, i, j)\n            if greater_than_all(matrix[i][j], neighbors):\n                count_ += 1\n                print(str(count_)+\". matr[\"+str(i)+\"][\"+str(j)+\"]=\"+str(matrix[i][j])+\" &gt; (\"+array_to_string(neighbors)+\")\")\n\n    return count_\n\n\nif __name__ == \'__main__\':\n    mat = [[2, 3, 4, 5, 6],\n           [6, 5, 7, 4, 3],\n           [3, 4, 9, 8, 2],\n           [5, 4, 8, 7, 6],\n           [1, 2, 9, 5, 9]]\n\n    print(\"\\ncount = \"+str(count_greater(mat)))\n</code></pre><p><br></p>','2021-01-11 14:35:25',1,6,3,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(90,'String mirror equality','string-mirror-equality','<h2><strong>Question:</strong></h2><p>Write a boolean recursive function receive two strings and checks if one is reflection of the other</p><h2><strong>Examples:</strong></h2><p>Strings are one mirror of the other:</p><p><br></p><p>\"abcd\"  \"dcba\"</p><p>\"$\"  \"$\"</p><p>\"\"   \"\"   (empty string)</p><p><br></p><p>Strings are not mirror one to the other: </p><p><br></p><p>\"axcd\"  \"dcba\"</p><p><br></p><p><br></p><p>Write main function to check the strings to the output</p><p><br></p><p>(\"Reverse\" must not be used)</p><h2><strong>Solution:</strong></h2><pre><code># recursive function to check if a == reflection of b\n# abcd == dcba\n# ascd != asrc\ndef is_mirror(a, b):\n    if len(a) != len(b):\n        # both strings must be the same length\n        return False\n\n    if a == \"\":\n        # both string are empty, return true\n        return True\n\n    if a[0] == b[-1]:\n        # first char of a == last char of b\n        return is_reflection(a[1:], b[:-1])  # remove the first char of a, and remove the last char of b\n    else:\n        return False\n\n\nif __name__ == \'__main__\':\n    str1 = \"dcba\"\n    str2 = \"abcd\"\n    if is_mirror(str1, str2):\n        print(str1 + \" is a mirror of \" + str2)\n    else:\n        print(str1 + \" is not a mirror of \" + str2)\n</code></pre><p><br></p>','2021-01-12 17:03:35',1,6,2,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(91,'Minimum Steps for Boundary (Tiles)','minimum-steps-for-boundary-%28tiles%29','<h2><strong>Problem:</strong></h2><p>Suppose there is a colored marble floor in block format which has 2 colors:</p><ol><li>White</li><li>Orange</li></ol><p>You have been asked to stand on any specific block, and you can travel through adjacent (left, right, up &amp; down) white blocks only.</p><p>Write a program to find the length of the minimum steps to reach one of the boundaries of the floor without stepping on an orange block.</p><p><br></p><h2><strong>Sample input:</strong></h2><ol><li>0 represents white, and 1 represents orange</li><li>Sample input: int arr[][] = {{1, 1, 1, 0, 1}, {1, 0, 0, 0, 1}, {0, 0, 1, 0, 1}, {1, 0, 1, 1, 0}}</li><li>In the above diagram you need min 2 steps to reach a boundary i.e {1, 2} (starting position) -&gt; {1, 3} -&gt; {0, 3}</li></ol><p>Write the following method:</p><p>public int minStepsForBoundary(int n, int m, int[][] arr) {</p><p>	// write code here</p><p>}</p><p><br></p><h2><strong>Solution:</strong></h2><p>We create a Node 2D-array with the same dimensions as the input arr. We initialize the \"visited\" variable to true for the 1 blocks (orange) so we don\'t visit them. We run Breadth-First Search (BFS) starting at (n, m) and stop when all nodes are visited or we reach a wall (boundary).</p><pre><code>import java.util.LinkedList;\nimport java.util.Queue;\nimport java.util.Stack;\n\nclass Node {\n    int x, y;\n    boolean visited;\n    Node from;\n\n    Node(int x, int y) {\n        this.x = x;\n        this.y = y;\n        this.visited = false;\n        this.from = null;\n    }\n}\n\npublic class MainClass {\n\n    /*  Breadth-First Search (BFS) in 2D Matrix/2D-Array (https://algorithms.tutorialhorizon.com/breadth-first-search-bfs-in-2d-matrix-2d-array/)\n        if has path:\n            return number of steps\n        otherwise:\n            return -1\n     */\n    public int minStepsForBoundary(int n, int m, int[][] arr) {\n\n        int h = arr.length;\n        if (h == 0)\n            return -1;\n        int l = arr[0].length;\n\n        Node[][] nodeMat = new Node[h][l];\n        for (int x = 0; x &lt; h; x++) {\n            for (int y = 0; y &lt; l; y++) {\n                nodeMat[x][y] = new Node(x, y);\n                nodeMat[x][y].visited = arr[x][y] == 1; // cant visit if 1 (wall)\n            }\n        }\n\n        // check if init coordinate is legal\n        if (n &lt; 0 || m &lt; 0 || n &gt;= h || m &gt;= l) {\n            return -1;\n        }\n\n        Queue&lt;Node&gt; queue = new LinkedList&lt;&gt;();\n\n        queue.add(nodeMat[n][m]);\n        Node wallNode = null;\n\n        while (!queue.isEmpty()) {\n\n            Node coordinate = queue.remove();\n            int row = coordinate.x;\n            int col = coordinate.y;\n\n            if (nodeMat[row][col].visited)\n                continue;\n\n            // check if wall\n            if (row == 0 || row + 1 == h || col == 0 || col + 1 == l) {\n                wallNode = coordinate;\n                break;\n            }\n\n            nodeMat[row][col].visited = true;\n\n            if (!nodeMat[row][col - 1].visited) {\n                // go left\n                nodeMat[row][col - 1].from = coordinate;\n                queue.add(nodeMat[row][col - 1]);\n            }\n\n            if (!nodeMat[row][col + 1].visited) {\n                // go right\n                nodeMat[row][col + 1].from = coordinate;\n                queue.add(nodeMat[row][col + 1]);\n            }\n\n            if (!nodeMat[row - 1][col].visited) {\n                // go up\n                nodeMat[row - 1][col].from = coordinate;\n                queue.add(nodeMat[row - 1][col]);\n            }\n\n            if (!nodeMat[row + 1][col].visited) {\n                // go down\n                nodeMat[row + 1][col].from = coordinate;\n                queue.add(nodeMat[row + 1][col]);\n            }\n\n        }\n\n        // finished BFS, now print the path (not required)\n        if (wallNode != null) {\n            Stack&lt;Node&gt; pathStack = new Stack&lt;&gt;();\n\n            while (wallNode != null) {\n                pathStack.push(wallNode);\n                wallNode = wallNode.from;\n            }\n\n            int size = pathStack.size();\n\n            while (!pathStack.empty()) {\n                Node n1 = pathStack.pop();\n                System.out.print(\"{\" + n1.x + \", \" + n1.y + \"} \");\n            }\n            System.out.println();\n\n            return size - 1; //  don\'t count initial node\n        }\n\n        // -1 since no path\n        return -1;\n\n    }\n\n    public static void main(String[] args) {\n\n        int[][] grid = new int[][]{\n                {1, 1, 1, 0, 1},\n                {1, 0, 0, 0, 1},\n                {0, 0, 1, 0, 1},\n                {1, 0, 1, 1, 0}\n        };\n        MainClass d = new MainClass();\n        int steps = d.minStepsForBoundary(1, 2, grid);\n        System.out.println(steps);\n\n        steps = d.minStepsForBoundary(3, 1, grid);\n        System.out.println(steps);\n    }\n}\n</code></pre>','2021-01-19 17:41:15',1,6,1,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(92,'Convert DOCX in Laravel using LibreOffice','convert-docx-in-laravel-using-libreoffice','<p>Supported conversion formats include:</p><ul><li>pptx =&gt; pdf</li><li>ppt =&gt; pdf</li><li>pdf =&gt; pdf</li><li>docx =&gt; pdf, odt, html</li><li>doc =&gt; pdf, odt, html</li><li>xlsx =&gt; pdf</li><li>xls =&gt; pdf</li><li>png =&gt; pdf</li><li>jpg =&gt; pdf</li><li>jpeg =&gt; pdf</li></ul><h1>Dependencies</h1><p>First install LibreOffice in your Linux server:</p><pre><code>sudo apt-get install libreoffice\n</code></pre><p>Then install the <a href=\"https://github.com/ncjoes/office-converter\" target=\"_blank\">PHP Wrapper for LibreOffice:</a></p><pre><code>composer require ncjoes/office-converter\n</code></pre><h1>Usage</h1><p>My working path is storage so I will use the storage/word_file_1.docx file and convert it to storage/pdf_file_1.pdf</p><pre><code>&lt;?php\nuse NcJoes\\OfficeConverter\\OfficeConverter;\n\n$doc_path = \\Storage::path(\'word_file_1.docx\');\n$converter = new OfficeConverter($doc_path);\n$converter-&gt;convertTo(\'pdf_file_1.pdf\');\n?&gt;\n</code></pre>','2021-08-06 11:34:46',1,14,4,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(93,'Backpack for Laravel','backpack-for-laravel','<p>&gt; composer update</p><p>&gt; composer require backpack/crud:\"4.1.*\"</p><p>&gt; composer require backpack/generators --dev</p><p>&gt; composer require laracasts/generators --dev</p><p>&gt; sudo bash update.sh</p><p>&gt; php artisan backpack:install</p><p>&gt; php artisan backpack:crud OBJECT</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;OBJECT naming convention: table name = \'game_ranks\', OBJECT = \'gameRank\'</p><p><br></p><p>- Exception: Please use CrudTrait on the model.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\"use Backpack\\CRUD\\app\\Models\\Traits\\CrudTrait;\"</p>','2021-08-16 11:00:42',1,14,3,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(94,'Pattern Sequence','pattern-sequence','<h2>Problem:</h2><p>Devise an algorithm to draw the following squares when N = 0, 1, 2, 3, 4, 5. Then generate your algorithm by observing the pattern:</p><h2>Sample output:</h2><p><strong>n = 5:</strong></p><p>rbrrbr</p><p>rrbrr</p><p>brrb</p><p>rbr</p><p>rr</p><p>b</p><p><strong>n = 4:</strong></p><p>rrbrr</p><p>brrb</p><p>rbr</p><p>rr</p><p>b</p><p><strong>n = 0:</strong></p><p>b</p><h2>Solution:</h2><p>We notice that the pattern follows a diagonal coloring approach. If y%3 == 0 then we start at x = 0 and color every 3 blocks. If y%3 == 1 then we start at x = 2 and color every 3 blocks. if y%3==2 then we start at x = 1 and color every 3 blocks.</p><pre><code># the offset of the first blue box from x\n# if x == 0, and y == 0 -&gt; blue\n# if y == 1 or y == 3 or ... (y % 3 == 1) -&gt; 2 red blocks first, then first blue\n# if y == 2 or y == 4 or ... (y % 3 == 2) -&gt; 1 red block first, then first blue\ndef get_offset(y_):\n    ret_ = {0: 0, 1: 2, 2: 1}\n    return ret_[y_ % 3]\n\n\nif __name__ == \'__main__\':\n    n = 4\n    # loop backwards\n    # the example shows 6x6 for n = 5, so we need -1 on outer loop and y + 1 on inner loop\n    for y in range(n, -1, -1):\n        b_offset = get_offset(y)\n        for x in range(0, y+1):\n            if x % 3 == b_offset:\n                print(\'b\', end=\'\')\n            else:\n                print(\'r\', end=\'\')\n        print()\n</code></pre><p><br></p>','2021-10-28 09:31:09',1,6,0,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL);
